    "Description": "\uc815\uc120\uc544\ub9ac\ub791 \ud750\ub974\ub294 \uc815\uc120\uc758 \uc9c0\ubd95     \uac15\uc6d0\ub3c4 \ud3c9\ucc3d\uad70\uacfc \uc815\uc120\uad70\uc740 \uc774 \uace0\uc7a5 \uc9c0\ubd95 \uc5ed\ud560\uc744 \ud558\uace0 \uc788\ub294 \uac00\ub9ac\uc655\uc0b0\uc744 \uc911\uc2ec\uc73c\ub85c \ud5d8\ub09c\ud55c \uace0\uc0b0\uc900\ub839\uc774 \uc774\ub8e8\uc5b4\uc9c4\ub2e4\uace0 \ud574\ub3c4 \uacfc\uc5b8\uc774 \uc544\ub2c8\ub2e4  \uc815\uc120\uc758 \uc8fc\uc0b0 \uac00\ub9ac\uc655\uc0b0\uc740 \uac08\uc655    \uc774 \ub09c\uc744 \ud53c\ud558\uc5ec \uc228\uc5b4\ub4e0 \uacf3\uc774\ub77c \ud558\uc5ec \uac08\uc655\uc0b0     \uc774\ub77c \ubd88\ub9ac\ub2e4\uac00 \uc77c\uc81c\uc2dc\ub300\ub97c \uac70\uce58\uba74\uc11c \uac00\ub9ac\uc655\uc0b0      \uc73c\ub85c \ubd88\ub9ac\uace0 \uc788\ub2e4         \uac00\ub9ac\uc655\uc0b0 \uc0c1\ubd09 \uc11c\ucabd\uc758 \uc911\uc655\uc0b0         \uacfc \uc0c1\ubd09 \uc0ac\uc774 \uc548\ubd80\uc778 \ub9c8\ud56d\uce58     \uc5d0\ub294 \uad6d\ub0b4 \uc720\uc77c\uc758  \uac15\ub989\ubd80\uc0bc\uc0b0\ubd09\ud45c          \ub77c \uc0c8\uaca8\uc9c4 \ube44\uac00 \uc138\uc6cc\uc838 \uc788\ub2e4  \uc774\ub294 \uc77c\ubc18\uc778\ub4e4\uc758 \ucc44\uc0bc\uc744 \uae08\uc9c0\ud558\ub294 \uad6c\uc5ed\uc744 \ub73b\ud558\ub294 \uac83\uc73c\ub85c \uac00\ub9ac\uc655\uc0b0\uc774 \uc870\uc120\uc2dc\ub300 \ub54c \uc0b0\uc0bc\uc758 \uc8fc\uc0b0\uc9c0\uc600\uc74c\uc744 \uc54c \uc218 \uc788\ub294 \ub300\ubaa9\uc774\ub2e4  \uc0c1\ubd09\uc744 \uc911\uc2ec\uc73c\ub85c \ub0a8\ub3d9\ucabd\uc73c\ub85c \uc911\ubd09         \ud558\ubd09         \uc5d0 \uc774\ub974\uae30\uae4c\uc9c0 \uc721\uc911\ud55c \uc0b0\uc138\uac00 \ubd80\ub4dc\ub7fd\uac8c \uc774\uc5b4\uc9c4\ub2e4 "
