    "Description": "    \uac1c\uc131 \uc5c6\ub294 \uc601\ub0a8\uc54c\ud504\uc2a4 \uadf8 \ucd5c\uace0\ubd09        \ubd80\uc0b0\uc0b0\uc545\uc778\ub4e4\uc774 \uc774\ub984\ubd99\uc778 \uc601\ub0a8\uc54c\ud504\uc2a4\ub294 \ub099\ub3d9\uc815\ub9e5 \uc544\ub7ab\ubd80\ubd84\uc758 \ucc9c \ubbf8\ud130 \ub118\ub294 \uc0b0\ub4e4\uc744 \ucd1d\uce6d\ud558\ub294 \uac1c\ub150\uc774\ub2e4  \uc774 \uac70\uc6b8\uc5d0 \ube44\uce5c  \uc790 \ubaa8\uc591 \uc0b0\uc904\uae30\ub294 \uadf8\ub7ec\ub098 \uace0\ubd09\ub2a5\uc120\uc73c\ub85c \uc774\uc5b4\uc9c4 \ud0d3\uc5d0 \ub0b1\ub0b1\uc73c\ub85c\ub294 \uc369 \ube7c\uc5b4\ub09c \uac83\uc774 \uc5c6\ub2e4          \ub2a5\uc120 \uc548\ubd80\uc640 \uc815\uc0c1\uc758 \uace0\ub3c4\ucc28\uac00 \uc5bc\ub9c8 \ub418\uc9c0 \uc54a\uc740 \ud0d3\ub3c4 \uc788\ub2e4  \uac1c\ud65c\uc9c0\uac00 \ud3bc\uccd0\uc9c4 \ub3d9\ucabd\uc5d0\uc11c \ubcfc \ub54c \uc0c1\ubd09\ub4e4\uc774 \ub2a5\uc120 \uc804\uba74\uc73c\ub85c \ud280\uc5b4\ub098\uc640 \uc788\uc9c0 \uc54a\uace0 \ub4a4\ub85c \ubb3c\ub7ec\ub098\uc788\ub2e4\ub294 \uc810\ub3c4 \uc774\uc720\ub2e4  \uadf8\ub798 \uac00\uc7a5 \ub0a8\ucabd\uc758 \uc601\ucde8\uc0b0\uc744 \uc81c\uc678\ud558\uace0\ub294 \ub2e4\ub4e4 \uc800 \ub192\uc740 \ub370\uc11c \uc57d\uac04\uc529 \uc624\ub974\ub0b4\ub9ac\ub294 \ub300\uc7a5\ubcbd\uc758 \uc77c\ubd80\uc77c \ub530\ub984\uc774\ub2e4          \ucd5c\uace0\ubd09\uc774\ub77c\ub294 \uac00\uc9c0\uc0b0 \uc5ed\uc2dc \uc5ec\ub7ff \uc911\uc758 \ud558\ub098\uc5d0 \ub2e4\ub984\uc544\ub2c8\ub2e4  \uac8c\ub2e4\uac00  \ub2a5\ub3d9\uc0b0\ucc98\ub7fc \ub2a5\uc120\uc0bc\uac70\ub9ac\uc5d0 \uc790\ub9ac\uc7a1\uc544 \uac1c\uc131\uc774 \ub354\uc6b1 \ubb3b\ud600\ubc84\ub838\ub2e4  \ub3c4\ub9bd\uacf5\uc6d0\uc774\ub77c\uc9c0\ub9cc \ubd81\ucabd \uccad\ub3c4\ucabd\uc740 \ub610 \ub458\ubc16\uc5d0 \uc548 \ub418\ub294 \uc0b0\uae38\uc744 \ubaa8\ub450 \ub9c9\uc544\ubc84\ub9b0 \uc0c1\ud0dc\ub2e4 "
