    "Description": "       \uacc4\ub958\ubbf8 \ub6f0\uc5b4\ub09c \ud638\ub0a8\uc758 \ubb18\ud5a5            \ub144 \uc0ac\uc0c1 \ucd5c\ucd08\ub85c \uad70\ub9bd\uacf5\uc6d0\uc774 \ub41c \uc0b0\uc774\ub2e4   \uad70\ub9bd \uc774\ub77c\ub294 \uaddc\ubaa8\uc5d0 \uac78\ub9de\uac8c    \ubbf8\ud130\uac00 \ucc44 \uc548\ub418\uc9c0\ub9cc  \uacf5\uc6d0 \ub2f5\uac8c \ub6f0\uc5b4\ub09c \uacc4\ub958\ubbf8\ub97c \uc790\ub791\ud55c\ub2e4          \uc704\ub294 \uc721\uc0b0  \uc544\ub798\ub294 \uace8\uc0b0    \uc774\uc5b4\uc11c \ubc14\uc704\ub4e4\uc774 \uac70\uc758 \uc0b0\uc911\ud131 \uc544\ub7ab\ub158\uc5d0 \ubab0\ub824\uc788\ub2e4  \ud558\uc5ec  \ud0ac\ub85c\ubbf8\ud130 \uc554\ubcbd\ud611\uace1\uc73c\ub85c \ube44\ub8e1\uacc4\uace1\uc758 \ube44\ub8e1\ud3ed\ud3ec  \ubb3c\ud1b5\uace8\uc758 \uc57d\uc218\ud3ed\ud3ec  \uc18c\ubaa9\uace8 \uc6a9\ub450\ud3ed\ud3ec  \uacc4\uace1 \ubcf8\ub958\ub85c\ub294 \ubcd1\ud48d\ubc14\uc704\uc758 \uc778\uacf5\ud3ed\ud3ec  \uc7a5\ub300\ud55c  \uc7a5\uad70\ud3ed\ud3ec\uac00 \uc3df\uc544\uc838 \ub0b4\ub9ac\uace0 \uc788\ub2e4  \uc5ec\uae30\uc5d0 \uc6a9\ubc14\uc704  \ud638\ub450\uc554  \ud22c\uad6c\ubd09\uc758 \ubc14\uc704\ub4e4\uacfc \uae08\uac15\uad74  \uc218\uc88c\uad74  \ud615\uc81c\uad74\uc758 \ub3d9\uad74\uc774 \uc5b4\uc6b0\ub7ec\uc9c0\uace0 \uac15\ucc9c\uc0ac\uc640 \uc0bc\uc778\ub300\uc758 \uc804\uc124\uae4c\uc9c0 \uae43\ub4e4\uc5b4\uc788\uc73c\ub2c8 \ud55c \ub9c8\ub514\ub85c \uc791\uc740 \ubb18\ud5a5\uc0b0  \uc7a5\uc5c4\ud558\uba74\uc11c\ub3c4 \ube7c\uc5b4\ub09c \uc5ed\uc7a5\uc5ed\uc218      \uc758 \uae30\uacbd\uc774\ub77c \ud560 \uac83\uc774\ub2e4          \uc608\uc804\uc5d0\ub294 \uc6a9\ucc9c\uc0b0\uc774\ub77c \ubd88\ub838\ub294\ub370 \uc1a1\uc775\ud544\uc774\ub77c\ub294 \uc0ac\ub78c\uc758 \uc2dc  \uc219   \uac15\ucc9c\uc0ac \uac00 \ub728\uba74\uc11c \uac15\ucc9c\uc0b0\uc73c\ub85c \ubc14\uafe8\ub2e4\uace0 \ud55c\ub2e4  \uc815\ub9d0 \uc5b4\ucc98\uad6c\ub2c8\uc5c6\ub294 \ucc3d\uc528\uac1c\uba85\uc774 \uc544\ub2d0 \uc218 \uc5c6\uc9c0\ub9cc \uc775\ud544\uc758 \uc790   \ub85c \uc0b0\uc774\ub984\uc744 \uc0bc\uc740 \uc9c4\uc548 \uc6b4\uc7a5\uc0b0\uc774 \uac00\uc7a5 \uba4b\uc9c4 \ubd80\ubd84\uae4c\uc9c0 \ud638 \uad6c\ubd09\uc5d0 \ube8f\uae34 \uac83\uc5d0 \ub300\uba74 \uadf8\ub798\ub3c4 \ub0ab\ub2e4 \ud560 \uac83\uc774\ub2e4  \uadf8 \uc1a1\uc775\ud544\uc740 \uc120\uc870\ub54c \uc11c\uc778\uc758 \ub9c9\ud6c4\uc2e4\ub825\uc790\uc600\ub2e4     "
