    "Place": "\ub300\uc804\uad11\uc5ed\uc2dc, \ucda9\uccad\ub0a8\ub3c4 \uacf5\uc8fc\uc2dc \uacc4\ub8e1\uba74\u318d\ub17c\uc0b0\uc2dc \uc0c1\uc6d4\uba74\u318d\uacc4\ub8e1\uc2dc \uc2e0\ub3c4\uc548\uba74",
    "Description": "    \ucda9\ub0a8 \uc81c\uc77c\uc758 \uc601\uc0b0\uc774\uc790 \uba85\uc0b0        \uacc4\ub8e1\uc0b0\uc740 \uc218\ub824\ud55c \uc0b0\uc138\uc640 \uc2b9\uc9c0 \uc2e0\ub3c4\uc548  \uc5ec\ub7ec \uace0\ucc30\ub4e4\uc744 \ud488\uc740 \ucda9\ub0a8 \uc81c\uc77c\uc758 \uba85\uc0b0\uc774\ub2e4  \uc774\ubbf8 \uc2e0\ub77c\uc2dc\ub300  \uc545\uc758 \ud558\ub098\uc600\uace0 \uc870\uc120\uc2dc\ub300\uc5d0\ub294 \ubb18\ud5a5\uc0b0  \uc9c0\ub9ac\uc0b0\uacfc \ud568\uaed8 \uc0b0\uc2e0\uc81c\ub97c \uc62c\ub9ac\ub358 \uc601\uc0b0\uc774\uc5c8\ub2e4      \uc8fc\ubd09\uc778 \ucc9c\ud669\ubd09\uc5d0\uc11c \uc300\uac1c\ubd09\uc73c\ub85c \uc774\uc5b4\uc9c0\ub294 \ub2a5\uc120\ubbf8\uac00 \ud0c0\uc758 \ucd94\uc885\uc744 \ubd88\ud5c8\ud55c\ub2e4  \uc774 \ub9e8\ub4dc\ub77c\ubbf8 \uac19\uc740 \uc6a9\uba38\ub9ac\uac00 \uc624\uc885\uc885\ud558\ub2c8 \uac00\uc6b4\ub370\uac00 \ub192\uc740 \uc554\ud0c9 \ubcbc\uc2ac\ucc98\ub7fc \ubcf4\uc778\ub2e4 \ud558\uc5ec \uacc4\ub8e1\uc774\ub77c\ub294 \uc774\ub984\uc774 \ubd99\uc5c8\ub2e4      \uc6a9\uc720\uc18c  \uc774\uc77c\ucc9c  \ubc31\ub8e1\uac15  \ub2ec\ubb38\ud0dd  \uad70\uc790\ud0dd  \uba85\uc6d4\ub2f4  \uacc4\ub8e1\uba85\uc554  \uc218\uc815\ubd09 \ub4f1\uc758 \uba85\uc18c\uac00 \uacf3\uacf3\uc5d0 \ubc8c\uc5ec\uc788\ub2e4  \uacc4\ub8e1  \uacbd\uc758 \ud558\ub098\uc778 \uc740\uc120\ud3ed\ud3ec  \uc601\ud5d8\ud568 \ub54c\ubb38\uc5d0 \ubb34\uc18d\ud589\uc0ac \uc7a5\uc18c\ub85c \uac01\uad11\ubc1b\ub294 \ud639\uc740 \ubc1b\uc558\ub358  \uac11\uc0ac\uacc4\uace1\uc758 \uc6a9\ubb38\ud3ed\ud3ec  \uc2e0\ub3c4\uc548 \uc6a9\ucd94\ud3ed\ud3ec\ub85c \ub4dc\ub7ec\ub098\ub4ef \uacc4\uace1\ubbf8 \ub610\ud55c \ube7c\uc5b4\ub098\ub2e4      \ud3ed\ud3ec\uc640 \uae30\uc554\uc808\ubcbd\uc774 \uc870\ud654\ub97c \uc774\ub8ec \uacc4\ub8e1\uc0b0\uc740 \ub2e8\ud48d\uc73c\ub85c\ub3c4 \uc720\uba85\ud558\ub2e4    \uc6d4 \ud558\uc21c\uc5d0 \uc808\uc815\uc744 \uc774\ub8e8\ub294 \ub3d9\ud559\uc0ac\uacc4\uace1  \ub0a8\ub9e4\ud0d1  \uc0bc\ubd88\ubd09\uacfc \uad00\uc74c\ubd09\uc5d0 \uc774\ub974\ub294 \uad6c\uac04\uc774 \ubc31\ubbf8\ub2e4     \ub3d9\ucabd \ub3d9\ud559\uc0ac  \uc11c\ucabd\uc758 \uac11\uc0ac  \ub0a8\ucabd \uc2e0\uc6d0\uc0ac \ub4f1 \uc0ac\ubc29\uc758 \uace0\ucc30\uc5d0\ub294 \ubb38\ud654\uc7ac\ub3c4 \ub9ce\ub2e4  \uc774 \uc911 \uad6d\ubcf4 \ud558\ub098\uc640 \ubcf4\ubb3c \ub137\uc744 \uac04\uc9c1\ud55c \uac11\uc0ac  \uace0\ub824\ub9d0\uc758 \uc138 \ucda9\uc2e0\uc744 \ubaa8\uc2e0 \uc0bc\uc740\uac01  \ub3d9\ud559\uc0ac\ub294 \uaf2d \ub4e4\ub7ec\ubcfc \uc77c\uc774\ub2e4 "
