    "Description": "              \ubc31\ub9cc \uba85 \ubaa9\uc228 \uad6c\ud558\ub294 \uc0b0                                  \uc815\uc0c1 \uc77c\ub300\uc758 \ubc14\uc704 \ub2a5\uc120\uc774 \uba40\ub9ac\uc11c \ubcf4\uba74 \ub2ed\uc758 \ubccf\ucc98\ub7fc \uc19f\uc544\uc11c \ubd99\uc740 \uc774\ub984\uc774  \uacc4\ub8e1 \uc774\ub2e4  \ud574\ubc1c     \uc758 \uacc4\ub8e1\uc0b0\uc740 \uac70\uc81c\uc2dc \uc911\uc2ec\ubd80\uc5d0 \uc788\uc5b4\uc11c \ub4f1\uc0b0\ub85c\ub9cc \ud574\ub3c4  \uac1c\uac00 \ub098\uc788\uc744 \uc815\ub3c4\ub85c \uac70\uc81c\uc2dc\ubbfc\ub4e4\uc758 \uc0ac\ub791\uc744 \ubc1b\uace0 \uc788\ub2e4  \uc815\uc0c1\uc5d0 \uc774\ub974\ub294 \uac00\uc7a5 \uae34 \ub4f1\uc0b0\ub85c\ub294 \uc6a9\uc0b0\ub9c8\uc744\uc5d0\uc11c \uc2dc\uc791\ud574 \uace0\uc790\uc0b0\uce58\uc640 \ubbf8\uad70\ud1b5\uc2e0\ub300 \uc794\ud574  \uc758\uc0c1\ub300 \uac70\uce58\ub294 \uae38       \uc5d0 \ucd1d  \uc2dc\uac04   \ubd84 \uac78\ub9b0\ub2e4  \uadf8\ub7ec\ub098 \uc6a9\uc0b0\ub9c8\uc744\uc5d0\uc11c \ubcf8\uaca9\uc801\uc778 \ub4f1\uc0b0\ub85c\uc5d0 \uc811\uc5b4\ub4e4 \ub54c\uae4c\uc9c0   \ubd84 \uc815\ub3c4 \uc784\ub3c4\ub97c \uac78\uc5b4\uc57c \ud558\ub294 \uc9c0\ub8e8\ud568\uc774 \uc788\ub2e4  \uacc4\ub8e1\uc0b0 \ub2a5\uc120\uc5d0\ub294 \uc544\uae30\uc790\uae30\ud55c \uc554\ub989\uc9c0\ub300\uac00 \ub9ce\uc740\ub370 \ub300\ubd80\ubd84 \ucca0\uc81c\uacc4\ub2e8\uacfc \ub300\ud615 \ubaa9\uc81c\uacc4\ub2e8\uc774 \uc124\uce58\ub418\uc5b4 \uc788\uc5b4 \ud3b8\ud558\uac8c \uc0b0\ud589\uc744 \uc990\uae38 \uc218 \uc788\ub2e4  \uadf8\ub7ec\ub098 \uc2dc\uc124\ubb3c\uc774 \uc5c6\ub294 \uc77c\ubd80 \uad6c\uac04\uc5d0\uc11c\ub294 \uc8fc\uc758\ub97c \uc694\ud55c\ub2e4  \uc0ac\uae30\uc7a5\uace8\uc5d0\uc11c \uc2dc\uc791\ud574 \uacc4\ub8e1\uc0b0 \uc120\uc790\uc0b0\uc744 \uc885\uc8fc\ud558\uace0 \uac70\uc81c\uc790\uc5f0\uc608\uc220\ub79c\ub4dc\ub85c \ud558\uc0b0\ud558\ub294 \ucf54\uc2a4\ub294 \uc57d     \uc5d0 \ub2ec\ud574  \uc2dc\uac04\ucbe4 \uac78\ub9b0\ub2e4  \ud734\uc2dd\uacfc \uc810\uc2ec\uc2dc\uac04\uc744 \ud3ec\ud568\ud558\uba74 \ud558\ub8e8 \uc0b0\ud589\ucf54\uc2a4\ub85c \uc801\ub2f9\ud558\ub2e4 "
