    "Description": "\uc548\ub355\uba74 \ucc3d\ucc9c\ub9ac \uc55e \ucc3d\uace0\ucc9c \uac74\ub108\uc5d0 \ub3d9\uc11c\ub85c \uae38\uac8c \uac00\ub85c\ub204\uc6b4 \ud615\ud0dc\uc774\uba70  \ub0a8\uc0ac\uba74\uc758 \ub09c\ub4dc\ub974 \ub300\ud3c9\ub9ac \ub97c \ubcd1\ud48d\ucc98\ub7fc \uc5d0\uc6cc\uc2f8\uace0 \uc788\ub294 \uc624\ub984\uc785\ub2c8\ub2e4  \ub300\ud3c9\ub9ac \uc11c\ub09c\ub4dc\ub974 \uc5d0\uc11c \uac10\uc0b0\ub9ac \uc548\ub355\uacc4\uace1\uc744 \uc787\ub294 \ub3c4\ub85c\uac00 \uad70\uc0b0 \uc11c\ucabd\uc0ac\uba74\uc758 \uae09\uacbd\uc0ac\ub97c \uac00\ub85c\uc9c0\ub974\uba70 \uad6c\ubd88\uad6c\ubd88 \uc774\uc5b4\uc838 \uc788\uc73c\uba70  \uc774 \ub3c4\ub85c\ub85c \ubd80\ud130 \uad70\uc0b0 \ub0a8\uc0ac\uba74\uc758 \ud1f4\uc801\uce35\uacc4\uace1\uc73c\ub85c \ub4e4\uc5b4\uac00\ub294 \uae38\uc774 \ub098\uc788\ub2e4  \uc624\ub984\uc815\uc0c1\uc744 \uc911\uc2ec\uc73c\ub85c \ub3d9\ubc18\ubd80\ub294 \uc11c\uadc0\ud3ec\uc2dc  \uc11c\ubc18\ubd80\ub294 \ub0a8\uc81c\uc8fc\uad70\uc5d0 \uc18d\ud558\uc5ec \uc2dc\uad70\uacbd\uacc4\ub97c \uc774\ub8e8\uace0 \uc788\uc73c\uba70  \ub0a8\uc11c\ucabd\uc758 \uc6d4\ub77c\ubd09 \ub3c4\ub798\uc624\ub984      \uacfc \uc774\uc6c3\ud574 \uc788\uc2b5\ub2c8\ub2e4  \uc815\uc0c1\ubd80\uc5d0 \uc6a9\uc758 \uba38\ub9ac\uc5d0 \uc30d\ubd09\uc774 \uc19f\uc558\ub2e4\uace0 \ud558\ub294 \ub450 \uac1c\uc758 \ubfd4\ubc14\uc704  \ub3d9\ub0a8\uc0ac\uba74\uc758 \uc560\uae30\uc5c5\uac1c \ub3cc \ub4f1\uc758 \ud1f4\uc801\uce35\uc758 \ucc28\ubcc4\uce68\uc2dd\uc5d0 \uc758\ud55c \uae30\uc554\uad34\uc11d  \ub0a8\uc0ac\uba74 \uacc4\uace1\uc5d0 \ubc1c\ub2ec\ub41c \uc6c5\uc7a5\ud55c \ud1f4\uc801\uce35\uc758 \uc218\ud3c9\uce35\ub9ac \ub4f1 \uad70\uc0b0\uc740 \uac10\ucdb0\uc838 \uc788\ub294 \uc81c\uc8fc\ub3c4 \ucd5c\ub300\uc758 \ud654\uc0b0\uc1c4\uc124\uc131 \ud1f4\uc801\uce35\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c4 \uae30\uc0dd\ud654\uc0b0\uccb4\uc785\ub2c8\ub2e4  \uc720\uc0ac\uc2dc\ub300\uc758 \ubd84\ucd9c\uae30\ub85d\uc778     \ub144 \ubaa9\uc885  \ub144 \uc758 \uae30\ub85d\uc5d0 \uc0c8\ub85c\uc774 \ub9cc\ub4e4\uc5b4\uc84c\ub2e4\ub294 \uc11c\uc0b0    \uc774 \uc9c0\uae08\uc758 \uad70\uc0b0\uc778 \uac83\uc73c\ub85c \uc5ec\ub7ec\ud559\uc790\ub4e4\uc5d0 \uc758\ud574 \uc54c\ub824\uc838 \uc788\ub2e4              \uadf8\ub7ec\ub098 \uc774\ub7f0\uaddc\ubaa8\uc758 \ud1f4\uc801\uce35\uc774 \ud654\uc0b0\ubd84\ucd9c\uc5d0 \uc758\ud574\uc11c \uc77c\uc2dc\uc5d0 \ub9cc\ub4e4\uc5b4\uc84c\ub2e4\ub294 \uac83\uc740 \uc9c0\uc9c8\ud559\uc801\uc778 \uc0c1\uc2dd\uc73c\ub85c\ub294 \ubc1b\uc544\ub4e4\uc77c \uc218 \uc5c6\uc73c\uba70  \ud639\uc2dc \ud654\uc0b0\uccb4 \uc0c1\uc5d0\uc11c \uc9c0\uc9c4\uc744 \ub3d9\ubc18\ud55c \ud6c4\ud654\uc0b0 \ud65c\ub3d9\uc740 \uc5b4\ub290\uacf3\uc5d0\uc11c\ub098 \uac00\ub2a5\ud55c \uac83\uc774\ubbc0\ub85c \uc774\ub7ec\ud55c \uac00\ub2a5\uc131\uc744 \uc804\ud600 \ubc30\uc81c\ud560 \uc218\ub294 \uc5c6\uc744 \uac83\uc774\ub2e4  \ub2e4\ub9cc \uc81c\uc8fc\ud654\uc0b0\ub3c4\uc0c1\uc5d0 \ubd84\ud3ec\ud558\ub294 \uae30\uc0dd\ud654\uc0b0\uccb4\uc758 \uc2e0\uad6c \uad6c\ubd84\uacfc \uc6d0\ud615\ubcf4\uc874 \uc5ec\ubd80\uc758 \uace0\ucc30\uc5d0 \uc758\ud574\uc11c \ubcf8 \uc624\ub984\ubcf4\ub2e4\ub294 \uc1a1\uc545\uc0b0\uc9c0\uc5ed\uc774\ub098 \ube44\uc591\ub3c4\uc9c0\uc5ed\uc5d0\uc11c\uac00 \ud6c4\ud654\uc0b0\uc758 \uc5ec\uc6b4\uacfc \uadf8\uc5d0 \ub3d9\ubc18\ub41c \uc9c0\uc9c4\ud65c\ub3d9 \uac00\ub2a5\uc131\uc774 \ub354 \ub18d\ud6c4\ud55c \uac83\uc73c\ub85c \ud310\ub2e8\ub41c\ub2e4               \ud45c\uace0      \ube44\uace0       \ub458\ub808        \uba74\uc801             \uc800\uacbd       "
