    "Description": "    \uccad\ud48d\ud638\ubc18 \ube44\ub2e8\ubb3c\uacb0 \uc774\ub8ec \uc0b0        \uae08\uc218\uc0b0         \uc740 \uc0b0\uc138\uac00 \uc218\ub824\ud558\uace0  \uace8\uc774 \uae4a\uace0 \uae30\uc554\uc808\ubcbd\uc774 \uc808\uacbd\uc744 \uc774\ub904 \uc0ac\ucca0 \ub4f1\uc0b0\uc778\ub4e4\uc758 \ubc1c\uae38\uc774 \uc774\uc5b4\uc9c0\ub294 \uacf3\uc774\ub2e4  \ube44\ub2e8\ud3ed\uc744 \uae54\uc544\ub193\uc740 \ub4ef\ud55c \ub179\uc74c \uc18d\uc5d0 \uacc4\uace1\uc758 \ub9d1\uc740 \ubb3c\uc18c\ub9ac  \ubb3c\ud655\uc5d0 \ub5a8\uc5b4\uc9c0\ub294 \ud3ed\ud3ec\uc18c\ub9ac  \uaf43  \ub179\uc74c  \ub2e8\ud48d  \uc124\uacbd \ub4f1 \uc5b4\ub290 \ud55c\uacc4\uc808\ub3c4 \ube7c\ub193\uc9c0 \uc54a\uace0 \uc544\ub984\ub2e4\uc6c0\uc744 \uc790\ub791\ud55c\ub2e4  \uae08\uc218\uc0b0\uc740 \ubcf8\ub514 \ubc31\uc6b4\uc0b0\uc774\uc5c8\ub2e4  \ub2e8\uc591\uad70\uc218\ub97c \uc9c0\ub0b8 \ud1f4\uacc4 \uc774\ud669\uc774  \ube44\ub2e8\uc5d0 \uc218 \ub193\uc740 \uac83\ucc98\ub7fc \uc544\ub984\ub2f5\ub2e4 \uba70 \uac10\ud0c4  \uae08\uc218\uc0b0\uc774\ub77c\uace0 \ud588\ub2e4\uace0 \ud55c\ub2e4      \uccad\ud48d\ud638\ubc18\uc744 \ub07c\uace0 \uc788\ub294 \uae08\uc218\uc0b0\uc740 \ubd81\ucabd\uc73c\ub85c\ub294 \uc81c\ucc9c\uc2dc\ub0b4\uae4c\uc9c0  \ub0a8\ucabd\uc73c\ub85c\ub294 \ub2e8\uc591 \ub9d0\ubaa9\uc0b0\uae4c\uc9c0 \ubed7\uc5b4\ub0b4\ub9b0 \uc81c\ubc95 \uae34 \uc0b0\uc904\uae30\ub2e4  \uc8fc\ub2a5\uc120\uc5d0\ub294 \uc791\uc131\uc0b0  \ub3d9\uc0b0  \ub9d0\ubaa9\uc0b0 \ub4f1 \ud574\ubc1c        \ubbf8\ud130 \uc0b0\ub4e4\uc774 \uc5ec\ub7ff\uc774\ub2e4  \uc911\uac04\ub9c8\ub2e4 \uc11c\ucabd\uc73c\ub85c \ubed7\uc740 \uc9c0\ub989\uc5d0\ub294 \uc911\ubd09  \uc2e0\uc120\ubd09  \uc800\uc2b9\ubd09  \ub9dd\ub355\ubd09 \ub4f1 \uc218\ub824\ud55c \uc0b0\ub4e4\uc744 \uac70\ub290\ub9ac\uace0 \uc788\ub2e4 "
