    "Description": "          \uc758\ub839 \uc74d\ub0b4\uc640 \uac00\uae5d\uace0 \ubd80\ub2f4\uc2a4\ub7fd\uc9c0 \uc54a\uc740 \ucf54\uc2a4\ub85c \uad70\ubbfc\ub4e4\uc774 \uc790\uc8fc \uc560\uc6a9\ud558\ub294 \ub4f1\uc0b0\ucf54\uc2a4\uc774\ub2e4  \uc815\uc0c1\uc5d0 \uc624\ub974\uac8c \ub418\uba74 \uc0b0 \uc8fc\ubcc0 \uc758\ub839 \uc911\uc2ec\ubd80\ub97c \ud6e4\ud788 \ub0b4\ub824\ub2e4 \ubcfc \uc218 \uc788\uc73c\uba70  \uc704\ud5d8\uc694\uc18c\uac00 \uc801\uace0 \ub4f1\uc0b0\ub85c \uad70\ub370\uad70\ub370 \uccb4\uc721\uc2dc\uc124  \ubca4\uce58 \ub4f1\uc758 \ud3b8\uc758\uc2dc\uc124\ub3c4 \uc798 \uac16\ucd94\uc5b4\uc838 \uc788\ub294 \ud3b8\uc774\ub2e4  \uc758\ub839 \uc74d\ub0b4\uc5d0 \uc704\uce58\ud558\uace0 \uc788\uae30 \ub54c\ubb38\uc5d0 \uc678\ubd80\uc5d0\uc11c \ucc3e\uc544\uc624\ub294 \uc0ac\ub78c\ub3c4 \uc27d\uac8c \ucc3e\uc544\uc62c \uc218 \uc788\ub294 \uc774\uc810\uc744 \uac00\uc9c0\uace0 \uc788\ub2e4  \uadf8\ub9ac\uace0 \ucda9\uc775\uc0ac  \uc758\ubcd1\ud0d1 \ubd80\uadfc \uc0b0\ub9bc\uc9c0\uc5ed\uc5d0\ub294 \ucc9c\uc5f0\ubcf4\ud638\ub9bc  \uc9c0\uc815\ubc88\ud638                 \uc73c\ub85c \uc9c0\uc815\ub418\uc5b4 \ud65c\uc5fd\uc218\uac00 \uc8fc\uc694 \uc218\uc885\uc73c\ub85c \uc790\uc5f0\uc0dd\ud0dc\uacc4\ub97c \ubcf4\uc874\ud558\uace0 \uc788\uc73c\uba70 \uc544\uc6b8\ub7ec \uc870\uc218\ubcf4\ud638\uad6c\ub85c \uc9c0\uc815\ub418\uc5b4 \uc788\ub2e4                    \uc758\ub839\uad70\ubbfc\uc5d0\uac8c\ub294 \uce5c\uc219\ud55c \uc0b0\uc774\uba70     \ub144   \uc6d4   \uc77c \uacbd\uc0c1\ub0a8\ub3c4 \uae30\ub150\ubb3c \uc81c   \ud638\ub85c \uc9c0\uc815\ub418\uc5c8\ub2e4  \uc758\ub839\uc74d\uc758 \uc815\ub0a8\ucabd\uc5d0 \uc704\uce58\ud558\uace0 \uc788\ub294 \ub0a8\uc0b0\uc740 \uc758\ub839 \uad70\uccad\uc774 \uc704\uce58\ud558\uace0 \uc788\ub294 \ubd81\uc0b0\uacfc \ub354\ubd88\uc5b4 \uc788\uc73c\uba70 \uc758\ub839 \uad70\ubbfc\uc758 \ud734\uc2dd\ucc98\ub85c\uc368\uc758 \uc758\ubbf8\uac00 \ud06c\ub2e4 "
