    "Description": "    \uacc4\uace1 \ube7c\uc5b4\ub09c \uc601\ub0a8\uc758 \uae08\uac15\uc0b0        \ub099\ub3d9\uc815\ub9e5 \uc904\uae30\uac00 \uc8fc\uc655\uc0b0\uc744 \uc606\uc73c\ub85c \uc9c0\ub098\uccd0 \ub0b4\ub824\uc624\ub2e4\uac00 \ub3d9\ud574\uc548 \ucabd\uc73c\ub85c \ubed7\uc5b4\uac00 \uc19f\uc740 \uc0b0\uc774 \ubc14\ub85c \ub0b4\uc5f0\uc0b0\uc774\ub2e4  \uacbd\uc0c1\ubd81\ub3c4 \ud3ec\ud56d\uc2dc\uc640 \uc601\ub355\uad70\uc758 \uacbd\uacc4\uc5d0 \uc788\ub294 \ub0b4\uc5f0\uc0b0\uc740 \ubb38\uc218\uc0b0        \uc0bc\uc9c0\ubd09 \ub0b4\uc5f0\uc0b0 \uc815\uc0c1           \ud5a5\ub85c\ubd09          \uc6b0\ucc99\ubd09 \ucc9c\ub839\uc0b0         \uc73c\ub85c \ub2a5\uc120\uc774 \uc774\uc5b4\uc838 \uc788\ub2e4  \uc644\ub9cc\ud558\uac8c \ub2a5\uc120\uc774 \uc774\uc5b4\uc9c0\ub294 \uc721\uc0b0\uc774\ub77c \ubc0b\ubc0b\ud55c\ub4ef \ubcf4\uc774\uae30\ub3c4 \ud558\uc9c0\ub9cc  \uad7d\uc774\uad7d\uc774   \ub9ac\ub098 \ub418\ub294 \uae34 \uace8\uc5d0\ub294   \ud3ed\ud3ec\uac00 \uc790\ub9ac\ud558\uace0 \uc788\ub2e4      \ub0b4\uc5f0\uc0b0\uc758 \ubc31\ubbf8\ub294 \uae30\uc554\uc808\ubcbd\uacfc \uc870\ud654\ub97c \uc774\ub904 \uc808\uacbd\uc744 \uc790\ub791\ud558\ub294 \uccad\ud558\uace8\uc758   \ud3ed\ud3ec\uc774\ub2e4  \uccad\ud558\uace8 \ub0b4\uc5f0\uace8  \ucd08\uc785\uc758 \uc0c1\uc0dd\ud3ed\ud3ec\ub97c \uc81c \ud3ed\ud3ec\ub85c \ud558\uc5ec \ubcf4\ud604\ud3ed  \uc0bc\ubcf4\ud3ed  \uc7a0\ub8e1\ud3ed  \ubb34\ub8e1\ud3ed\uc744 \uac70\uccd0 \uc81c \ud3ed\ud3ec\uc778 \uad00\uc74c\ud3ed\uacfc \uc81c \ud3ed\ud3ec\uc778 \uc5f0\uc0b0\ud3ed \uc77c\ub300\uc5d0\uc11c \uacc4\uace1\ubbf8\uc758 \uc9c4\uc218\ub97c \ubcf4\uc5ec\uc900\ub2e4 "
