    "Description": "    \ub0a8\ud55c \uc81c\uc77c\uc758 \ub2e8\ud48d\uba85\uc0b0\uc774 \ubc14\ub85c \uc774\uacf3          \uc6b0\ub9ac\ub098\ub77c\uc5d0\uc11c   \ub2e8\ud48d   \ud558\uba74 \uc81c\uc77c \uba3c\uc800 \ub5a0\uc624\ub974\ub294 \uc0b0\uc774 \ubc14\ub85c \ub0b4\uc7a5\uc0b0\uc774\ub2e4  \ub3d9\uad6c\ubd80\ud130 \ub0b4\uc7a5\uc0ac\uae4c\uc9c0  \ud0ac\ub85c\ubbf8\ud130 \ub0a8\uc9d3 \ub418\ub294 \uae38\uac00\uac00 \uc628\ud1b5 \ub2e8\ud48d\ub098\ubb34\ubc2d\uc774\ub2e4  \uadf8\ub798 \ub2e8\ud48d\ucca0\uc774\uba74 \uc0b0 \uc548\ud1b5\uc774 \uc0ac\ub78c\ub4e4\ub85c \uc778\uc0b0\uc778\ud574\ub97c \uc774\ub8ec\ub2e4      \ub2e8\ud48d\ub180\uc774\ub97c \uc628 \uc0ac\ub78c\ub4e4\uc740 \ub300\uac1c \uace8\uc9dc\uae30 \ub2e8\ud48d\ub9cc \uad6c\uacbd\ud558\uace0 \ub3cc\uc544\uac04\ub2e4  \uadf8\ub7ec\ub098 \uc9c4\uc9dc\ub294 \ub9d0\uad7d\ud615\uc758 \uc6b4\ub450\ub97c \ub3cc\uba70 \uc548\ud1b5\uc758 \ubd89\uc740 \uce74\ud54f\uc744 \ub0b4\ub824\ub2e4\ubcf4\ub294 \uac83\uc774\ub2e4  \uc6d4\uc601\ubd09  \uc11c\ub798\ubd09  \ub9dd\ud574\ubd09  \uc5f0\uc9c0\ubd09  \uae4c\uce58\ubd09  \uc0c1\ubd09 \uc2e0\uc120\ubd09  \uc5f0\uc790\ubd09 \ubb38\ud544\ubd09   \uc7a5\uad70\ubd09\uc774\ub2e4      \uc368\ub808\ucc98\ub7fc \uc0dd\uacbc\ub2e4 \ud558\uc5ec \uc11c\ub798\ubd09\uc774 \ub41c \ud1b1\ub0a0 \uac19\uc740 \uc554\ubd09\uc740 \ub0b4\uc7a5\uc0b0\uc758 \ucd5c\uace0 \uba85\uacbd\uc774\ub2e4  \uadf8 \uacbd\uce58\ub97c \uac10\uc0c1\ud560 \ub370\ub294 \ubcbd\ub828\uc554 \uc911\ubb38\uc73c\ub85c \uc18c\uc124\uac00 \ubb38\uc21c\ud0dc \uc120\uc0dd\uc774 \uac00\uc7a5 \uc544\ub07c\ub294 \ud48d\uacbd\uc774\uae30\ub3c4 \ud558\ub2e4      \uc11c\ub798\ubd09 \uc911\ud131\uc5d0\ub294 \uc218\ub839\uc774    \uc0b4\uc774\ub098 \ub418\ub294 \ub2e8\ud48d\ub098\ubb34\uac00 \uc788\ub2e4  \ub192\uc774\uac00      \ub458\ub808\ub294   \ub098 \ub41c\ub2e4  \uace8\uc9dc\uae30\uc758 \ub2e8\ud48d\ub098\ubb34\ub294 \ud574\ubc29 \ud6c4 \uc815\uc74d\uad70\uc5d0\uc11c \uc2ec\uc740 \uac83\uc774\uc9c0\ub9cc \ub0b4\uc7a5\uc0b0 \ub2e8\ud48d \uc5ed\uc0ac\uac00 \uc9e7\uc740 \uac83\ub9cc\uc740 \uc544\ub2c8\ub2e4      \ubc31\uc81c\uc2dc\ub300 \uc601\uc740\uc0ac     \uac00 \uc138\uc6cc\uc9c0\uba74\uc11c \uc8fd \uc601\uc740\uc0b0\uc774\ub77c\uace0 \ubd88\ub824\uc654\ub2e4  \uadf8\ub7f0\ub370 \uc5b8\uc81c\ubd80\ud134\uac00 \ub0b4\uc7a5\uc0b0\uc73c\ub85c \ubc14\ub00c\uc5b4 \uc624\ub298\uc5d0 \uc774\ub974\ub800\ub2e4  \uadf8\ub7ec\ub098 \uace0\uc801\uc740 \ubcf4\ubb3c \ud55c \uc810 \uc5c6\uc744 \uc815\ub3c4\ub85c \ube44\ud574 \ube48\uc57d\ud558\ub2e4  \uaf2d \ubd10\uc57c\ud560 \uac83\uc740 \uc6a9\uad74  \uc0ac\ub78c\ub4e4\uc774 \uc313\uc740 \uc791\uc740 \ub3cc\ud0d1\ub4e4\ubc16\uc5d0 \uc5c6\ub294 \uc790\uc5f0\ub3d9\uad74\uc774\uc9c0\ub9cc \uc815\uc720\uc7ac\ub780\ub54c \uc804\uc8fc\uc0ac\uace0\uc758 \uc870\uc120\uc655\uc870\uc2e4\ub85d\uc744 \uc5ec\uae30\ub85c \uc62e\uaca8\uc624\uc9c0 \uc54a\uc558\ub2e4\uba74 \uc720\ub124\uc2a4\ucf54\uac00 \uc9c0\uc815\ud55c \uc138\uacc4\ubb38\ud654\uc720\uc0b0\uc740 \uc874\uc7ac\ud558\uc9c0 \uc54a\uc558\uc744 \uac83\uc774\ub2e4 "
