    "Description": "\ub300\uc131\uc0b0\uc740 \ub454\ucca0\uc0b0\uc758 \ub3d9\ucabd\uc73c\ub85c \ubed7\uc5b4 \uc788\ub294 \uc904\uae30\uc911 \uc19f\uc544\uc788\ub294 \ud55c \ubd09\uc6b0\ub9ac\uc774\uba70 \uc0b0 \ubaa8\uc591\uc0c8\ub294 \uadf8\ub2e4\uc9c0 \uc6c5\uc7a5                                                                                                                                          \ud558\uac70\ub098 \ud654\ub824\ud558\uc9c0\ub3c4 \uc54a\uc740 \ud3c9\ubc94\ud558\ub2e4  \ud558\uc9c0\ub9cc \uc815\ucde8\uc554\uc744 \ud488\uc5d0 \uc548\uace0 \uc788\uc5b4 \uc774\ub984\uc774 \uc54c\ub824\uc9c0\uac8c \ub41c \uac83 \uac19\ub2e4                                                                                                                                            \ub300\uc131\uc0b0 \uc815\uc0c1\uc740 \uc815\uc0c1\uc774\ub77c \ud558\uae30\uc5d0 \ub108\ubb34 \ud3c9\uc774\ud558\uc5ec \uc27d\uac8c \uc9c0\ub098\uce58\uae30 \uc26c\uc6b0\uba70 \uc804\ub9dd \ub610\ud55c \uc0b0\ubd88\ucd08\uc18c\ub098 \uc815\ucde8                                                                                                                                          \uc554 \ubc14\ub85c\uc704 \ub108\ub7ed\ubc14\uc704\uac00 \ub354 \uc88b\ub2e4           "
