    "Description": "    \ubd09\ub9cc\ubbf8 \ud0c1\uc6d4\ud55c \ube44 \uc624\ub294 \ub0a0\uc758 \uc0b0\uc218\ud654        \ubd09\ub9cc\ubbf8     \uac00 \ud0c1\uc6d4\ud558\uac8c \ube7c\uc5b4\ub09c \uc0b0\uc774\ub2e4    \ud478\ub978 \ud558\ub298 \uae4e\uc544\uc138\uc6b4 \ub9cc \uae38 \ubd09\uc6b0\ub9ac           \ub77c \uc74a\uc5c8\ub358 \uc61b \uc2dc\uc778\uc758 \ud45c\ud604\uc774 \ubb34\ub98e\uc744 \uce58\uac8c \ub9cc\ub4dc\ub294 \uc7a5\ucf8c\ud55c \uc120\uc778\ubd09\uc744 \ube44\ub86f\ud574 \uadf8 \ub4a4\uc5d0 \uc911\ucca9\ub41c \ub9cc\uc7a5\ubd09  \uc790\uc6b4\ubd09  \uc2e0\uc120\ubd09  \uc11c\ucabd \ub05d\uc758 \uae30\uc774\ud55c \ub2e4\uc12f \ubd09\uc6b0\ub9ac \uc624\ubd09\uc5d0 \uc774\ub974\uae30\uae4c\uc9c0 \ubaa8\ub450 \ube5b\ub098\ub294 \ud654\uac15\uc554\uc73c\ub85c \ub418\uc5b4\uc788\uc5b4 \uc2dc \uc18d\uc758   \ud478\ub978 \ud558\ub298  \uc744 \ub354\uc6b1 \ud478\ub974\uac8c \ud55c\ub2e4      \uc774\ub807\uac8c \uc554\uace8    \uc774 \ub450\ub4dc\ub7ec\uc9c4 \uc0b0\uc774\ub77c \uc8fc\ub989\uc774 \uac70\uc758 \uc554\ubd09\ub989\uc774\ub2e4  \uc0ac\uc774\uc0ac\uc774 \uc9c4\uc9dc \uc554\ub989\uc778 \ud3ec\ub300\ub2a5\uc120  \uce7c\ubc14\uc704\ub2a5\uc120\ub3c4 \uc788\uc9c0\ub9cc \ub300\uac1c\ub294 \uc194\uc232 \uadf8\ub298 \uc0ac\uc774 \uc554\ubd09\uc744 \ub3cc\uace0 \ub3c4\ub294 \uc2dc\uc6d0\ud55c \uc0b0\uae38\uc774\ub2e4  \uadf8\ub798 \ub3c4\ubd09\uc0b0\ud589\uc740 \uad6c\ub984\uc774 \uc0b0\uc218\ud654\ub97c \uc5f0\ucd9c\ud558\ub294 \uc6b0\uc911    \uc0b0\ud589\uc744 \ucd5c\uace0\ub85c \uaf3d\ub294\ub2e4      \uc19f\uc74c\uc774 \uc6b0\uc138\ud558\uace0 \ubc14\uc704\uac00 \ub9ce\uc544 \uacc4\uace1 \uc218\ub7c9\uc740 \uc801\ub2e4  \uadf8\ub807\uc9c0\ub9cc \uacc4\ub958\ubbf8\ub294 \ub6f0\uc5b4\ub098\ub2c8 \ube44 \uc624\ub294 \ub0a0\uc774 \uc0c8\uc0bc \uc81c\uaca9\uc774\ub2e4  \ubc18\uba74\uc5d0 \ub4b7\uc790\ub77d \uc1a1\ucd94\uacc4\uace1\uc740 \ub2e4\ub974\ub2e4  \uc628\ud1b5 \ud478\ub978 \uc232\ucc9c\uc9c0\uac00 \ubfdc\uc5b4\ub0b4\ub294 \ub9d1\uc740 \ubb3c\uc774 \uc138 \uac1c\uc758 \uc1a1\ucd94\ud3ed\uc5d0\ub2e4 \uc1a1\ucd94\uc720\uc6d0\uc9c0\uc758 \uae34 \uc640\ud3ed\uacfc \ub2f4   \uae4c\uc9c0 \ub9cc\ub4e4\uc5b4\ub450\uace0 \uc788\ub2e4      \uadf8\ub798\uc11c \ub3c4\ubd09\uc740 \uc774\ub545\uc5d0\uc11c \uac00\uc7a5 \ub4f1\uc0b0\ub85c\uac00 \ucd18\ucd18\ud55c \uc0b0  \uac00\uc7a5 \uc0ac\ub791\ubc1b\ub294 \uc0b0\uc774\ub2e4  \uc8fc\ub9d0\ub9c8\ub2e4 \uc0b0\uc744 \ucc3e\ub294 \ube60\uaf3c\uc774 \uc11c\uc6b8\uc0b0\uac1d\ub4e4  \uc77c\uc694\uc77c\uc5d0\ub294 \ub418\ub3c4\ub85d\uc774\uba74 \uc774 \uc0b0\uc744 \ud53c\ud560 \uc815\ub3c4\ub2c8\uae4c "
