    "Description": "       \ubb34\ub989\uacc4\ub97c \ub9cc\ub4e4\uc5b4\ub193\uc740 \ubc14\uc704\uc0b0\uacfc \ud478\ub978\uc0b0        \uacc4\uace1 \uc774\ub984\uc744 \ubb34\ub989\uacc4     \ub77c\uace0 \ud588\ub2e4  \uc5bc\ub9c8\ub098 \ub300\ub2e8\ud55c \uacbd\uce58\uba74 \uac10\ud788  \ubb34\ub989\ub3c4\uc6d0\uc740 \ubc14\ub85c \uc5ec\uae30 \ub77c\uace0 \ub0b4\uc138\uc6e0\ub2e4  \ub450\ud0c0\uc0b0\uacfc \uccad\uc625\uc0b0  \uace0\uc801\ub300  \uac08\ubbf8\ubd09      \ubd09\uc73c\ub85c \ub458\ub7ec\uc2f8\uc778 \ubc18\uc11d\uacc4\uace1\uc774\ub2e4      \uac00\ubcf4\uba74 \uace0\uac1c\ub97c \ub044\ub355\uc774\uac8c\ub420 \uac83\uc774\ub2e4  \ubcbc\ub8e8\ucc98\ub7fc \ub9e4\ub044\ub7ec\uc6b4 \ubc14\uc704\uc6b4\ub3d9\uc7a5\uc5d0 \ubb34\uc218\ud55c \uae00\uc528\uac00 \uc0c8\uaca8\uc838\uc788\uace0 \ud55c\ucf20\uc73c\ub85c\ub294 \ub9d1\uc740 \ubb3c\uc774 \ub80c\uc988\ucc98\ub7fc \uc587\uac8c \ud750\ub978\ub2e4  \uace8\uc9dc\uae30\ub85c \ub4e4\uc5b4\uac00\uba74 \uc5ec\uae30\ub3c4 \ud3ed\ud3ec \uc800\uae30\ub3c4 \ud3ed\ud3ec  \uae4e\uc544\uc138\uc6b4 \uc808\ubcbd \uc704\uc5d4 \uce35\uce35\uc774 \uc18c\ub098\ubb34\ub4e4  \ub0b4\uac00 \uc815\ub9d0 \ubb34\ub989\ub3c4\uc6d0\uc5d0 \ub4e4\uc5b4\uc654\uad6c\ub098 \uc2f6\uc73c\ub9ac\ub77c          \ud615 \uc9c0\ud615\uc778 \ubb34\ub989\uacc4 \ubb3c\ubc1b\uc774\uc758 \ub0a8\ucabd \uc6b8\ud0c0\ub9ac\ub97c \uc774\ub8e8\ub294 \uccad\uc625 \ub450\ud0c0\uc0b0\uc740 \uc5b8\uc81c\ub098 \uc30d\ub465\uc774\ucc98\ub7fc \ubd99\uc5b4\ub2e4\ub2cc\ub2e4  \ub5c4 \uc218 \uc5c6\uc774 \ub3c8\ub3c5\ud558\uace0 \uac00\uae4c\uc6b4 \ub3d9\uc2dc\uc5d0 \ubb34\ub989\uacc4\ub77c\ub294 \ubcf4\ubb3c\uc744 \uacf5\uc720\ud558\uace0 \uc788\uae30 \ub54c\ubb38\uc774\ub2e4  \uadf8\ub807\uc9c0\ub9cc \uc0dd\uae40\uc0c8\ub294 \uc0ac\ubb47 \ub2ec\ub77c \uccad\uc625\uc740 \ub4ec\uc9c1\ud55c \uc721\uc0b0    \uc778 \ubc18\uba74 \ub450\ud0c0\ub294 \uc6b8\ub048\ubd88\ub048 \uace8\uc0b0    \uc73c\ub85c \ub418\uc5b4\uc788\ub2e4      \ubb38\uc790\uc18d\uc774 \uc788\ub294 \uc774\ub294 \uc30d\ub465\uc774 \uc774\ub984\uc774 \ub9de\ubc14\ub00c\uc5c8\ub098 \uc758\uc2ec\ud560 \uac83\uc774\ub2e4  \ud478\ub978 \uc625 \uccad\uc625\uc740 \ubc14\uc704\uc0b0\uc5d0 \ubd99\uc5ec\uc57c \ub9de\uc73c\uba70 \uc9d1\ucc29\uc744 \ubc84\ub9ac\uace0 \uc218\ud589\uc758 \uae38\ub85c \ub4e4\uc5b4\uc120\ub2e4\ub294 \ub450\ud0c0\ub294 \uc800 \uc694\ub780\ud55c \ubb34\ub989\uacc4\uace1\uc744 \uc9c0\uae0b\uc774 \uad7d\uc5b4\ubcf4\uace0\uc788\ub294 \ud6c4\ub355\ud55c \ubd09\uc6b0\ub9ac\uc5d0 \uc5b4\uc6b8\ub9ac\ub294\ub370       \ubaa8\uc21c\uc5c6\ub294 \ub17c\ub9ac\ub294 \uc9c4\uc2e4\uc774 \ub4b7\ubc1b\uce68\ud55c\ub2e4  \uc0b0\uacbd\ud45c\uc640 \ub300\ub3d9\uc5ec\uc9c0\ub3c4\uc5d0\ub294 \ubd84\uba85 \ubd81\ucabd\uac83\uc774 \ub450\ud0c0\ub77c\uace0 \ub098\uc640\uc788\ub2e4  \uccad\uc625\uc740 \ub450\ud0c0\uace0 \ub450\ud0c0\ub294 \uccad\uc625\uc778 \uac83\uc774\ub2e4     "
