    "Description": "          \uc2dc\uc778\uadfc\uc548\uc5d0 \uc788\ub294 \uc9c4\uc8fc  \ub300\uc0b0 \uc911 \ud558\ub098\ub85c \ub300\uccb4\uc801\uc73c\ub85c \uc644\ub9cc\ud55c \uacbd\uc0ac\ub97c \uac00\uc9c0\uace0 \uc788\uc73c\uba70  \uadfc\ucc98\uc5d0 \uc544\ud30c\ud2b8 \ub2e8\uc9c0\uac00 \uc788\uc5b4 \uc8fc\ub85c \uc544\ud30c\ud2b8 \uc8fc\ubbfc\ub4e4\uc774 \uc790\uc8fc \uc774\uc6a9\ud55c\ub2e4  \uc544\uce68 \uc800\ub141 \uac00\ubcbc\uc6b4 \ub4f1\uc0b0\uc758 \uac1c\ub150\uc73c\ub85c \uc624\ub974\uace0 \uccb4\uc721\uacf5\uc6d0\uc758 \uc124\uce58\ub85c \uccb4\ub825\ub2e8\ub828\uc758 \ubaa9\uc801\uc73c\ub85c \ub9ce\uc774 \uc624\ub974\uace0\uc788\ub2e4 \ub450\uac1c\uc758 \uc0b0 \ub9dd\uc9c4\uc0b0 \uac00\uc88c\uc0b0 \uc774 \uc774\uc5b4\uc838 \uc788\uc5b4 \ubc18\ub098\uc808\ucf54\uc2a4\ub85c\ub3c4 \uc774\uc6a9\uac00\ub2a5\ud558\ub2e4 \uc9c4\uc8fc\uc2dc \uc778\uadfc\uc758 \uc5b4\ub290\uc0b0\ubcf4\ub2e4 \uc9c4\uc8fc\uc2dc\ub0b4\uc758 \uc815\uacbd\uc744 \uae54\ub054\ud558\uac8c \ubcfc\uc218\uc788\ub2e4  \uc9c4\uc8fc\uc758 \uc57c\uacbd\uc774 \uac00\uc7a5 \uba4b\uc788\ub294 \uc0b0\uc774\uae30\ub3c4 \ud558\ub2e4  \ubd09\uc218\ub300 \uc720\uc801\uc744 \uac00\uc9c0\uace0 \uc788\uc5b4 \ubcfc\uaebc\ub9ac \ub610\ud55c \uc81c\uacf5\ud574\uc900\ub2e4            \ub9dd\uacbd\ub0a8\ub3d9\uc758 \ub4b7\ub9c8\ub8e8\uc5d0 \uc788\uae30 \ub54c\ubb38\uc5d0 \ubcf4\ud1b5 \ub9dd\uacbd\uc0b0\uc774\ub77c\uace0\ub3c4 \ubd80\ub974\ub294\ub370 \uadf8 \ub458\ub808\uc5d0 \uc57d     \uc758 \ud1a0\uc131\uc9c0\uac00 \ub0a8\uc544 \uc788\ub2e4  \uc131\ud130 \uc548\uc5d0 \ub9dd\uacbd\uc0b0 \ubd09\uc218\ub300\uc9c0      \uac00 \uc790\ub9ac\ud558\uace0 \uc788\ub2e4 \ub9dd\uacbd\ucd08\ub4f1\ud559\uad50 \ub4a4\ucabd\ube44\ud0c8\uae38\uc744 \ub530\ub77c \uc870\uae08 \uc624\ub974\uba74 \uc57d\uc218\ud130\uc640 \uae08\uc120\uc554\uc774 \uc788\uc73c\uba70 \ub610 \uc774\ub97c \uc9c0\ub098 \uacc4\ub2e8\uc73c\ub85c \uc774\uc5b4\uc9c4 \uac00\ud30c\ub978 \ub4f1\uc0b0\uae38\uc744 \uc624\ub974\uba74 \uc0b0\uaf2d\ub300\uae30\uc5d0    \uc911\uacc4\uc18c\uac00 \uc788\ub2e4  \uadf8 \uc606\uc5d0 \uc2dc\ubbfc\ub4e4\uc744 \uc704\ud55c\uccb4\uc721\uc2dc\uc124\uc774 \uac16\ucd94\uc5b4\uc838 \uc788\uc5b4\uc11c \ucc9c\uc804\uc9c0\uad6c \uc778\uc811 \uc8fc\ubbfc\ub4e4\uc758 \uc870\uae45\uc7a5\uc18c\ub85c \ub9ce\uc774 \uc774\uc6a9\ub418\uace0 \uc788\ub2e4             \ub9dd\uc9c4\uc0b0 \ubd09\uc218\ub300\ub294 \uc9c4\uc8fc\uc640 \uc9c4\uc591 \ud1b5\ud569\uc774\ud6c4\uc5d0 \uc0c8\ub86d\uac8c \ubcf5\uc6d0\ub418\uc5c8\ub294\ub370 \ub9dd\uc9c4\uc0b0 \ubd09\uc218\ub300\uc5d0\uc11c \ubc14\ub77c\ubcf8 \uc2dc\uac00\uc9c0 \uc804\uacbd\uc740 \uc9c4\uc8fc \uacbd\uc758 \ud558\ub098\ub85c \uc2e0\uc548 \ud3c9\uac70 \uc9c0\uc5ed\uc744 \uc911\uc2ec\uc73c\ub85c \uc9c4\uc8fc\uc131\uc744 \uc870\ub9dd\ud560 \uc218 \uc788\ub294 \uac00\uc7a5 \uc88b\uc740 \uacf3\uc73c\ub85c \ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \ucc3e\uace0 \uc788\ub2e4"
