    "Description": "    \ud669\uae08\ube5b \uc5b5\uc0c8\uc758 \uc0b0        \uba85\uc131\uc0b0 \uc0b0\uc790\ub77d\uc5d0 \uac78\uccd0\uc788\ub294 \uc0b0\uc815\ud638\uc218\uc640 \ub354\ubd88\uc5b4 \uba85\uc2b9\uc9c0\ub85c\uc11c \uc720\uba85\ud558\ub2e4   \uc6b8\uc74c\uc0b0 \uc744 \ub73b\ud558\ub294 \uba85\uc131\uc0b0     \uc774\ub780 \uc774\ub984\uc740 \uad81\uc608\uac00 \uc790\uc2e0\uc758 \ubd80\ud558\uc600\ub358 \uace0\ub824 \ud0dc\uc870 \uc655\uac74\uc5d0\uc11c \ud328\ud55c \ud6c4 \uc774\uacf3\uc73c\ub85c \ud53c\uc2e0\uc640 \ud06c\uac8c \uc6b8\uc5c8\ub2e4\ub294 \uc804\uc124\uc5d0\uc11c \ube44\ub86f\ub418\uc5c8\ub2e4  \uadf8\ub9ac\ud558\uc5ec \uba85\uc131\uc0b0 \uc0b0\uc790\ub77d\uc5d0\ub294 \uad81\uc608\ubd09\uc744 \ube44\ub86f\ud574 \uad81\uc608\uac00 \ub3c4\ub9dd\ucce4\ub2e4\ub294 \ud328\uc8fc\uace8  \uc655\uac74\uc758 \uad70\uc0ac\uac00 \ucad3\uc544\uc624\ub294 \uac83\uc744 \uc0b4\ud53c\ub358 \uacf3\uc774\ub77c \ud558\ub824 \uc774\ub984 \ubd99\uc5ec\uc9c4 \ub9dd\ubb34\ubd09 \ub4f1  \uba85\uc131\uc0b0 \uacf3\uacf3\uc5d0\ub294 \uad81\uc608\uc758 \uc804\uc124\uc774 \uc544\uc9c1 \ub0a8\uc544 \uc788\ub2e4     \uacbd\uae30\ub3c4 \ud3ec\ucc9c\uacfc \uac15\uc6d0\ub3c4 \ucca0\uc6d0\uc5d0 \uac78\uccd0 \ube5a\uc5b4\uc9c4 \uba85\uc131\uc0b0\uc740 \uad81\uc608\uc655\uad74\uc744 \ube44\ub86f\ud558\uc5ec \uc790\uc778\uc0ac  \ucc45\ubc14\uc704  \ub4f1\ub8e1\ud3ed\ud3ec \ub4f1\uc758 \uacbd\uce58\uac00 \ub6f0\uc5b4\ub09c \uacf3\uc774 \ub9ce\ub2e4  \ud2b9\ud788 \uc815\uc0c1\uacfc \uc5f0\uacb0\ub41c \ub2a5\uc120\uc740 \uc5b5\uc0c8\uad70\ub77d\uc9c0\ub97c \uc774\ub8e8\uace0 \uc788\uc5b4 \ud3ec\ucc9c\uc2dc\uc5d0\uc11c\ub294 \ub9e4\ub144   \uc6d4 \ub458\uc9f8\uc8fc \ud1a0  \uc77c \uc591\uc77c\uac04 \uc5b5\uc0c8\ucd95\uc81c\ub97c \uc5f4\uace0 \uc788\ub2e4 "
