    "Description": "          \ubaa8\uc0b0\ubd09\uc740 \uac15\uc6d0\ub3c4 \uac15\ub989\uc2dc \uac15\ub0a8\ub3d9\uc5d0 \uc704\uce58\ud55c \uc0b0\uc73c\ub85c \ud574\ubc1c      \uc774\ub2e4 \uc0b0\uc138\ub294 \ube44\uad50\uc801 \uc644\ub9cc\ud558\uace0 \uc18c\ub098\ubb34 \uc232\uc73c\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\uc73c\uba70 \uc815\uc0c1\ubd80\uc5d0\uc11c\ub294 \ub9e4\ub144 \ud574\ub9de\uc774 \ud589\uc0ac\uac00 \uc5f4\ub9ac\uace0 \uc788\ub2e4 \uc8fc \ub178\uc120\uc740 \uc778\uadfc \uc544\ud30c\ud2b8 \ub2e8\uc9c0\uc5d0\uc11c \uac15\ub0a8\ub3d9\uae4c\uc9c0      \uc815\ub3c4 \ub098\uc624\uba70 \ubca4\uce58\uc2dc\uc124  \uc6b4\ub3d9\uae30\uad6c\ub4f1\uc774 \uacf3\uacf3\uc5d0 \uc124\uce58\ub418\uc5b4 \uc788\uc73c\uba70 \uc57c\uac04 \uc774\uc6a9\uc790\ub4e4\uc758 \ud3b8\uc758\ub97c \uc704\ud558\uc5ec \uac00\ub85c\ub4f1\uae4c\uc9c0 \uc124\uce58\ub418\uc5b4 \uc0ac\uacc4\uc808 \ubaa8\ub450 \uc774\uc6a9\uac00\ub2a5\ud55c \ub4f1\uc0b0\ub85c\uc774\ub2e4 \uc774\uc0b0\uc740 \uac15\ub989\uc758 \uc548\uc0b0\uc73c\ub85c \uc870\uc120\uc911\uc885\ub54c \uac15\ub989\ubd80\uc0ac \ud55c\uae09\uc774 \uac15\ub989\uc5d0\uc11c \ud070\uc778\ubb3c\uc774 \ub098\ub294\uac83\uc744 \ub450\ub824\uc6cc\ud558\uc5ec \ubaa8\uc0b0\ubd09 \uc815\uc0c1\uaf2d\ub300\uae30\ub97c \uc138\uc790\uc138\uce58 \uae4d\uc544 \ub0b4\ub838\ub2e4 \ud55c\ub2e4  \uc774\uc5d0 \ub530\ub77c \ud55c\uae09\uc774 \ub0ae\ucd98 \ubd09\uc6b0\ub9ac\ub97c \uc6d0\uc0c1\ubcf5\uad6c\ud558\uace0 \uc61b\uc815\uae30\ub97c \ub418\ucc3e\uace0\uc790 \ubcf5\uc6d0\uc6b4\ub3d9\uc744 \ubcc4\uc5ec     \ub144  \uc6d4   \uc77c\uc5d0   \ub9cc\uc5ec\uba85\uc758 \ub3d9\ucc38\uc73c\ub85c   \ud1a4 \ud2b8\ub7ed   \ub300\ubd84\uc758 \ud759\uc744 \uc790\ub8e8\uc5d0 \ub2f4\uc544 \ub098\ub974\ub294 \ub178\ub825\uc73c\ub85c \uc6d0\ub798\uc758 \ub192\uc774\ub97c \ub418\ucc3e\uac8c \ub418\uc5c8\ub2e4 "
