    "Description": "    \uacc4\uace1 \ube7c\uc5b4\ub09c \uc601\ub0a8\uc758 \uae08\uac15\uc0b0        \ubb34\ub4f1\uc0b0\uc740 \uc0b0\uc904\uae30\uc640 \uace8\uc9dc\uae30\uac00 \ub69c\ub837\ud558\uc9c0 \uc54a\uace0 \ub9c8\uce58 \ucee4\ub2e4\ub780 \ub454\ub355\uacfc \uac19\uc740 \uc0b0\uc138\ub97c \uc9c0\ub2cc \ud651\uc0b0\uc774\ub2e4  \uac00\uc7a5 \ud070 \ud2b9\uc9d5\uc740 \ub108\ub35c\uc9c0\ub300\ub85c  \ucc9c\uc655\ubd09 \ub0a8\ucabd\uc758 \uc9c0\uacf5\ub108\ub35c\uacfc \uc99d\uc2ec\uc0ac \ub3d9\ucabd\uc758 \ub355\uc0b0\ub108\ub35c\uc740 \uc7a5\uad00\uc744 \uc790\ub791\ud55c\ub2e4      \ucc9c\ud0dc\ub9cc\uc0c1\uc758 \uc554\uc11d\ub4e4\uc774 \uc6b4\uc9d1\ud55c \uc815\uc0c1  \ucc9c\uc655\ubd09\uc744 \uc911\uc2ec\uc73c\ub85c \ud3bc\uccd0\uc9c0\ub294 \ubc14\uc704\ub4e4\uc758 \uc6c5\uc7a5\ud568\uc740 \ub0a8\ub3c4\ubbfc\uc758 \uc2e0\uc559\ub300\uc0c1\uc774 \ub418\uc5b4\uc628 \uc2e0\uc0b0\uc784\uc744 \ubc18\uc99d\ud55c\ub2e4  \ud2b9\ud788 \uc785\uc11d\ub300  \uc11c\uc11d\ub300  \uaddc\ubd09\uc758 \ubc14\uc704\uad70\uc0c1\uc740 \ubcf4\ub294 \uc774\ub97c \uc555\ub3c4\ud560 \ub9cc\ud07c \ub300\ub2e8\ud558\ub2e4  \ud5c8\ub098 \ubb34\ub4f1\uc0b0\uc740 \uc804\ubc18\uc801\uc73c\ub85c \uc644\ub9cc\ud55c \uc0b0\uc138\uc774\uba70 \ub300\ubd80\ubd84\uc774 \ud759\uc0b0\uc73c\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\ub2e4      \uba40\ub9ac\uc11c \ubcf8 \uc804\uacbd\uc740 \ubafc    \uc790\ub97c \uc5f0\uc0c1\ucf00 \ud558\uba70 \ud638\ub0a8\uc815\ub9e5 \ud750\ub984\uc758 \uc911\uc2ec\uc5d0 \uc19f\uc544 \uc788\ub2e4  \uace8\uc9dc\uae30\ub4e4\uc740 \ub9d1\uace0 \uae4a\uc740 \ubb3c\uc744 \ud488\uc5b4 \uad11\uc8fc\uc758 \uc816\uc904 \ub178\ub987\uc744 \ud574 \uc654\uc73c\uba70  \uc704\uce58\ub098 \uc0b0\uc138 \uba74\uba74\uc774 \ub0a8\ub3c4\uc758 \uc73c\ub738\uc774\ub77c \ud560 \ub9cc\ud55c\uc9c0\ub77c \ube5b\uace0\uc744 \uad11\uc8fc\ub97c \ud488\uae30\uc5d0 \ubd80\uc871\ud568\uc774 \uc5c6\ub294 \uc0b0\uc774\ub2e4 "
