    "Description": "    \ud638\uc813\ud55c \uc0b0\uae38\uc758 \ubbf8\ub975\uc0b0        \ud1b5\uc601\uc2dc \ub0a8\ucabd  \ubbf8\ub975\ub3c4 \uc911\uc559\uc5d0 \uc6b0\ub69d \uc19f\uc740 \uc704\ud48d\ub2f9\ub2f9\ud55c \uc0b0\uc774\ub2e4  \uc6a9\ud654\uc0b0\uc774\ub77c\uace0\ub3c4 \ud558\ub294\ub370 \uc774 \uc0b0\uc5d0 \uace0\ucc30 \uc6a9\ud654\uc0ac\uac00 \uc788\uc5b4 \uadf8\ub807\uac8c \ubd80\ub978\ub2e4\uace0\ub3c4 \ud558\uace0  \ubbf8\ub975\ubd88\uc774 \ub2f9\ub798\uc5d0 \uac15\ub9bc\ud560 \uc6a9\ud654\ud68c\uc0c1\uc774\ub77c \ud574\uc11c \ubbf8\ub975\uc0b0\uacfc \uc6a9\ud654\uc0b0\uc744 \ud568\uaed8 \uc4f4\ub2e4\uace0\ub3c4 \ud55c\ub2e4      \uc790\ub77d\uc5d0\ub294 \uace0\ucc30 \uc6a9\ud654\uc0ac\uc640 \uc0b0\ub0b4 \uc554\uc790 \uad00\uc74c\uc554  \ub3c4\uc194\uc554\uc774 \uc788\uace0 \ud6a8\ubd09 \ubb38\uc911\uc758 \ubc1c\uc0c1\uc9c0 \ubbf8\ub798\uc0ac\uac00 \uc788\ub2e4  \uadf8\ub9ac \ub192\uc740 \uc0b0\uc740 \uc544\ub2c8\uc9c0\ub9cc \uba85\uc0b0\uc73c\ub85c\uc11c \ub355\ubaa9\uc744 \ub450\ub8e8 \uac16\ucd94\uace0 \uc788\uc73c\uba70 \uc6b8\ucc3d\ud55c \uc218\ub9bc \uc0ac\uc774\ub85c \ub9d1\uc740 \ubb3c\uc774 \ud750\ub974\ub294 \uacc4\uace1\uc774 \uc788\uace0 \uac16\uac00\uc9c0 \ubaa8\uc591\uc758 \uae30\uc554 \uad34\uc11d\uacfc \ubc14\uc704\uad74\uc774 \uc788\ub2e4      \uace0\ucc30\uacfc \uc57d\uc218  \ubd04 \uc9c4\ub2ec\ub798\uc640 \uac00\uc744 \ub2e8\ud48d\uc774 \ube7c\uc5b4\ub098\uace0 \uc0b0\uc815\uc5d0 \uc624\ub974\uba74 \ud55c\ub824\ud574\uc0c1\uc758 \ub2e4\ub3c4\ud574 \uc870\ub9dd\uc774 \ud45c\ud604\ud560 \uc218 \uc5c6\uc744 \uc815\ub3c4\ub85c \uc544\ub984\ub2f5\uac8c \ubcf4\uc774\uba70  \uccad\uba85\ud55c \ub0a0\uc5d0\ub294 \uc77c\ubcf8 \ub300\ub9c8\ub3c4\uac00 \ubc14\ub77c\ub2e4 \ubcf4\uc778\ub2e4 "
