    "Description": "    \uace0\ucc3d\ubc8c\ud310\uc5d0 \uc6b0\ub69d \uc120 \ud638\ub0a8\uc815\ub9e5\uc758 \ub9dd\ub300        \ud638\ub0a8\uace0\uc18d\uad6d\ub3c4\ub97c \ud0c0\uace0 \ub0a8\uc73c\ub85c \uac00\ub2e4\ubcf4\uba74 \ud638\ub0a8\ud3c9\uc57c\uac00 \ub05d\ub098\uba74\uc11c \uae38\uc774 \uc0b0\uc73c\ub85c \ub4e4\uc5b4\uac04\ub2e4  \uc67c\ucabd\uc5d0\uc11c\ub294 \uc785\uc554\uc0b0 \uc815\uc0c1\uc758 \ub18d\ubc14\uc704\uac00 \ubb38\uc778\ud654\ucc98\ub7fc \uc778\uc0c1\uc801\uc778\ub370 \uc624\ub978\ucabd\uc73c\ub85c\ub294 \ud3ec\uc7a5    \ucc98\ub7fc \uc7a5\ub300\ud55c \uc0b0\uc774 \uc19f\uc544\uc788\ub2e4  \ubc29\uc7a5\uc0b0\uc774\ub2e4      \ud3c9\uc9c0\uc5d0\uc11c \ubd88\uc465 \uc19f\uad6c\uce5c \ub370\ub2e4 \ub2a5\uc120\ub4e4\uc774 \uc77c\ud544\ud718\uc9c0\ub85c \uadf8\ub9b0 \ub4ef \ub2e8\uc21c\ud558\ub2e4  \uadf8\ub9cc\ud07c \uc804\ub9dd\uc774 \uc88b\uc544 \uace0\ucc3d\uc74d\ub0b4\uc640 \uc8fc\ubcc0 \ud3c9\uc57c\ub294 \ubb3c\ub860\uc774\uace0 \uadf8\uacf3\uc758 \uba85\uc18c \ubaa8\uc591\uc131\uae4c\uc9c0  \uadf8\ub9bc\uc9c0\ub3c4\ucc98\ub7fc \uc0dd\uc0dd\ud558\uac8c \ubcf4\uc778\ub2e4   \uc808\uc9d1\uc758 \uc6d0\ub85c \ub77c\ub294 \ub73b\uc758 \uc774\ub984\uc774\uc9c0\ub9cc \uad00\ub828\uc740 \uc5c6\ub2e4  \ubc31\uc81c\ub54c\ub294 \ubc29\ub4f1\uc0b0     \uc73c\ub85c \ubd88\ub838\ub2e4\uace0 \ud558\ub294\ub370 \uadf8\uac8c \uad6c\uac1c\uc74c\ud654\ub418\uc5b4 \ubc29\uc99d\uc0b0  \ubaa8\uc74c\ub3d9\ud654\ub418\uc5b4 \ubc29\uc7a5\uc0b0\uc73c\ub85c \ubc14\ub010 \ub4ef\ud558\ub2e4   \ubaa8 \ubc29 \uc790\ub2c8 \uc6d0\ub798\ub294 \ubaa8\ub4f1\uc774\uc5c8\uc744 \uac83\uc774\ub2e4  \uace0\ucc3d\uc758 \uc61b\uc774\ub984\uc774 \ubaa8\uc591\ubd80\ub9ac\ub2c8  \ubaa8\uc591\uc758 \ub4f1 \uc774\ub77c\ub294 \ub73b\uc774\uc5c8\uaca0\ub2e4      \uc0c1\ubd09 \uc11c\ub0a8\ucabd\uc758 \ubcbd\uc624\ubd09\uc744 \ubc29\ubb38\uc0b0\uc774\ub77c\uace0\ub3c4 \ud558\ub294\ub370 \uc5b4\ucc98\uad6c\ub2c8 \uc5c6\ub294 \uc624\ub958\ub2e4  \uad6d\ub9bd\uc9c0\ub9ac\uc6d0\uc774 \ub9cc\ub4e0  \ub9cc\ubd84\uc758   \uc9c0\ub3c4  \uace0\ucc3d \uacfc  \ub2f4\uc591 \uc758 \uacbd\uacc4\uac00 \ub450 \ubd09\uc6b0\ub9ac \uc0ac\uc774\ub85c \uc9c0\ub098\uac00\ub294\ub370 \uc0c1\ubd09\uc774 \uc788\ub294  \ub2f4\uc591 \uc9c0\ub3c4\uc5d0\ub294 \uc774\ub984\uc774 \uc81c\ub300\ub85c \ub418\uc5c8\uc9c0\ub9cc \uc61b\ub0a0  \uace0\ucc3d \uc9c0\ub3c4\uc5d0\ub294 \uc2dd\uc790\uacf5\uc774  \uc5b4\ub978 \uc7a5 \uacfc \ube44\uc2b7\ud55c  \uae00\uc6d4 \ubb38 \uc790\ub97c \uccd0\ub123\uc5b4 \ubc29\ubb38\uc0b0\uc774 \ub41c \uac83\uc774\ub2e4  \uadf8\ub7f0\ub370 \uc774\ub97c \ubaa8\ub974\uace0 \ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \ubc29\ubb38\uc0b0\uc73c\ub85c \uc54c\uace0\uc788\ub294 \ubc14 \ubcc0\uc0b0 \uc758\uc0c1\ubd09\uc758  \uc758    \uc790\ub97c \uc798\ubabb \uc77d\uc5b4 \ucd5c\uace0\ubd09\uc774 \uc624\ub7ab\ub3d9\uc548  \uae30\uc0c1\ubd09 \uc73c\ub85c \ubd88\ub824\uc654\ub358 \uac83\uacfc \ube44\uc2b7\ud55c \ucc98\uc9c0\ub2e4 "
