    "Description": "    \uc124\uacbd \ube7c\uc5b4\ub09c \ucc9c\uc5f0\uc6d0\uc2dc\ub9bc\uc758 \uc0b0         \ubc31\ub355\uc0b0\uc740 \ud3c9\ucc3d\uad70 \ubc29\ub9bc\uba74\uacfc \ud3c9\ucc3d\uc74d  \uc601\uc6d4\uad70 \uc8fc\ucc9c\uba74\uacfc \uc218\uc8fc\uba74  \ud6a1\uc131\uad70 \uc548\ud765\uba74\uc758 \uacbd\uacc4\uc5d0 \uc19f\uc544\uc788\ub294 \ud574\ubc1c        \uc758 \uc0b0\uc774\ub2e4  \ucc9c\uc5f0 \uc6d0\uc2dc\ub9bc\uc744 \uac04\uc9c1\ud55c \uc8fc\uacc4\uace1\uacfc \ud568\uaed8 \uc124\uacbd\uc774 \ub6f0\uc5b4\ub098 \uaca8\uc6b8\ucca0 \uc0b0\ud589\uc9c0\ub85c \uc720\uba85\ud558\ub2e4  \ub354\uc6b1\uc774 \ubc31\ub355\uc0b0 \ub0a8\uc11c\ucabd \uc5f0\ud654\ubd09 \uc544\ub798\uc5d0 \uc124\uc545\uc0b0 \ubd09\uc815\uc554  \uc624\ub300\uc0b0 \uc0c1\uc6d0\uc0ac  \uc601\ucde8\uc0b0 \ud1b5\ub3c4\uc0ac  \uc815\uc554\uc0ac \ud0dc\ubc31\uc0b0\uacfc \ud568\uaed8  \ub300 \uc801\uba78\ubcf4\uad81 \uc911 \ud558\ub098\uc778 \uc2e0\ub77c\uc2dc\ub300 \ucc9c\ub144\uace0\ucc30 \ubc95\ud765\uc0ac\uac00 \uc788\uc5b4 \ub354\uc6b1 \uc720\uba85\ud558\ub2e4     \ubc31\ub355\uc0b0\uc744 \uc624\ub974\ub0b4\ub9ac\ub294 \uae38\ubaa9\uc778 \uc0ac\uc790\uc0b0         \uc740 \uc6d0\ub798 \uc0ac\uc7ac\uc0b0     \uc774\uc5c8\ub2e4  \uc774\ub294 \uc63b  \uafc0  \uc0bc  \ud749\ub144\uc5d0 \uba39\ub294\ub2e4\ub294 \uc804\ub2e8\ud1a0 \ub4f1  \uac00\uc9c0 \ubcf4\ubb3c\uc774 \uc788\uc5b4 \uc0ac\uc7ac\uc0b0\uc5d0\uc11c\ub294 \uad76\uc5b4 \uc8fd\uc9c0 \uc54a\ub294 \uc804\uc124\uc5d0\uc11c \ub098\uc628 \uc774\ub984\uc774\ub2e4  \uadf8\ub7ec\ub098 \ubc95\ud765\uc0ac\ub97c \ucc3d\uac74\ud55c \uc790\uc7a5\uc728\uc0ac\uac00 \ubd80\ucc98\ub2d8\uc758 \uc0ac\ub9ac\ub97c \uc9c0\uae08\uc758 \uc801\uba78\ubcf4\uad81\uc73c\ub85c \ubaa8\uc154\uc624\uba74\uc11c \uc0ac\uc790\ub97c \ud0c0\uace0 \uc654\ub2e4 \ud558\uc5ec \uc0ac\uc790\uc0b0\uc73c\ub85c \ubd88\ub9ac\uace0 \uc788\ub2e4 "
