    "Description": "          \uacbd\ud638\uac15\ubcc0\uc744 \ub530\ub77c \uc801\ubcbd\uc0b0\uacfc \uc774\uc5b4\uc838 \uc6b0\ub69d\uc19f\uc544\uc788\ub294 \ubaa8\uc591\uc0c8\uac00 \uc790\uc5f0\uc0b0\uc131\uc784\uc744 \ud55c\ub208\uc5d0 \uc54c\uc544\ubcf4\uac8c\ub054\ud55c\ub2e4  \uc0bc\uba74\uc774 \uc808\ubcbd\uc73c\ub85c \ub418\uc5b4\uc788\uc5b4 \ub0ae\uc740\uc0b0\uc784\uc5d0\ub3c4 \uc790\uc5f0\uc0b0\uc131\uc73c\ub85c\uc758 \uae30\uc138\uac00 \ub290\uaef4\uc9c4\ub2e4  \uc6d4\uba85\uc0b0 \uc801\ubcbd\uc0b0\uc73c\ub85c \uc774\uc5b4\uc9c0\ub294 \ubd80\ubd84\uc758 \ub0ae\uc740 \ub2a5\uc120\uc774 \ub354\uc6b1 \uc0b0\uc138\ub97c \ub610\ub837\ud558\uac8c \ub9cc\ub4e0\ub2e4  \uc815\uc0c1\ub2a5\uc120\uc740 \ud3c9\ud3c9\ud558\uba70 \uc8fc\ubcc0\uacbd\uad00\uc740 \uc608\ubd80\ud130 \uadf8 \uba85\uc131\uc774 \uc790\uc790\ud558\uc600\ub2e4  \uacbd\ud638\uac15 \ub4b7\ud3b8\uc73c\ub85c \uc228\uc5b4\uc788\ub294 \uc0b0\uc131\ub9c8\uc744\uc5d0 \ub2e4\ub2e4\ub97c\ub54c\ucbe4 \ubc31\ub9c8\uc0b0\uc740 \uc790\uc2e0\uc758 \uae30\uc138\ub97c \ud480\uace0 \uc644\ub9cc\ud55c \uc0b0\uc138\ub97c \ud5c8\ub77d\ud55c\ub2e4             \ubc31\ub9c8\uc0b0 \uc77c\ub300\uc758 \uacbd\uce58\ub294 \uc608\ub85c\ubd80\ud130 \uc544\ub984\ub2f5\uae30\ub85c \uc720\uba85\ud558\ub2e4  \uc870\uc120\uc2dc\ub300\uc5d0 \uc801\ubcbd \uc544\ub798 \uac15\ubcc0 \uc232 \uc18d\uc5d0\ub294 \uc2e0\uc548\ub8e8\ub97c \ube44\ub86f\ud558\uc5ec \uacbd\uc5f0  \ub2f4\ubd84  \uc720\ucde8  \ub9e4\uc5f0  \uc6b0\ud654 \ub4f1 \uc5ec\uc12f \ub204\uac01\uc774 \uc788\uc5c8\ub2e4\uace0 \uc804\ud55c\ub2e4  \uba40\ub9ac \uc11c\uc6b8\uc5d0\uc11c \ub3c4\ubcf4\ub85c  \ubc31  \uc2ed\ub9ac\ub97c \ub0b4\ub824\uc628 \uae38\uc190\uc774 \uc774\uacf3\uc744 \ucc28\ub9c8 \uadf8\uc800 \uc9c0\ub0a0 \uc218\uac00 \uc5c6\uc5b4\uc11c \uc218\ub824\ud55c \ud48d\uad11\uc5d0 \uc816\uc5b4 \uac00\ubb34\uc640 \ud48d\uc545\uc18d\uc5d0 \uc138\uc6d4\uc774 \uac00\ub294 \uc904\ub3c4 \ubaa8\ub974\uace0 \ub180\uc558\ub2e4\uace0 \ud55c\ub2e4             \ubc31\ub9c8\uc0b0\uc740 \uc0bc\uba74\uc774 \uc808\ubcbd\uc73c\ub85c \ub458\ub808\uac00      \ucc99\uc774\uace0 \ub3d9\ub0a8\ucabd\uc740    \uc5ec \ucc99\uc73c\ub85c \ub41c \uc790\uc5f0\uc0b0\uc131\uc774\ub2e4  \uc815\uc0c1\uc740 \ud3c9\ud0c4\ud55c\ub370 \uc5ec\uae30\uc5d0\ub294 \ubabb\uacfc \ucc3d\uace0\ud130\uac00 \ub0a8\uc544\uc788\ub2e4  \ub610\ud55c \uc554\ubc18\uc5d0\ub294 \uae4a\uc774     \uac00\ub7c9\uc758 \uad70\uc6a9\uc73c\ub85c \uc4f0\uc778 \uad6c\uba4d    \uc5ec\uac1c\uac00 \ub0a8\uc544\uc788\ub2e4  \ub098\ub77c\uac00 \uc5b4\ub824\uc6b8 \ub54c\ub9c8\ub2e4 \uc774 \uc131\uc740 \uc790\uc8fc \uc774\uc6a9\ub418\uc5c8\ub2e4  \uc784\uc9c4\uc65c\ub780 \ub54c\uc5d0\ub294 \uc5ec\ub7ec \ucc28\ub840\uc5d0 \uac78\uccd0\uc11c \uc9c4\uc8fc\uc5d0\uc11c \ubc00\ub824\ub4e0 \uc65c\uc801\uc744 \ub9c9\uae30 \uc704\ud574\uc11c \ucc3d\uc758\ubcd1\ub4e4\uc774 \uc774 \uc0b0\uc131\uc744 \uc9c0\ud0a4\uace0 \uc788\uc5c8\ub2e4  \ud55c\ubc88\uc740 \ud3ed\uc5fc\uc758  \uc6d4\uc778\ub370 \uc65c\uc801\uc774 \uc131\uc744 \ud3ec\uc704\ud55c \ucc44 \uba70\uce60\uc774\uace0 \uae30\ub2e4\ub9ac\ub294 \uc9c0\uad6c\uc804\uc744 \ud3bc\uce58\ub294 \uac00\uc6b4\ub370 \uc131\uc548\uc5d0\ub294 \ubb3c\uc774 \ub5a8\uc5b4\uc838\uc11c \uc0ac\ub78c\uacfc \ub9d0\uc758 \uae30\uac08\uc774 \ub9c9\uc2ec\ud558\uc600\ub2e4  \uc774\ub54c \ud55c \uc9c0\ud61c\ub85c\uc6b4 \uc7a5\uc218\uac00 \ub9d0\uc744 \ubc14\uc704 \ub05d\uc5d0 \uc138\uc6cc\ub450\uace0 \uc300\uc744 \ub9d0 \ub4f1\uc5d0 \ud37c\uc11c \ub358\uc84c\ub354\ub2c8 \uc0b0\ubc11\uc5d0\uc11c \uc131\uc744 \ud3ec\uc704\ud558\uace0 \uc788\ub358 \uc65c\ubcd1\uc5d0\uac8c\ub294 \uadf8\uac83\uc774 \ub9c8\uce58 \uc131\uc548\uc5d0 \ubb3c\uc774 \ub9ce\uc544\uc11c \ub9d0\uc744 \uba71\uac10\uae30\ub294 \uac83\uc73c\ub85c \ubcf4\uc600\ub2e4  \uc774\uc5d0 \uadf8\ub4e4\uc740 \ub354\uc624\ub798 \ud3ec\uc704\ub97c \ud574\ub3c4 \uc2b9\uc0b0\uc774 \uc5c6\uc744 \uac83\uc73c\ub85c \uc54c\uace0 \ud1f4\uac01\ud558\uc600\ub294\ub370 \uc774\ub54c \uc131\uc548\uc5d0 \uc788\ub358 \ubcd1\uc0ac\uc640 \ub9d0\uc774 \uc77c\uc2dc\uc5d0 \ub0b4\ub2ec\uc544 \uac15\ubb3c\uc744 \ub9c8\uc168\ub354\ub2c8 \uc2e0\uc548\uac15 \ubb3c\uc774 \uc138 \uce58\ub098 \uc904\uc5c8\ub2e4\ub294 \uc804\uc124\uc774 \uc788\uace0 \uadf8 \uc77c\ub85c \uc778\ud558\uc5ec \uc0b0\uc774\ub984\ub3c4 \ub3d9\uc0b0\uc131\uc5d0\uc11c \ubc31\ub9c8\uc0b0\uc131\uc73c\ub85c \ubcc0\ud558\uc600\ub2e4  \ub610\ud55c \uc774\uacf3\uc740 \uc815\uc720\uc7ac\ub780 \uc2dc \ucda9\ubb34\uacf5 \uc774\uc21c\uc2e0 \uc7a5\uad70\uc774 \ubc31\uc758\uc885\uad70\ud558\uba74\uc11c \ud569\ucc9c \ucd08\uacc4\uc758 \uad8c\uc728 \uc7a5\uad70\uc601\uc5d0\uc11c \ucd9c\ubc1c\ud558\uc5ec \ub0a8\ud574\uc758 \uc804\uc138\ub97c \uc0b4\ud53c\uae30 \uc704\ud558\uc5ec \uc9c0\ub098\uac00\ub294 \uae38\uc5d0 \uc774 \uc0b0\uc5d0 \uc62c\ub77c\ubcf4\uace0 \ub2e8\uc131\ud604\uc5d0\uc11c \ud558\ub8fb\ubc24\uc744 \uc720\uc219\ud55c \ud589\ub85c\uc774\uae30\ub3c4 \ud558\ub2e4             \ubc31\ub9c8\uc0b0 \uc544\ub798 \uc57c\uc0b0 \uc77c\ub300\uc5d0\ub294 \uc120\uc0ac\uc2dc\ub300\uc758 \uc720\uc801 \uace0\ubd84\uad70\uc774 \uc788\uc73c\uba70 \uac15\uc744 \uc0ac\uc774\ub85c \ud558\uc5ec \uac15\ub8e8\ub9c8\uc744 \uc704\ucabd\uc5d0\ub294 \uc120\uc0ac\uc720\uc801\uc774 \uc0b0\uc7ac\ud558\uc5ec \uc5ed\uc0ac\uc790\ub8cc\ub85c \ubcf4\uc804\ud558\uace0 \uc788\ub2e4  \uc0b0\uc131\ub9c8\uc744\uc5d0\ub294 \ucd94\uac15 \uc774\ucc3d\uc774 \uac15\ud559\ud558\ub358 \uc720\uc5f0\uc7ac\uac00 \uc788\uc5b4 \ucc44\ub840\ub97c \ud558\uace0 \uc788\uc73c\uba70  \uc870\uae08 \uac70\ub9ac\ub97c \ub450\uace0 \uc548\uace1\uc601\ub2f9\uc5d0\ub294 \ub18d\uc11c\uad70 \uc774\uc7a5\uacbd  \ubb38\uc5f4\uacf5 \uc774\uc870\ub144  \uacbd\uc740 \uc774\ud3ec  \ubaa8\uc740 \uc774\uc778\ub9bd  \uacbd\ubb34\uacf5 \uc774\uc81c\ub97c \ubc30\ud5a5\ud558\uc600\ub2e4 "
