    "Description": "    \uce35\uaf43\ub098\ubb34 \ubb34\ub9ac\uc9d3\ub294 \ub2e8\ud48d\uc758 \uba85\uc0b0        \ubc31\uc554\uc0b0\uc740 \ub0b4\uc7a5\uc0b0 \uc785\uc554\uc0b0\uacfc \ud568\uaed8 \ub0b4\uc7a5\uc0b0\uad6d\ub9bd\uacf5\uc6d0\uc5d0 \uc18d\ud574 \uc788\ub2e4  \uae30\uc554\uad34\uc11d\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c4 \uc0ac\uc790\ubd09\uacfc \ubc31\ud559\ubd09\uc744 \uc0ac\uc774\uc5d0 \ub450\uace0 \uc0c1\uc655\ubd09\uc774 \uc6b0\ub69d \uc19f\uc544 \ub9de\uc740\ud3b8 \ub0b4\uc7a5\uc0b0 \uc2e0\uc120\ubd09\uacfc \uc5b4\uae68\ub97c \uaca8\ub8ec\ub2e4  \uc608\ubd80\ud130 \ubc31\uc591\uc0ac\uc758 \ube44\uc790\ub098\ubb34\uc232\uacfc \ubc9a\uaf43\ub098\ubb34\ub294 \uac00\uc744\uc758 \ub0b4\uc7a5\uc0b0 \ub2e8\ud48d\uacfc \ub354\ubd88\uc5b4 \uc720\uba85\ud558\uba70 \uc0b0\uc138\uac00 \ubd80\ub4dc\ub7ec\uc6cc \uc5b4\ub835\uc9c0 \uc54a\uac8c \ub4f1\uc0b0\uc744 \uc990\uae38 \uc218 \uc788\ub2e4     \uc0b0 \uae30\uc2ad\uc5d0\ub294 \ub300\ud55c\ubd88\uad50\uc870\uacc4\uc885   \uad50\uad6c \ubcf8\uc0ac\uc778 \ubc31\uc591\uc0ac\uac00 \uc788\ub294\ub370    \ub144 \ubb34\uc655   \ub144  \ucc3d\uac74\ud558\uc5ec \ubc31\uc554\uc0ac\ub77c \ubd80\ub974\ub2e4 \uc870\uc120 \uc120\uc870\ub54c \ud658\uc591\uc774 \ubc31\uc591\uc0ac\ub77c \uace0\uccd0\ubd88\ub800\ub2e4\uace0 \ud55c\ub2e4  \uc804\uc124\uc5d0\ub294 \ud658\uc591\uc774 \ubc31\ud559\ubd09 \uc544\ub798\uc5d0\uc11c \uc81c\uc790\ub4e4\uc5d0\uac8c \uc124\ubc95\ud558\uace0 \uc788\uc744\ub54c \ubc31\uc591 \ud55c\ub9c8\ub9ac\uac00 \uc774\ub97c \ub4e3\uace0 \uae68\uc6b0\uce68\uc758 \ub208\ubb3c\uc744 \ud758\ub824 \ubc31\uc591\uc0ac\ub77c \ubd88\ub800\ub2e4\uace0\ub3c4 \uc804\ud574\uc9c4\ub2e4 "
