    "Description": "          \uc778\ucc9c \uad6d\uc81c \uacf5\ud56d\uc774 \uc788\ub294 \uc601\uc885\ub3c4 \uc911\uc559\uc5d0 \uc81c\uc77c \ub192\uc740 \ubc31\uc6b4\uc0b0\uc740      \uc5ec \ub144 \uc804\uc778 \uc2e0\ub77c \ubb38\ubb34\uc655 \ub54c \uc6d0\ud6a8\ub300\uc0ac\uac00 \ucc3d\uac74\ud588\ub2e4\ub294 \uace0\ucc30 \uc6a9\uad81\uc0ac    \uc744 \uc911\uc559\uc5d0 \ud488\uace0 \uc788\ub294 \uba85\uc0b0\uc774\ub2e4  \ubc14\ub2e4\ub97c \uc0ac\uc774\uc5d0 \ub450\uace0 \uc6d4\ubbf8\ub3c4\uc640 \uc11c\ub85c \ub9c8\uc8fc \ubcf4\uace0 \uc788\uc73c\uba70  \ud56d\uc0c1 \uc548\uac1c\uc640 \ud770 \uad6c\ub984\uc5d0 \uc2f8\uc5ec \uc788\uc5b4 \ubc31\uc6b4\uc0b0\uc774\ub77c \ud558\uc600\ub2e4 \ud55c\ub2e4                    \uc77c\ucc0d\uc774 \uc6d0\ud6a8\ub300\uc0ac\uac00 \uc2e0\ube44\ud55c \uc0b0\uc138\uc5d0 \ubc18\ud558\uc5ec \uc6a9\uad81\uc0ac\ub97c \ucc3d\uac74 \ud588\ub2e4\ub294 \ubc31\uc6b4\uc0b0\uc740 \uc0b0\uc18c \ubc30\ucd9c\ub7c9\uc774 \uc5b4\ub290\uc0b0\ubcf4\ub2e4 \ub9ce\ub2e4\uace0 \ud55c\ub2e4  \uc232\uc5d0\uc11c \ubc30\ucd9c\ub418\ub294 \uc88b\uc740 \uc0b0\uc18c\ub294 \ub450\ub1cc\uc758 \ud734\uc2dd\uc740 \ubb3c\ub860 \uc778\uccb4\uc758 \ud608\uad00 \uacc4\ud1b5\uc73c\ub85c \uc804\ub2ec \ub418\uc5b4\uc838 \uac74\uac15 \uc720\uc9c0\uc5d0 \ud0c1\uc6d4\ud55c \ud6a8\ub2a5\uc774 \uc788\ub2e4  \uc774\ub7f0 \uc0b0\uc18c\uac00    \uc774\uc0c1\uc774 \uce21\uc815 \ub41c \uacf3\uc774 \uc601\uc885\ub3c4 \ub77c \ud55c\ub2e4  \uadf8\ub798\uc11c \uc554 \ub4f1 \ubd88\uce58\ubcd1 \ud658\uc790\ub4e4\uc774 \ud734\uc591\ucc28 \ub9ce\uc774 \uc0b0\ucc45\uc744 \ud558\ub294 \uacf3\uc73c\ub85c \uc54c\ub824\uc838 \uc788\ub2e4  \ubcf4\ud1b5\uc0b0\uc758 \uc0b0\uc18c \ubc30\ucd9c\ub7c9\uc774         "
