    "Place": "\uacbd\uae30\ub3c4 \uc774\ucc9c\uc2dc",
    "Description": "          \uc7a5\ud638\uc6d0\uc74d\uc758 \uc9c4\uc0b0\uc73c\ub85c \ud574\ubc1c      \uc815\uc0c1\uc5d0\ub294 \ubc31\uac1c\uc758 \ubc1c\uc744 \uac00\uc9c4 \uc9c0\ub124\uac00 \uc0b4\uc558\ub2e4\uace0 \uc804\ud558\ub294 \uc9c0\ub124\uad74\uc774 \uc788\ub294\ub370 \uc9c0\ub124 \uc804\uc124\uc5d0\uc11c \ubc31\uc871\uc774\ub77c\ub294 \uc774\ub984\uc774 \uc720\ub798\ub418\uc5c8\ub2e4\uace0 \ud55c\ub2e4  \uc0b0 \ub0a8\ucabd\uae30\uc2ad\uc5d0 \uc704\uce58\ud55c \uae40\uc790\uc810\uc758 \uc544\ubc84\uc9c0 \ubb18\ud130\uac00 \ubc14\ub85c \uae08\ubc18\ud615\uc9c0\ub77c\ub294 \uc804\uc124\uc774 \uc788\ub294\ub370 \uc544\ubb34\ub9ac \uac15\ud48d\uc774 \uc2ec\ud558\uac8c \ubd88\uc5b4\ub3c4 \uc774\uacf3\uc740 \ubc14\ub78c\ud55c\uc810 \uc5c6\uc774 \ud3c9\uc628\ud558\ub2e4\uace0 \ud55c\ub2e4  \ub3d9\uad6d\uc5ec\uc9c0\uc2b9\ub78c\uc5d0 \uc0b0\uc911\uc5d0 \uc11d\ub0a8\uc0ac\uc640 \ubc31\uc871\uc0ac\uac00 \uc788\ub2e4\ub294 \uae30\ub85d\uc744 \ubcf4\uc544 \uc774\uc0b0\uc5d0 \uc808\uc774 \uc788\uc5c8\uc74c\uc744 \uc54c \uc218 \uc788\uc73c\ub098 \uc9c0\uae08\uc740 \ucc3e\uc744 \uae38\uc774 \uc5c6\ub2e4  \uc7a5\ud638\uc6d0\uc74d \uc11c\ucabd\ubc29\ud5a5\uc73c\ub85c      \ubb34\ub7c9\uc0ac \uc8fc\ucc28\uc7a5\uc5d0\uc11c \ucd9c\ubc1c\ud55c\ub2e4  \ubc31\uc871\uc0b0\uc758 \ud2b9\uc9d5\uc740 \uc2dc\uc791\uc774 \uc57d\uc218\ud130\uc774\uace0 \uc885\uc8fc\ud560 \uc218 \uc788\ub294 \ub4f1\uc0b0\ub85c\uc640 \uac01\uae30 \ub2e4\ub978 \ucf54\uc2a4\ub85c \uc2dc\uc791\ud558\uc5ec\ub3c4 \ub4f1\uc0b0 \uae43\uc810\uc778 \uc57d\uc218\ud130\ub85c \ud558\uc0b0 \ud560 \uc218 \uc788\ub294 \ub4f1\uc0b0\ub85c\ub85c \uad6c\ubd84\ub418\uc5b4 \ub204\uad6c\ub098 \uc990\uac81\uace0 \uc26c\uc6b4 \uc0b0\ucc45 \ub4f1\uc0b0\uc744 \ud560 \uc218 \uc788\ub294 \ud2b9\uc131\uc774 \uc788\ub2e4  \ub610\ud55c \ubc31\uc871\uc0b0 \ub4b7\ud3b8\uc5d0 \uc704\uce58\ud55c \uad6c\uc808\ud130\uc640 \uad74\ubc14\uc704\ucabd\uc740 \uae30\uc554\ubc14\uc704\ub85c \ub418\uc5b4 \uc788\uc5b4 \uac00\ubcbc\uc6b4 \uc554\ubc18\ub4f1\uc0b0\uc744 \uc990\uae38 \uc218 \uc788\ub294 \uae30\uc068\uc744 \uc5bb\uc744 \uc218 \uc788\uace0 \ud2b9\ud788 \uc7a5\ud638\uc6d0\uc740 \ubcf5\uc22d\uc544 \uc8fc\uc0b0\ub2e8\uc9c0\ub85c \uc720\uba85\ud55c \uc7a5\ud638\uc6d0 \ud669\ub3c4\ubcf5\uc22d\uc544\uac00 \ucd08\uc5ec\ub984\ubd80\ud130 \uc0dd\uc0b0\ub418\uc5b4 \uc804\uad6d\uc81c\uc77c\uc758 \ubcf5\uc22d\uc544\ub97c \ub9db\ubcfc \uc218 \uc788\ub2e4                           \uad74\ubc14\uc704 \uc804\uc124   \ubc31\uc871\uc0b0 \ub3d9\ub0a8\ucabd \ubd09\uc6b0\ub9ac \ubc14\ub85c \ubc11\uc5d0 \ud3ed     \ub192\uc774   \uc815\ub3c4\uc778 \ub3d9\uad74\uc774 \uc788\ub294\ub370 \uc774\ub97c \uc138\uce6d \uad74\ubc14\uc704\ub77c \ubd80\ub978\ub2e4  \uc61b\ub0a0 \uc138\uc885\ub300\uc655\ub54c \uc774 \uc606\uc5d0 \ud070 \uc0ac\ucc30\uc774 \uc788\uc5c8\uc73c\uba70 \uc218\uc2ed\uba85\uc758 \uc2b9\ub824\ub4e4\uc774 \uc218\ub3c4\ub97c \ud558\uace0 \uc788\uc5c8\ub294\ub370 \uc774\uad74\ub85c \ubd80\ud130 \uc548\uac1c\uac00 \uc790\uc6b1\ud560\ub54c\uba74 \uc2b9\ub824\uac00 \ud55c\uba85\uc529 \ud589\ubc29\ubd88\uba85\ub418\ub294 \uc0ac\uac74\uc774 \uc77c\uc5b4\ub0ac\ub2e4  \ud0d1\uace8 \uc0ac\ub294 \uc7a5\uc0dd\uc6d0\uc774\ub780 \uc0ac\ub78c\uc774 \uc774\ub7f0\uc77c\uc5d0 \uc5b4\ub5a4 \uace1\uc808\uc774 \uc788\uc744 \uac83\uc73c\ub85c \uc0dd\uac01\ud558\uace0 \ub9c8\uc9c0\ub9c9 \uc2a4\ub2d8\uc774\uc790 \uce5c\uad6c\uc5d0\uac8c \ub3c5\uc57d \ub2f4\ubc30\uc9c4  \ubc14\ub978\uc637\uc744 \uc785\ud600 \uae30\ub3c4\ub97c \uc62c\ub9ac\uac8c \ud588\ub2e4  \uadf8\ub54c\ub3c4 \uc5ed\uc2dc \uc548\uac1c\uac00 \uc790\uc6b1\ud558\uac8c \ub07c\ub354\ub2c8 \uac11\uc790\uae30 \ubcbc\ub77d\uce58\ub294 \uc18c\ub9ac\uac00 \ub098\uba70 \ud070 \uc9c0\ub124\uac00 \ud55c\ub9c8\ub9ac \uc8fd\uc5b4 \uc790\ube60\uc9c0\uba70 \ud478\ub978 \uc11c\uae30\uac00 \ud558\ub298\ub85c \ubed7\ucce4\ub2e4\uace0 \ud55c\ub2e4 "
