    "Description": "          \uc0c1\uc544\uc0b0     \uc740 \uc778\ucc9c \ub300\uacf5\uc6d0\uacfc \uc778\uc811\ud558\uc5ec \uc788\uae30 \ub54c\ubb38\uc5d0 \ub204\uad6c\ub098 \uc27d\uac8c \ub4f1\ubc18\uc774 \uac00\ub2a5\ud55c \ub3c4\uc2dc \uadfc\uad50\uc0b0\uc774\ub2e4  \uad00\ubaa8\uc0b0\uc758 \ub2a5\uc120\uc744 \uc5f0\uc774\uc5b4 \ud2b8\ub798\ud0b9\ud558\ub294 \ucf54\uc2a4\ub294 \ub3c4\uc2dc \uadfc\uad50\uc0b0\uc758 \ucc38 \ub9db\uc744 \ub290\ub084 \uc218 \uc788\uc5b4 \ub9e4\ub825\uc801\uc774\ub2e4  \ub3d9\ucabd\uc73c\ub85c \uc18c\ub798\uc0b0\uacfc \uc11c\ucabd\uc73c\ub85c \uac70\uba38\ub9ac\uc0b0 \uadf8\ub9ac\uace0 \ubd81\ucabd\uc73c\ub85c\ub294 \uac70\ub9c8\uc0b0\uc744 \uc774\uc6c3\ud558\uace0 \uc788\ub294\uc0c1\uc544\uc0b0\uc740 \ud55c\ub0a8\uc815\ub9e5 \ucf54\uc2a4\uc5d0\uc11c \ube60\uc9c8 \uc218 \uc5c6\ub294 \uc774\ub984\ucc98\ub7fc \uc544\ub984\ub2e4\uc6b4 \uc778\ucc9c\uc758 \uc0b0\uc774\ub2e4                         \uc0c1\uc544\uc0b0\uc740 \uc778\ucc9c \ub300\uacf5\uc6d0\uc758 \uc5ec\ub7ec \uc624\ub77d\uc2dc\uc124\uacfc \uc5b4\ub9b0\uc774 \ub3d9\ubb3c\uc6d0  \ub208 \uc370\ub9e4\uc7a5\ub4f1\uc758 \ub180\uc774 \uc2dc\uc124\uc744 \ub364\uc73c\ub85c\uc990\uae38 \uc218 \uc788\uc73c\uba70  \uc815\uc0c1\ubd80 \uc815\uc790\uc5d0\uc11c\uc758 \uc18c\ub798\uc0b0 \uc870\ub9dd\uc774 \ud2b9\ud788 \ube7c\uc5b4\ub098\ub2e4 \uc61b \ubd80\ud130 \uc778\ucc9c \uc7a5\uc218\ub3d9\uc758 \uc57d\uc218\uac00 \uc88b\uc544 \ud070 \uc778\ubb3c\uc774 \ub09c\ub2e4\ub294 \uc774\uc57c\uae30\uac00 \uc804\ud574\uc800 \uc624\uace0 \uc788\uc73c\uba70  \uc5ec\ub7ec \uacf3\uc5d0\uc57d\uc218\ud130\uac00 \uc788\uc5b4 \uc2dc\ubbfc\ub4e4\uc758 \ubc1c\uae38\uc774 \ub048\uc774\uc9c0 \uc54a\uace0 \uc788\ub2e4 "
