    "Description": "          \ud574\ubc1c        \uc778 \uc0c1\uc815\ubc14\uc704 \uc815\uc0c1\uc5d0 \uc62c\ub77c\uc11c \uc544\ub798\ub97c \ub0b4\ub824\ub2e4\ubcf4\uba74 \ucd95\uc18c\ub41c \uc6b0\ub9ac\ub098\ub77c \uc9c0\ub3c4\ub97c \ubcfc \uc218 \uc788\ub2e4  \ud718\ub3cc\uc544 \uac10\uace0 \ub3c4\ub294 \uc870\uc591\uac15 \ubb3c\uc904\uae30\ub294 \ud55c\ubc18\ub3c4\ub97c \ub458\ub7ec\uc2fc \ub3d9\ud574  \ub0a8\ud574  \uc11c\ud574 \ubc14\ub2e4\ub85c \ubcf4\uc774\uba70  \uac15\uc5d0 \ub458\ub7ec\uc2f8\uc778 \ubd80\ubd84\uc740 \ubc31\ub450\ub300\uac04\uc744 \ube44\ub86f\ud55c \uc0b0\uacfc \ub4e4\ucc98\ub7fc \ubcf4\uc774\uba70  \ub9de\uc740\ud3b8\uc744 \uc9c0\ub098\ub294   \ubc88\uad6d\ub3c4\ub294 \ub9c8\uce58 \uc911\uad6d\uacfc\uc758 \uad6d\uacbd\uc120\ucc98\ub7fc \ubcf4\uc778\ub2e4  \ud55c\ubc18\ub3c4 \uc9c0\ud615\uc774 \uc54c\ub824\uc9c0\uae30 \uc804\uc5d0\ub294 \uc0ac\ub78c\uc758 \ubc1c\uae38\uc774 \ub738\ud558\ub358 \ub4f1\uc0b0\ub85c\uc600\uc73c\ub098     \ub144\uc5d0 \uc774\ub7f0\uc0ac\uc2e4\uc774 \uc54c\ub824\uc9c0\uba74\uc11c \ub4f1\uc0b0\uac1d\uc774 \uc99d\uac00\ud558\uace0 \uc788\ub2e4  \uc815\uc0c1\uae4c\uc9c0 \uc624\ub974\ub294 \ub2a5\uc120\uc774 \uc644\ub9cc\ud558\uc5ec \uc27d\uac8c \uc624\ub97c\uc218 \uc788\uc73c\uba70 \uc8fc\uc704 \uacbd\uad00\uc774 \uc544\ub984\ub2e4\uc6cc \uc0b0\ud589\uc744 \uc990\uae38\uc218 \uc788\ub2e4  \ub610\ud55c \ub4f1\uc0b0\ub85c \uc785\uad6c\uc5d0\ub294 \ud669\ud1a0\ub85c \uc9c0\uc740 \ubbfc\ubc15\uc9d1\uc774 \uc788\uc5b4 \ud558\ub8e8\uc815\ub3c4 \uc26c\uc5b4\uac00\uae30\uc5d0\ub3c4 \uc88b\ub2e4  \uc815\uc120\uc544\ub9ac\ub791 \uac00\uc0ac \uc911\uc5d0 \ub0a8\uc0b0\uc774 \ub4f1\uc7a5\ud558\ub294 \uac83\uc774 \uc788\ub294\ub370 \uadf8 \ub0a8\uc0b0\uc774 \ubc14\ub85c \uc774 \uc0c1\uc815\ubc14\uc704\uc0b0\uc774\ub2e4  \uc544\uc6b0\ub77c\uc9c0\uc5d0\uc11c \ubcf4\uc790\uba74 \uc0c1\uc815\ubc14\uc704\uc0b0\uc774 \ub0a8\ucabd\uc5d0 \uc790\ub9ac\uc7a1\uace0 \uc788\ub2e4 "
