    "Place": "\uac15\uc6d0\ub3c4 \ucca0\uc6d0\uad70",
    "Description": "          \uc0c1\ud574\ubd09 \ucf54\uc2a4 \ub4f1\uc0b0\ud558\uae30 \uc801\ub2f9\ud55c\ucf54\uc2a4\uba70 \uc815\uc0c1\ubd80\uac00 \ud2b9\uc774\ud558\uac8c \uc554\ubcbd\uc73c\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\uc74c \ud45c\uc9c0\uc11d \uace0\ub3c4\ub294      \ub85c \ud45c\uc2dc\ub418\uc5b4 \uc788\uc74c \uc124\uce58     \ub144  \uc6d4   \uc77c \uc790\ub4f1 \uc0b0\uc545\ud68c \ubd09\uc6b0\ub9ac \uc704\ub294 \uc554\uc11d\uc73c\ub85c\uc11c \uc704\ud5d8 \ud558\uba70 \ub178\uc57d\uc790\ubc0f \uc5b4\ub9b0\uc774\ub294 \ub4f1\ubc18\ubd88\uac00\ud558\uba70 \ud45c\uc9c0\uc11d\uc740     \ub85c \ud45c\uc2dc\ub418\uc5c8\uc74c \uc6d0\uc544\uc0ac \ub4e4\uc5b4\uac00\ub294 \ub3c4\ub85c \uc88c \uc6b0\uce21\uc5d0 \uba4b\uc788\ub294 \uc554\ubcbd\uacfc\ubc14\uc704\uac00 \uc788\uc74c             \uac15\uc6d0\ub3c4 \ucca0\uc6d0\uad70 \uc11c\uba74 \uadfc\ub0a8\uba74\uacfc \ud654\ucc9c\uad70 \uc0ac\ub0b4\uba74 \uacbd\uacc4\uc5d0 \uc788\ub294 \uc0b0\uc73c\ub85c\uc11c \ub192\uc774\ub294          \uce21\uc815\ub192\uc774 \ud68c\ubaa9\ud604\uace0\uac1c\uc640 \uad11\ub355\uc0b0\uc744 \uc787\ub294 \ud55c\ubd81\uc815\ub9e5\uc73c\ub85c \ubd80\ud130 \uac08\ub77c\uc9c4 \uc9c0\ub9e5\uc5d0\uc11c \uc81c\uc77c \ub192\uc740 \uc0b0\uc774\uba70 \uc0c1\ud574\ubd09\uc815\uc0c1\uc740 \ubc14\uc704\ubd09\uc73c\ub85c \ub418\uc5b4\uc788\ub2e4 \uc0c1\ud574\ubd09\uc774\ub780 \uc774\ub984\uc740 \uc815\uc0c1\uc758\ubc14\uc704 \uc9c0\ub300\uac00 \ub9c8\uce58 \ub9dd\ub9dd\ub300\ud574\uc5d0 \ub5a0\uc788\ub294 \uc554\ucd08\ucc98\ub7fc \ubcf4 \uc778\ub2e4\ud558\uc5ec \ubd99\uc5ec\uc9c4 \uc774\ub984\uacfc\uba3c \uc61b\ub0a0\uc5d0\ub294 \ubc14\ub2e4\uc600\ub294\ub370 \uc9c0\uae08\uc740 \ubd09\uc6b0\ub9ac\uac00\ub418\uc5c8\uae30\uc5d0 \uc0c1\ud574\ubd09 \uc774\ub780 \uc774\ub984\uc744 \ubd99\uc600\ub2e4\ub294 \uc124\uc774\uc788\ub2e4 \uc0b0\uaf2d\ub300\uae30 \ubc14\uc704\uc5d0 \ubc30\uac00\ub9e4\uc5ec \uc788\uc5c8\ub2e4\ub294 \uc804\uc124\ub3c4 \uc788\ub2e4 "
