    "Place": "\uacbd\uc0c1\ubd81\ub3c4 \ubd09\ud654\uad70 \ubb3c\uc57c\uba74, \uc601\uc8fc\uc2dc \ubd80\uc11d\uba74. \uac15\uc6d0\ub3c4 \uc601\uc6d4\uad70 \ud558\ub3d9\uba74",
    "Description": "              \uc591\ubc31    \uc9c0\uac04\uc5d0 \uc19f\uc740 \ub0b4\uc131\ucc9c\uc758 \ubc1c\uc6d0\uc9c0                                  \uc120\ub2ec\uc0b0\uc740 \uacbd\ubd81 \ubd09\ud654\uad70 \ubb3c\uc57c\uba74  \uc601\uc8fc\uc2dc \ubd80\uc11d\uba74\uacfc \uac15\uc6d0 \uc601\uc6d4\uad70 \ud558\ub3d9\uba74\uc5d0 \uac78\uccd0 \uc788\ub294 \ubd09\uc6b0\ub9ac\ub85c \uccad\uc815\uacc4\uace1\uacfc \uc6b0\uc544\ud55c \uc0b0\uc138\ub97c \uc790\ub791\ud55c\ub2e4  \ub0a8\uc73c\ub85c \uac08\uacf6\uc0b0      \uacfc \ubd09\ud669\uc0b0        \uc11c\ub85c \ud68c\uc554\ub839 \uc5b4\ub798\uc0b0         \ub3d9\uc73c\ub85c \uc625\uc11d\uc0b0 \uc625\ub3cc\ubd09 \uc774 \uc560\uc6cc\uc2f8\uace0 \uc788\ub2e4  \ubd81\ucabd\uc5d0\ub294 \uc77c\uacf1\ub2a5\uc120\uc774 \uc120\ub2ec\uc0b0\uc73c\ub85c \uc774\uc5b4\uc84c\ub2e4\ub294 \ub73b\uc758 \uce60\ub8e1\uace8\uc774 \uc788\ub2e4  \ub610 \uc774\uacf3\uc740 \uc18c\ubc31\uc0b0\uacfc \ud0dc\ubc31\uc0b0\uc758 \uc591\ubc31    \uc9c0\uac04\uc5d0 \uc788\ub294 \uc0b0\uc73c\ub85c \ubc31\ub450\ub300\uac04 \uad6c\uac04\uc5d0 \uc18d\ud55c\ub2e4  \uc5b8\ub73b \ubd10\uc11c\ub294 \uac15\uc6d0\ub3c4\uc758 \uc601\uc11c \ub0b4\ub959\uc9c0\ubc29 \uac19\uc740 \ubd84\uc704\uae30\ub97c \ud48d\uae30\ub294 \uc120\ub2ec\uc0b0\uc740 \ub099\ub3d9\uac15\uc758 \uc9c0\ub958\uc778 \ub0b4\uc131\ucc9c     \uc758 \ubc1c\uc6d0\uc9c0\uae30\ub3c4 \ud558\ub2e4                     \uc804\uad6d\uc5d0\uc11c\ub3c4 \uc190\uaf3d\ud788\ub294 \uc624\uc804\uc57d\uc218\uac00 \uc788\uc5b4 \uc57d\uc218\uc0b0\ud589\uc9c0\ub85c\ub3c4 \uc798 \uc54c\ub824\uc9c4 \uc120\ub2ec\uc0b0\uc758 \uc0b0\ud589\ucf54\uc2a4\ub294 \ud06c\uac8c \uc138 \uac08\ub798  \ubd09\ud654 \ucabd \ubb3c\uc57c\uc800\uc218\uc9c0\uac00 \uc788\ub294 \uc624\uc804 \ub9ac \uc0dd\ub2ec\ub9c8\uc744\uc5d0\uc11c \uc6a9\uc6b4\uc0ac \ub2a6\uc740\ubaa9\uc774\ub97c \uac70\uccd0 \uc815\uc0c1\uc5d0 \uc624\ub974\uac70\ub098 \uc0ac\uae30\uc810\ub9c8\uc744\uc758 \uc655\ubc14\uc6b0\uace8\uc744 \ub4e4\uba38\ub9ac\ub85c \uc6d0\uc810\ud68c\uadc0 \uc0b0\ud589\ud558\ub294 \uac83\uc774 \uc77c\ubc18\uc801\uc774\ub2e4  \uc601\uc8fc \ucabd\uc5d0\uc120 \ub0a8\ub300\ub9ac \uc0c1\uc2e0\uae30\ub9c8\uc744\uc744 \ub4e4\uba38\ub9ac\ub85c \uc120\ub2ec\uc0b0 \ubd81\uc11c\ub2a5\uc120     \ubd09 \uc0ac\uc774 \uc548\ubd80\ub85c \uc62c\ub77c\uc11c\uac70\ub098 \ub2a6\uc740\ubaa9\uc774\uc744 \uac70\uccd0 \uc624\ub978\ub2e4  \uc601\uc6d4 \ucabd\uc740 \ub0b4\ub9ac \uc9c0\ub3d9\ub9c8\uc744\uc5d0\uc11c\ubd80\ud130 \ub0b4\ub9ac\ucc9c\uc744 \ub530\ub77c \ub2aa\ub2e4\ub9ac\uc5d0 \uc774\ub974\ub7ec \uce60\uc6a9\ub3d9\uacc4\uace1\uc744 \ud1b5\ud574 \uc624\ub978\ub2e4  \uc774 \uc911 \uc624\uc804\uc57d\uc218\uac00 \uc788\ub294 \ubd09\ud654 \ucabd\uc73c\ub85c\uc758 \uc811\uadfc\uc774 \uac00\uc7a5 \uc218\uc6d4\ud558\ub2e4 "
