    "Description": "          \uc785\uc554\uba74 \uc2e0\uc0ac \ub9ac \uc0c8\uace8  \uc774\ub77c\ub294 \ub9c8\uc744 \ub4b7\uc0b0\uc73c\ub85c \uc0b0\uc758 \uc11c\ucabd\uacfc \ub0a8\ucabd\uc740 \uacbd\uc0ac\uac00 \uc644\ub9cc\ud558\ub098 \uc232\uae38\uc758 \ub3d9\ucabd\uacfc \ubd81\ub3d9\ucabd \uc0ac\uba74\uc740 \uc808\ubcbd\uc73c\ub85c \ub458\ub7ec \uc2f8\uc5ec \uc788 \ucd5c\uace0\uc9c0\uc778 \ubd80\uc6a9\ubd09\uc758 \ub192\uc774\ub294     \ub85c \ub0ae\uc9c0\ub9cc \uc804\ub9dd\uc740 \uac00\uc2b4\uc774 \ud2b8\uc77c \ub9cc\ud07c \uc2dc\uc6d0\ud558\uace0  \uc120\ubc14\uc704 \ubc14\ub85c \uc544\ub798\ub294 \uc815\uc2e0\uc774 \uc544\ucc14 \ud560 \uc815\ub3c4\uc758 \uc808\ubcbd\uc774\ub2e4                    \uc870\uc120 \uc911\uc885\ub54c \uc11d\ubc31\uc9c0\uc758 \uc9c0\ub8e1\uc758 \uc18c\uc0dd\uc778 \uc544\ub8e1\uacfc \uc790\ub8e1 \ud615\uc81c\uac00 \uc5ed\ubaa8\ub97c \uaf80\ud558\uace0 \ubc18\ub780\uc744 \uc77c\uc73c\ud0a4\uc790 \ub0a8\uc774\uc7a5\uad70\uc774 \uc774 \ub450\ud615\uc81c\ub97c \uacf5\uc911\uc5d0\uc11c \ubaa9\uc744 \uc790\ub974\uace0 \ub0b4\ub824\uc624\ub294\uae38\uc5d0 \uc11d\ubcbd\uc5d0 \uac80\uc744 \ud718\ub458\ub7ec \uc790\uae30\uc758 \ucd08\uc0c1\ud654\ub97c \uc138\uae30\uace0 \ub2e4\uc2dc \ubc18\ub780\uc774 \uc77c\uc5b4\ub0a0\uac83 \uac19\uc544\uc11c \ud070\uce7c\ub85c \uc0b0\ub9e5\uc744 \uc798\ub77c \ubb3c\uae38\uc744 \ub3cc\ub838\ub2e4\uace0 \ud558\ub294\ub370 \uadf8\ub54c \uc9e4\ub824\uc9c4 \ubc14\uc704\uac00 \uc120\ubc14\uc704\uc774\uace0 \uc774 \ubc14\uc704\uac00 \uc5ec\uae30\uc788\uc5b4 \uc774\uacf3 \uc0ac\ub78c\ub4e4\uc740 \uc120\ubc14\uc704\uc0b0\uc774\ub77c\uace0 \ud55c\ub2e4 "
