    "Description": "              \ub0a8\ucc9c\uba74\uc758 \uc8fc\uc0b0\uc774\uc790 \uacbd\uc0b0\uc758 \uc9c4\uc0b0                           \uacbd\uc0b0\uc2dc \ub0a8\ucc9c\uba74\uacfc \uccad\ub3c4\uad70 \ub9e4\uc804\uba74\uc744 \uac00\ub974\ub294 \uc120\uc758\uc0b0\uc740 \ub0a8\ucc9c\uba74\uc758 \uc8fc\uc0b0\uc73c\ub85c \uc30d\uacc4\uc0b0\uc774\ub77c\uace0\ub3c4 \ud558\uba70  \uc120\ub140\uac00 \ud558\uac15\ud558\uc5ec \ucda4\uc744 \ucd94\ub294 \ud615\uc0c1 \uc774\ub77c \ud558\uc5ec \uc120\uc758\uc0b0     \uc774\ub77c \uc774\ub984 \ud558\uc600\ub2e4  \uadf8\ub7ec\ub098     \uac00  \ucda4\ucd94\ub294 \uc120\ub140 \uc640 \ubb34\uc2a8 \uc5f0\uad00\uc774 \uc788\ub294\uc9c0\ub294 \ub3c4\ubb34\uc9c0 \uc54c \uc218 \uc5c6\ub2e4  \uc815\uc0c1\uc11d\uc758  \ud48d\uc218\uc9c0\ub9ac\uc124\uc5d0 \uc758\ud558\uba74 \uc774\uacf3\uc758 \uc815\uae30\ub97c \ubc1b\uc73c\uba74  \uc815\uc2b9\uc774 \ud0dc\uc5b4\ub09c\ub2e4\ub294 \uc124\ud654\uac00 \uc788\uace0 \uc0b0 \uc815\uc0c1\uc5d0\ub294 \uc6a9\uc815    \uc774\ub77c\ub294 \uc0d8\uc774 \uc788\uc5b4 \uac00\ubb44\uc774 \uc2ec\ud560 \ub54c\ub294 \uc774\uacf3\uc5d0\uc11c \uae30\uc6b0\uc81c\ub97c \uc62c\ub9ac\uae30\ub3c4 \ud588\ub2e4 \uace0 \uc804\ud558\ub294\ub370  \uc774\ub97c \ud655\uc778\ud560 \uae38\uc740 \uc5c6\ub2e4              \uc774\ubc16\uc5d0 \uc815\uc0c1\uc11d\uc5d0\ub294  \uc1e0\ub9d0\ub69d \ubf51\uc740 \uacf3 \uc774\ub77c\ub294 \ud45c\uc2dd\uc774 \uc788\ub294\ub370     \ub144\uc5d0 \uc1e0\ub9d0\ub69d\uc744 \ubf51\uace0  \uc77c\uc81c\ub9cc\ud589 \uc774\ub77c\uace0 \uc801\uc5b4\ub193\uc558\ub2e4  \uc9c0\ub09c\ud574 \uc804\ub9dd\ub370\ud06c\ub97c \uae50 \uc815\uc0c1\uc5d0\uc11c\ub294 \ube44\uc2ac\uc9c0\ub9e5\uc774 \ub0a8\ucabd\uc73c\ub85c \uc774\uc5b4\uc9c0\ub294\ub370  \ud0ac\ub85c\ubbf8\ud130 \uac70\ub9ac\uc758 \uc6a9\uac01\uc0b0                      \uc774 \uc6b0\ub69d \uc19f\uc544\uc788\ub2e4  \ub0a8\uc11c\ucabd\uc73c\ub85c\ub294 \uccad\ub3c4 \ub0a8\uc0b0 \ub4f1 \uccad\ub3c4\uad70 \uc77c\ub300\uac00 \uc5b4\ub834\ud48b\uc774 \ubcf4\uc778\ub2e4  \ucd5c\uadfc\uc5d0\ub294 \uc120\uc758\uc0b0\uacfc \uc6a9\uac01\uc0b0\uc744 \uc787\ub294 \uc885\uc8fc\uc0b0\ud589\uc774 \uc778\uae30\uc778\ub370 \uacbd\uc0b0\uacfc \uccad\ub3c4\ucabd \ub4e4\uba38\ub9ac\ub97c \ud569\uccd0 \ub300\ub7b5   \uad70\ub370\uc5d0\uc11c \uc811\uadfc\ud560 \uc218 \uc788\ub2e4  \uadf8 \uc911 \uc6d0\uc810\ud68c\uadc0\uac00 \uac00\ub2a5\ud558\uace0 \ub4f1\uc0b0\ub85c \uc815\ube44\uac00 \uac00\uc7a5 \uc798 \ub418\uc5b4 \uc788\ub294 \uacf3\uc774 \uacbd\uc0b0 \ub0a8\ucc9c\uba74\uc758 \uc1a1\ubc31 \ub9ac\uc758 \ub3c4\uc131\uc0ac \uae30\uc810\uc73c\ub85c  \uac00\uc7a5 \ub9ce\uc774 \ucc3e\ub294 \ucf54\uc2a4\ub85c \uaf3d\ud78c\ub2e4 "
