    "Description": "    \uae08\uac15\uc0b0\ubcf4\ub2e4 \uba87 \uc218 \uc704\uc778 \ud55c\uad6d\uc758 \uc54c\ud504\uc2a4        \ud55c\ub9c8\ub514\ub85c \ud55c\uad6d\uc758 \uc54c\ud504\uc2a4\ub2e4  \ud754\ud788 \uae08\uac15\uc0b0\uc5d0 \ube44\uc720\ud558\uc9c0\ub9cc \ub192\uc774\ub3c4   \ubbf8\ud130\ub098 \ub0ae\uace0 \ub3d9\uc11c\ub85c \uae34 \ub2a5\uc120\uc774 \uc5c6\uc5b4 \uc0b0\uc5ed\uc740 \ud6e8\uc52c \uc881\ub2e4  \uadf8\ub7fc\uc5d0\ub3c4 \uae08\uac15\uc0b0\uc774 \uc608\ub85c\ubd80\ud130 \ub354 \uc720\uba85\ud588\ub358 \uc774\uc720\ub294 \uad50\ud1b5\uc774 \ud3b8\ub9ac\ud55c \ub370\ub2e4 \uc9da\uc2e0 \uc2e0\uace0\ub3c4 \ubabb \uc62c\ub77c\uac08 \ub370\uac00 \uac70\uc758 \uc5c6\uc744 \ub9cc\ud07c \uc0b0\uc774 \uc21c\ud558\uae30 \ub54c\ubb38\uc774\ub2e4  \uc54c\ud53c\ub2c8\uc998\uc758 \uad00\uc810\uc5d0\uc11c\ub294 \ub354\uc6b1  \uc124\uc545\uc0b0\uc774 \uae08\uac15\uc0b0\ubcf4\ub2e4 \uba87 \uc218 \uc704\ub2e4      \ub192\uc774\ub85c\ub294 \ud55c\ub77c\uc0b0\uacfc \uc9c0\ub9ac\uc0b0 \ub2e4\uc74c\uc774\ub098 \ube7c\uc5b4\ub0a8\uc73c\ub85c\ub294 \ubd84\uba85 \ub0a8\ud55c\uc758 \uc73c\ub738\uc0b0\uc774\ub2e4  \ubc31\ub450\ub300\uac04\uc778 \uacf5\ub8e1\ub2a5\uc120\uc744 \uacbd\uacc4\ub85c \uc11c\ucabd\uc744 \ub0b4\uc124\uc545  \ub3d9\ucabd\uc744 \uc678\uc124\uc545\uc73c\ub85c \ub098\ub204\ub294 \uac83\uc774 \uc77c\ubc18\uc801\uc774\uba70 \uc624\uc0c9\ucabd\uc744 \ub530\ub85c \ub0a8\uc124\uc545\uc73c\ub85c \ubd80\ub974\uae30\ub3c4 \ud55c\ub2e4  \ub0b4\uc124\uc545\uc5d0\ub294 \ubc31\ub2f4\uacc4\uace1  \uc218\ub834\ub3d9  \uac00\uc57c\ub3d9  \ud0d5\uc218\ub3d9   \uc120\ub140\ud0d5\uacc4\uace1  \ub4f1\uc758 \uc544\ub984\ub2e4\uc6b4 \uacc4\uace1\uc774 \uc788\uace0 \uc678\uc124\uc545\uc5d0\ub294 \uacc4\ub958\ubbf8 \ub6f0\uc5b4\ub09c \ucc9c\ubd88\ub3d9\uacc4\uace1\uacfc \ud611\uace1\uc744 \uc774\ub8ec \uac00\uc9c0\uacc4\uace1\ub4e4  \uc6b8\uc0b0\ubc14\uc704  \ubd09\ud654\ub300  \uc7a5\uad70\ubd09  \ubc94\ubd09 \ub4f1 \uae30\uace8\uc2a4\ub7f0 \uc554\ubd09\uacfc \uae30\uc554\uc808\ubcbd\uc744 \uc790\ub791\ud55c\ub2e4      \ub208\uc774 \ub9ce\uc740 \uae4c\ub2ed\uc5d0 \uc124\uc0b0\uc774\ub098 \uc124\ubd09\uc0b0  \ud55c\uacc4\uc0b0\uc73c\ub85c\ub3c4 \ubd88\ub838\ub2e4  \ub3d9\uad6d\uc5ec\uc9c0\uc2b9\ub78c\uc5d0\ub294   \ud55c\uac00\uc704\uc5d0 \ub0b4\ub9ac\uae30 \uc2dc\uc791\ud55c \ub208\uc774 \ud558\uc9c0\uc5d0 \uc774\ub974\ub7ec \uc0ac\ub77c\uc9c0\uae30 \ub54c\ubb38\uc5d0 \uc124\uc545\uc774\ub77c \ud55c\ub2e4  \ub294 \uae30\ub85d\ub3c4 \uc788\ub2e4  \uc9c0\uae08\ub3c4 \uc624\uc6d4\uae4c\uc9c0\ub294 \uace8\uc9dc\uae30\uc5d0 \uc794\uc124\uc774 \ub0a8\uc544\uc788\ub2e4 "
