    "Description": "          \ud574\ubc1c     \uc758 \ube44\uad50\uc801 \ub0ae\uc740 \uc0b0\uc73c\ub85c \uc0ac\uc120\ub300\uc640 \uc5f0\uc811\ud558\uace0 \uc788\uc5b4 \uc0ac\uc120\ub300\ub97c \ub0b4\ub824\ub2e4\ubcf4\ub294 \uc0b0\ucc45\ucf54\uc2a4\uc640 \uc131\ubbf8\uc0b0\uc73c\ub85c \uc774\uc5b4\uc9c0\ub294 \ub4f1\uc0b0\ucf54\uc2a4\uac00 \ub9cc\ub098 \ub4f1\uc0b0\ub85c\ub97c \uc774\ub8ec\ub2e4  \uad00\ucd0c\uba74 \ub355\ucc9c\ub9ac \uc88c\uc0b0\uad50\uc5d0\uc11c \uc815\uc0c1\ubd80\ub85c \uc774\uc5b4\uc9c0\ub294 \ub4f1\uc0b0\ub85c\ub294 \uc815\ube44\uac00 \uc798\ub41c \ud3b8\uc774\ub098 \uc131\ubbf8\uc0b0\uc131\uc5d0\uc11c \uc0ac\uc120\ub300\ub85c \uc774\uc5b4\uc9c0\ub294 \ucf54\uc2a4\ub294 \ud604\uc7ac \ubb38\ud68c\uc7ac\ubc1c\uad74\uc791\uc5c5 \ubc0f \uace0\uc18d\ub3c4\ub85c \uacf5\uc0ac\ub85c \uc778\ud558\uc5ec \ub4f1\uc0b0\ub85c\uac00 \ub69c\ub837\ud558\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \uc0ac\uc120\ub300\ub97c \ub0b4\ub824\ub2e4 \ubcf4\ub294 \uc0b0\ucc45\ucf54\uc2a4\uc640 \uc218\uc6d4\uc0ac\ub97c \ud1b5\ud574 \uc0b0\uc131 \uc815\uc0c1\ubd80 \uc73c\ub85c \uac01\uac01 \uc62c\ub77c\uac00\ub294 \uac83\uc774 \uc88b\ub2e4             \ud2b9\ubcc4\ud788 \uc804\ud574\uc9c0\ub294 \uc720\ub798\ub098 \uc804\uc124\uc740 \uc5c6\uc73c\ub098 \uc804\ubd81 \uc784\uc2e4\uad70 \uad00\ucd0c\uba74 \ubc29\uc218\ub9ac\uc5d0\uc11c \uc804\ud574\uc9c0\ub294 \ubc29\ubbf8\ucd94\uc6d4  \uc57d\uc554\uc5b4\ud654 \ub4f1\uc73c\ub85c \uba85\uba85\ub418\ub294 \ubc29\uc218\ud314\uacbd \uc911 \uc81c \uacbd\uc778  \uc131\uc0b0\ub9cc\ud558\uc5d0 \uc131\ubbf8\uc0b0\uc774 \uac70\ub860\ub41c\ub2e4  \uc774\uac83\uc740 \uc131\ubbf8\uc0b0\uc5d0\uc11c \ub2a6\uac8c\uae4c\uc9c0 \uac77\ud788\uc9c0 \uc54a\uace0 \uc0b0\uc744 \uac10\ub3c4\ub294 \uc548\uac1c\uc758 \uc544\ub984\ub2e4\uc6c0\uc744 \uc774\uc57c\uae30\ud55c\ub2e4 "
