    "Description": "\uc2dc\ub8e8\ubd09\uc740 \ubd09\uc758 \uc0dd\uae40\uc0c8\uac00 \ud070 \ub5a1\uc2dc\ub8e8\ucc98\ub7fc \uc0dd\uaca8 \uc2dc\ub8e8\ubd09\uc774\ub77c \ud558\uace0  \ub610 \ub9c8\uc744\uacfc \ub530\ub85c \ub5a8\uc5b4\uc838 \uc788\uc5b4 \ub534\ubd09\uc774\ub77c\uace0\ub3c4 \ud55c\ub2e4       \uc774 \ubd09\uc740 \uac15\ub989\uc758  \uc8fc\uc0b0 \uac00\uc6b4\ub370 \ud558\ub098\uace0  \uacbd\ud3ec\uc758  \uc8fc\uc0b0 \uac00\uc6b4\ub370 \ud558\ub098\ub2e4       \uc774 \uacf3\uc740 \uacbd\ud3ec  \uacbd \uac00\uc6b4\ub370 \ud558\ub098\uc778 \uc911\ubd09\ub099\uc870\uc5d0 \ud574\ub2f9\ub41c\ub2e4       \uc2dc\ub8e8\ubd09\uc740 \uc131\uc0b0\uba74 \ubcf4\ud604\uc0ac \ub4a4\uc5d0 \uc788\ub294 \uace4\uc2e0\ubd09\uc5d0\uc11c \ub0b4\ub824\uc628 \uc0b0\uc904\uae30\uc758 \ud558\ub098\ub85c \ubd09 \ubc11\uc5d0 \ub124 \ucabc\uc790\ub9ac \uc5ec\ub35f\uac00\ub77d\uc5d0 \uba85\ub2f9\uc790\ub9ac\uac00 \ub9ce\uc774 \uc788\uc5b4      \uc608\ubd80\ud130 \uc774 \uacf3\uc5d0 \ubb18\ub97c \ub9ce\uc774 \uc37c\ub2e4       \uac15\ub3d9\uba74 \uc0c1\uc2dc\ub3d9\ub9ac\uc5d0 \uc0b4\ub358 \ucca8\ud310\uc744 \uc9c0\ub0b8 \uc0ac\ub78c\uc758 \ubb18\ub3c4 \uc774 \uacf3\uc5d0 \uc788\ub2e4       \uc791\uc740\ub5a1\uc2dc\ub8e8\ub294 \ucabc\uc790\ub9ac \uc190\uc7a1\uc774 \uac00  \uac1c \uc774\ub098 \ud070 \ub5a1\uc2dc\ub8e8\ub294 \uc190\uc7a1\uc774\uac00  \uac1c\uc774\ub2e4       \uc774 \uc0b0\ub3c4 \uc190\uc7a1\uc774\uc5d0 \ud574\ub2f9\ub418\ub294 \uc904\uae30\uac00  \uac1c\uac00 \uc788\uc5b4 \uadf8 \ub124 \uc904\uae30\uac00 \uc0ac\ubc29\uc73c\ub85c \ubed7\uc5b4\ub0b4\ub824 \ub9c8\uc744\uc744 \uc774\ub8e8\uace0 \uc788\ub2e4 "
