    "Description": "              \ucc9c\ub144\uace0\ucc30 \uc218\ud0c0\uc0ac \uc790\ub9ac\ud55c \ube44\uacbd\uc9c0                           \uac15\uc6d0\ub3c4 \ud64d\ucc9c\uad70 \ub3d9\uba74\uacfc \ud654\ucd0c\uba74\uc5d0 \uacbd\uacc4\uc5d0 \uc788\ub294 \uc57d\uc218\ubd09\uc740 \ud55c\uac15\uae30\ub9e5 \ud0dc\uae30\uc0b0 \ubc29\uba74\uc5d0\uc11c \uac08\ub77c\uc838 \ub098\uc628 \ub9e5\uc774 \ud64d\ucc9c\uc758 \uba85\uc0b0 \uacf5\uc791\uc0b0\uc744 \uc77c\uad6c\uace0   \ud0ac\ub85c\ubbf8\ud130 \uc11c\ucabd\uc73c\ub85c \ub354 \ubed7\uc5b4 \ud64d\ucc9c\uac15\uacfc \ub355\uce58\ucc9c \ud569\uc218\uc810\uc778 \ub2f9\ubfcc\ub9ac\uc5d0\uc11c \uadf8 \uae30\uc6b4\uc744 \ub9c8\ubb34\ub9ac\ud558\ub294 \uc0b0\uc774\ub2e4  \uc57d\uc218\ubd09\uc740 \uc218\ud0c0\uc0ac\ub97c \ube7c\uace0\uc120 \uc0dd\uac01\ud560 \uc218 \uc5c6\ub2e4  \uc2e0\ub77c \uc6d0\ud6a8\ub300\uc0ac\uac00 \ucc3d\uac74\ud55c \uace0\ucc30\ub85c\uc11c \uc77c\uc6d4\uc0ac\ub77c \ubd80\ub974\ub2e4\uac00  \uc138\uc870 \ub144      \uc5d0 \uc9c0\uae08\uc758 \uc790\ub9ac\ub85c \uc62e\uae30\uba74\uc11c  \uc606\uc5d0 \ud070 \ub0c7\ubb3c\uc774 \ud750\ub978\ub2e4 \ud558\uc5ec \uc218\ud0c0\uc0ac\ub77c \ud588\ub2e4      \ub144 \uc218\uc591\ub300\uad70 \uc138\uc870 \uc740 \uc5b4\uba38\ub2c8 \uc18c\ud5cc\uc655\ud6c4\uac00 \uc8fd\uc790 \uba85\ubcf5\uc744 \ube4c\uae30 \uc704\ud574 \uc11d\uac00\uc758 \uc77c\ub300\ub97c \ud55c\uae00\ub85c \ubc88\uc5ed\ud55c \uc11d\ubcf4\uc0c1\uc808\uc744 \ud3b4\ub0c8\ub2e4  \uc774\ub4ec\ud574 \uc544\ubc84\uc9c0\uc778 \uc138\uc885\uc740 \uc5ec\uae30\uc5d0 \ub178\ub798\uac00\uc0ac\ub97c \ubd99\uc5ec \uc6d4\uc778\ucc9c\uac15\uc9c0\uace1\uc744 \uc9c0\uc5c8\ub2e4  \uc138\uc870\ub294  \uc6d4\uc778 \ucc9c\uac15\uc9c0\uace1\uacfc  \uc11d\ubcf4 \uc0c1\uc808 \ud1b5\ud569\ubcf8\uc744 \ud3b8\ucc2c\ud558\uace0  \uc55e \ub450 \uae00\uc790\ub97c \ub530  \uc6d4\uc778\uc11d\ubcf4 \ub77c \ud588\ub2e4              \uc218\ud0c0\uc0ac\ub294 \uc0ac\ucc9c\uc655\uc0c1 \ubc30 \ubd80\uc704\uc5d0\uc11c \uc774 \uc6d4\uc778\uc11d\ubcf4 \ub450 \uad8c\uc774 \ubc1c\uacac\ub428\uc73c\ub85c\uc368 \ub354\uc6b1 \uc720\uba85\ud574\uc9c4 \uace0\ucc30\uc774\ub2e4  \uc57d\uc218\ubd09\uc740 \uacf5\uc791\uc0b0\uc5d0 \uc18d\ud55c \uc0b0\uc774\ub2e4  \uadf8\ub798\uc11c \uacf5\uc791\uc0b0\uacfc \uc5f0\uacc4\ud55c \uc885\uc8fc\uc0b0\ud589\uc744 \ub9ce\uc774 \ud558\uc9c0\ub9cc  \uadf8\ub807\uac8c \ud574\uc11c\ub294 \uc57d\uc218\ubd09\uc758 \uc9c4\uba74\ubaa9\uc744 \ubcfc \uc218 \uc5c6\ub2e4  \uc57d\uc218\ubd09\uc740 \uc57d\uc218\ubd09 \uc0b0\ud589\ub9cc\uc744 \uacc4\ud68d\ud558\ub294 \uac83\uc774 \ubc14\ub78c\uc9c1\ud558\ub2e4  \uc0b0\uc740 \ub192\uc9c0 \uc54a\uc544\ub3c4 \uae4a\uc740 \uc0b0\uc5d0 \uc628 \ub9db\uc744 \ub290\ub084 \uc218 \uc788\ub294 \uacf3\uc774\ub2e4  \uc0b0 \uc774\ub984\uc758 \uc720\ub798\uac00 \ub41c \ub3d9\uad74\uc57d\uc218\uc640 \uace0\ucc30 \uc218\ud0c0\uc0ac  \uc218\ud0c0\uacc4\uace1  \uadf8\ub9ac\uace0 \uc218\ud0c0\uc0ac\ub97c \uac10\uc2f8\uace0 \ud750\ub974\ub358 \uc0ac\ud589\ucc9c\uc758 \ubb3c\uae38\uc774 \ubc14\ub00c\uba74\uc11c \uc790\uc5f0\uc2a4\ub808 \uc0dd\uae34 \uc2b5\uc9c0\uc5d0 \ucd5c\uadfc \uc870\uc131\ud55c \uc0dd\ud0dc\uacf5\uc6d0\ub3c4 \ud568\uaed8 \ub458\ub7ec\ubcfc\ub9cc \ud558\ub2e4 "
