    "Description": "              \uc18c\uae08\ub2e8\uc9c0 \uc774\uace0 \uc788\ub294 \ubd09\uc6b0\ub9ac                           \uacbd\uc0c1\ub0a8\ub3c4 \uc591\uc0b0\uc2dc \uc0c1\ubd81\uba74 \ub0b4\uc11d\ub9ac\uc640 \uc6d0\ub3d9\uba74 \ub300\ub9ac \uc0ac\uc774\uc5d0 \uc788\ub294 \uc0b0\uc774\ub2e4  \uc5fc\uc218\ubd09\uc774\ub77c\ub294 \uc774\ub984\uc740 \uacfc\uac70\uc5d0 \uc0b0\ubd88\uc608\ubc29\uc744 \uc704\ud574 \uc8fc\ubbfc\ub4e4\uc774 \uc18c\uae08\ub2e8\uc9c0\ub97c \uc0b0 \uc815\uc0c1\uc5d0 \ubb3b\uc5c8\ub2e4\uace0 \ud558\uc5ec \ubd99\uc5ec\uc9c4 \uc774\ub984\uc774\ub77c\uace0 \uc804\ud55c\ub2e4  \ub2e4\ub978 \uc124\ub85c\ub294 \ubc14\ub2f7\ubb3c\uc774 \uc0b0\uae4c\uc9c0 \uc62c\ub77c\uc628 \uc801\uc774 \uc788\uc5b4 \ubd99\uc778 \uc774\ub984\uc774\ub77c\uace0\ub3c4 \ud55c\ub2e4  \uc601\ub0a8\uc758 \uc0b0 \uafbc\uc774\ub77c\uba74 \uc591\uc0b0 \uc5fc\uc218\ubd09\uc744 \ud55c \ubc88\ucbe4 \ub4e4\uc5b4\ubd24\uc744 \ubc95\ud558\uc9c0\ub9cc \uc5fc\uc218\ubd09\uc744 \ub530\ub85c \ub0b4\uc138\uc6cc \ub9d0\ud558\ub294 \uacbd\uc6b0\ub294 \ub4dc\ubb3c\ub2e4  \ub300\uac1c \uc885\uc8fc\uae38\uc5d0 \uac70\uccd0 \uc9c0\ub098\ub294 \uc0b0\uc774\uae30 \ub54c\ubb38\uc774\ub2e4  \uc5fc\uc218\ubd09\uc774 \uc774\ub7f0 \ud640\ub300 \uc544\ub2cc \ud640\ub300\ub97c \ubc1b\ub294 \uac83\uc740 \uc6b0\uc120 \uc9c0\ub9ac\uc801 \uc704\uce58 \ud0d3\uc774\ub2e4  \uc601\ucd95\uc0b0\uc73c\ub85c \uc774\uc5b4\uc9c0\ub294 \uc601\ub0a8\uc54c\ud504\uc2a4 \uc904\uae30\ub294 \uc624\ub8e1\uc0b0\uc744 \uac70\uccd0 \ud1a0\uace1\uc0b0\uc73c\ub85c \ub9c8\ubb34\ub9ac \ub418\ub294\ub370  \uc5fc\uc218\ubd09\uc740 \uadf8 \uc911\uac04\uc5d0 \uc790\ub9ac\ud574 \uc788\ub2e4  \uc9c0\ub098\uac00\ub294 \ubd09\uc6b0\ub9ac\uc5d0 \uba38\ubb3c\ub7ec \uc788\ub294 \uac83\uc774\ub2e4              \uc804\ud615\uc801\uc778 \uc721\uc0b0\uc778 \uc5fc\uc218\ubd09\uc740 \uc0b0\uc138\uac00 \ube7c\uc5b4\ub098\ub2e4\uac70\ub098 \ube44\uacbd\uc774 \uc228\uc5b4 \uc788\uc9c0\ub3c4 \uc54a\ub2e4  \uc8fc\ub2a5\uc120\uc744 \ub530\ub77c \ub098 \uc788\ub294 \uc784\ub3c4 \uc5ed\uc2dc \uc5fc\uc218\ubd09\uc758 \uac00\uce58\ub97c \ub5a8\uc5b4\ub728\ub9ac\ub294 \ub370\uc5d0 \ud55c\ubaab \uac70\ub4e0\ub2e4  \ud558\uc9c0\ub9cc \uc0b0\uc744 \ub2e4\uc2dc \uc0b4\ud3b4\ubcf4\uba74 \uae68\ub057\ud558\uace0 \ud638\uc813\ud55c \uc0b0\uae38\uc774 \uc228\uc5b4 \uc788\ub294 \uc0b0\uc774 \ubc14\ub85c \uc5fc\uc218\ubd09\uc774\ub2e4  \ucc3e\ub294 \uc774\ub4e4\uc758 \ubc1c\uae38\uc774 \ub9ce\uc9c0 \uc54a\uc544 \uae38 \uc0c1\ud0dc\ub3c4 \uc88b\uc740 \ud3b8\uc774\ub2e4  \ub610\ud55c \uc8fc\ubcc0\uc758 \uba85\uc0b0\ub4e4\uc744 \uc870\ub9dd\ud558\ub294 \uc7ac\ubbf8\uac00 \uc3e0\uc3e0\ud558\ub2e4 "
