    "Description": "              \uc12c\uc9c4\uac15 \uad7d\uc5b4\uc624\ub294 \uc790\ub77c\uc758 \ud615\uc0c1                           \uc12c\uc9c4\uac15\uc740 \uc624\uc0b0\uc744 \ub9cc\ub4e4\uc5c8\ub2e4  \uc12c\uc9c4\uac15\uc774 \uac10\uace0 \ub3c4\ub294 \uc624\uc0b0\uc740 \ub9c8\uce58 \uc790\ub77c   \uc624 \uc758 \ud615\uc0c1\uc744 \ud558\uace0 \uc788\ub2e4 \ud574\uc11c \uc790\ub77c\uc0b0\uc774\ub77c\uace0\ub3c4 \ubd88\ub9b0\ub2e4  \uc9c0\ub9ac\uc0b0 \ub178\uace0\ub2e8\uc5d0\uc11c \ub0a8\ucabd\uc73c\ub85c \ubed7\uc740 \uc655\uc2dc\ub9ac\ubd09\ub2a5\uc120\uc774 \uc12c\uc9c4\uac15\uc5d0 \uc7a0\uae30\ub294 \uacf3\uc5d0\uc11c \uc12c\uc9c4\uac15 \ubc14\ub85c \uac74\ub108\uc5d0 \uc788\ub2e4  \ub9c8\uce58 \uc790\ub77c\uac00 \uc12c\uc9c4\uac15 \ubb3c\uc744 \ub9c8\uc2dc\uba70 \uc9c0\ub9ac\uc0b0\uc744 \ud30c\uace0\ub4dc\ub294 \ud615\uad6d\uc774\ub2e4             \uc0b0\uc904\uae30\ub85c \ubcf4\uba74 \uad11\uc591\uc2dc\uc758 \ubc31\uc6b4\uc0b0 \ud615\uc81c\ubd09\uc5d0\uc11c \uc11c\ubd81\uc9c4\ud55c \ub2a5\uc120\uc774 \ub465\uc8fc\ub9ac\ubd09\uc744 \uc9c0\ub098 \uc774\uacf3 \uc624\uc0b0\uc5d0\uc11c \uc12c\uc9c4\uac15\uc73c\ub85c \ub9c8\ubb34\ub9ac\ub418\ub294 \ub05d\uc790\ub77d \uc0b0\uc73c\ub85c       \ubc16\uc5d0 \uc548 \ub41c\ub2e4  \uadf8\ub7ec\uba74\uc11c\ub3c4 \uc5b4\uc5ff\ud55c \uc0b0 \uc774\ub984\uc744 \uc5bb\uace0 \uc790\ub798\ubd09      \uc774\ub77c\ub294 \ubd09\uc6b0\ub9ac\uae4c\uc9c0 \uac70\ub290\ub9ac\uace0 \uc788\ub2e4  \uc758\uc0c1  \uc6d0\ud6a8  \ub3c4\uc120  \uc9c4\uac01 \ub124 \uace0\uc2b9\uc774 \uc218\ub3c4\ud558\uc600\ub2e4\ub294 \uc0ac\uc131\uc554     \uc774 \uc788\uace0 \uc624\uc0b0 \uc8fc\ubcc0\uc5d0\ub294 \uae30\uc774\ud558\uac8c \uc0dd\uae34 \ub3cc\uc774 \ub9ce\uc544 \uc18c\uae08\uac15\uc774\ub77c\uace0\ub3c4 \ud558\uba70 \ubc14\uc704 \uc808\ubcbd\uc5d0 \ub9c8\uc560\uc5ec\ub798\uc785\uc0c1\uc774 \uc870\uac01\ub418\uc5b4 \uc788\ub2e4  \uc0b0\uc2e0\uac01 \uc55e\uacfc \uadf8 \uc624\ub974\ub294 \uae38\uc5d0 \uc788\ub294 \uc2e0\uc120\ub300\uc5d0\uc11c \ubcf4\ub294 \uc0b0\uc904\uae30\uc640 \ubb3c\uc904\uae30\uc758 \uc870\ud654\ub294 \uac00\ud788 \uc77c\ud488\uc774\ub2e4  \ub3d9\ucabd\uc73c\ub85c \uacc4\uc871\uc0b0\uacfc \ub9c8\uc8fc\ud558\uace0 \uc788\ub2e4  \ube68\uce58\uc0b0 \uc5f0\ub300\uc7a5\uae09\uc778 \uc774\uba85\ub798\uac00 \ub9c8\uc9c0\ub9c9 \uc9c0\ud718\ubd80\uc640 \uc740\uc2e0\ucc98\ub85c \uc0ac\uc6a9\ud588\ub358 \uc7a5\uc18c\ub85c   \uc5ec\uba85\uc774 \ub458\ub7ec\uc549\uc744 \uc815\ub3c4\uc758 \uc778\uacf5 \uad74\uc774 \uc788\ub2e4  \ud5db\uad74\uacfc \ubcf8\uad74\ub85c \ub098\ub258\uc5b4 \uc788\uace0 \uc740\ud3d0\uc640 \uc5c4\ud3d0\uac00 \uc798 \ub418\uc5b4 \uc788\uc5b4\uc11c \uc548\ub0b4\uc790 \uc5c6\uc774\ub294 \ubc1c\uacac\ud560 \uc218 \uc5c6\ub294 \uc694\uc0c8\uc640 \uac19\ub2e4 "
