    "Description": "    \ud638\uc218\uc5d0 \ud3ec\uc704\ub41c \ucc9c\ud61c\uc758 \ubc14\uc704 \uc694\uc0c8         \uc6a9\ud654\uc0b0\uc740 \uac15\uc6d0\ub3c4 \ucd98\ucc9c\uc2dc \uc0ac\ubd81\uba74\uacfc \ud654\ucc9c\uad70 \ud558\ub0a8\uba74 \uacbd\uacc4\uc5d0 \uc19f\uc740 \ubc14\uc704\uc0b0\uc774\uc790 \ucd98\ucc9c\uc758 \uc758\uc554\ub310  \uc18c\uc591\ub310  \ucd98\ucc9c\ub310  \ud654\ucc9c\ub310\uc5d0 \ud3ec\uc704\ub41c \ucc9c\ud61c\uc758 \uc131\ubcbd\uc774\ub2e4  \ubcf4\ud1b5 \ub4e4\uba38\ub9ac\ub85c \uc7a1\ub294 \uace0\uc131 \ub9ac \uc591\ud1b5\uace8\ub85c \uc6a9\ud654\uc0b0\uc5d0 \ub4e4\uc5b4\uc11c\uba74 \uac00\uc7a5 \uba3c\uc800 \ubc14\uc704\ubd09\uc6b0\ub9ac\ub4e4\uc774 \ub208\uc5d0 \ub4e4\uc5b4\uc628\ub2e4  \ucd98\ucc9c\uc2dc \ubc29\uba74\uc73c\ub85c\ub294 \uae4e\uc544\uc9c0\ub978 \ubc14\uc704 \uc808\ubcbd\uc744 \uc774\ub8e8\uace0 \uc788\ub294\ub370   \uc0c8\uac00 \ub09c\ub2e4 \ud558\uc5ec \uc774\ub984 \ubd99\uc5ec\uc9c4 \uc0c8\ub0a8\ubc14\uc6b0\ub97c \ube44\ub86f\ud574 \ud558\ub298\ubcbd \ucd1b\ub300\ubc14\uc704  \uce35\uce35\ubc14\uc704  \ub4dd\ub0a8\ubc14\uc704 \ub4f1\uc758 \uae30\uc554\uacfc \ud568\uaed8 \uc6a9\ud654\uc0b0 \uc815\uc0c1\uc5d0\uc11c \uc11c\ucabd\uc73c\ub85c \ud758\ub7ec\ub0b4\ub9ac\ub294 \ub9cc\uc7a5\ubd09 \uc77c\uc6d0\uc758 \uc554\uace8\ubbf8\ub294 \uc6a9\ud654\uc0b0\uc758 \ubc31\ubbf8\ub77c \ud560 \uc218 \uc788\ub2e4  \ud2b9\ud788 \ub178\uc1a1\uad70\ub77d\uc744 \ud488\uace0 \uc788\ub294 \ub9cc\uc7a5\ubd09 \ub108\ub7ed\ubc14\uc704\uc5d0\uc11c \ubc14\ub77c\ubcf4\ub294 \ud558\ub298\ubcbd \ucd1b\ub300\ubc14\uc704\uc758 \uacbd\uce58\uac00 \uc77c\ud488\uc774\ub2e4  \ub9cc\uc7a5\ubd09\uc5d0\ub294     \ub144\ub3c4\uc5d0 \uc554\ubcbd\ub4f1\ubc18 \ucf54\uc2a4\uac00 \uac1c\ucc99\ub418\uc5b4 \uc9c0\uae08\ub3c4 \ub4f1\ubc18\uac00\ub4e4\uc774 \uc885\uc885 \ucc3e\uace0 \uc788\ub2e4          \ub9cc\uc7a5\ubd09\uacfc \uc815\uc0c1 \uc0ac\uc774\uc758 \ubc14\uc704\ub2a5\uc120\uc5d0\uc11c\ub294 \ucd98\ucc9c\uc758 \uc0b0\uad70\uc774 \uc798 \ubcf4\uc774\ub294\ub370  \uc815\uc0c1\uc5d0 \ub2e4\ub2e4\ub97c \uc988\uc74c\uc774\uba74 \ub300\ub8e1\uc0b0        \uacfc \uc0bc\uc545\uc0b0         \uc815\uc0c1\uc774 \ubcf4\uc774\ub294 \uac83\uc740 \ubb3c\ub860 \uc0bc\uc545\uc0b0 \ubd81\uc11c\ucabd\uc73c\ub85c \ubed7\uc740 \ubd81\ubc30\uc0b0  \uac00\ub355\uc0b0  \uc11c\ucabd\uc758 \uc0bf\uac13\ubd09\uacfc \uc751\ubd09\uc774 \ubcf4\uc778\ub2e4  \uc774\ubc16\uc5d0\ub3c4 \uc6a9\ud654\uc0b0\uc5d0\ub294 \uc61b\ub0a0 \ucd98\ucc9c\uc9c0\ubc29\uc5d0 \uc788\ub358 \uace0\ub300\uad6d\uac00 \ub9e5\uad6d    \uc758 \uc131\ubb38\uc5ed\ud560\uc744 \ud558\ub358 \ubc30\ud6c4\ub839  \uc131\ubd88\ub839  \uc0ac\uc57c\ub839  \ud070\uace0\uac1c  \ubaa8\ub798\uc7ac \ub4f1\uc758 \uace0\uac2f\uae38   \uc5ec \uacf3\uc758 \ud754\uc801\uc774 \ub0a8\uc544\uc788\ub2e4 "
