    "Place": "\uacbd\uc0c1\ubd81\ub3c4 \uccad\ub3c4\uad70 \uc6b4\ubb38\uba74, \uacbd\uc0c1\ub0a8\ub3c4 \ubc00\uc591\uc2dc \uc0b0\ub0b4\uba74",
    "Description": "    \uc601\ub0a8\uc54c\ud504\uc2a4 \uc804\ub9dd\uc774 \uc77c\ud488\uc778 \uc6b4\ubb38\uc0ac\uc758 \uc0b0        \uac70\uc6b8\uc5d0 \ube44\uce5c  \uc790\ud615 \uc0b0\uc904\uae30 \uc601\ub0a8\uc54c\ud504\uc2a4\uc758 \uc717\uae08 \uc11c\ucabd\ub05d\uc744 \uc774\ub8e8\ub294 \uc0b0\uc774\ub2e4  \uac70\ub300\ud55c \ubd09\ubd84 \uac19\uc740 \ub2e8\uc21c\ud55c \ubaa8\uc591\uc0c8\uc774\uc9c0\ub9cc \uc5b5\uc0b0\uacfc \uac00\uc9c0\uc0b0\uc758 \uc88c\uc6b0 \uc900\ubd09\uc5d0\uc11c \ubd81\uc73c\ub85c \ubed7\uc5b4\uac04 \uae34 \ub2a5\uc120\ub4e4 \ub355\ubd84\uc5d0 \uc6b4\ubb38\uc0ac \ub4e4\uc5b4\uc549\uc740 \uae4a\uc740 \uace8\uc744 \uac16\ucd94\uc5c8\ub2e4  \uadf8\ub7ec\ub098 \ub0a8\ucabd\uc73c\ub85c\ub294 \uc5ec\uc9c0\uc5c6\ub294 \ud651\uc0b0\uc774\uc5b4\uc11c \ud06c\ub2e8\ud55c \ubc14\uc704\uc0b0\ub369\uc774 \ud55c\ubc14\uc6b0\uc0b0\uc73c\ub85c \ubd88\ub9b0\ub2e4          \uc800\ub294 \ubcfc\ud488\uc774 \ubcc4\ub85c \uc5c6\uc9c0\ub9cc \uc815\uc0c1 \uc804\ub9dd \ud558\ub098\ub294 \uc77c\ud488\uc774\ub2e4  \uac00\uc9c0\uc0b0 \uc0c8\ub07c \ubc31\uc6b4\uc0b0 \ub4a4\ub85c \ud3ec\uc7a5\uc744 \uce5c \ub4ef\ud55c \ub2a5\ub3d9 \uc7ac\uc57d\uc0b0 \uc904\uae30\uc640 \uadf8 \ub108\uba38\ub85c \uc5b4\uae68\ub97c \ub4dc\ub7ec\ub0b8 \uac04\uc6d4\uc0b0\uc758 \uc7a5\uc5c4\ud55c \ubaa8\uc2b5\uc774\ub2e4  \uac00\uc744\uc774\uba74 \uadf8 \ub4f1\uc131\uc774\uc5d0 \uc5b5\uc0c8\uac00 \ubb3c\uacb0\uce5c\ub2e4          \uc0b0\uc774\ub984\uc774 \uc6b4\ubb38\uc0ac\uc5d0\uc11c \ube44\ub86f\ud55c \uc0ac\uc2e4\uc5d0\uc11c \ubcf4\ub4ef \ubcf4\ubb3c \ub9ce\uc740 \uc808 \uc6b4\ubb38\uc0ac\ub97c \uc704\ud574 \uc874\uc7ac\ud558\ub294 \ub290\ub08c\uc774\ub2e4  \uac00\uc9c0\uc0b0 \uc5ed\uc2dc \ub9c8\ucc2c\uac00\uc9c0\uc778 \ubc14 \ud604\uc9c0\uc778\ub4e4\uc740 \uc9c0\uae08 \uac00\uc9c0\uc0b0\uc73c\ub85c \ubd88\ub9ac\ub294 \uac83\uc774 \ubcf8\ub798\ub294 \uc6b4\ubb38\uc0b0\uc774\uc5c8\ub2e4\uace0 \uc8fc\uc7a5\ud55c\ub2e4  \uc6b4\ubb38\uc0ac\uac00 \uc788\ub294 \uc7a5\uad70\ud3c9\uc5d0\uc11c \ubcf4\uc774\ub294 \uac74 \uac00\uc9c0\uc0b0\uc774\ub2c8 \ud5c8\ud22c\ub8e8 \ub3cc\ub9b4 \ub9d0\uc740 \uc544\ub2c8\ub2e4   \uc11d\uac00\uc758 \uc9c0\ud61c \ub77c\ub294 \ub73b\uc758 \uac00\uc9c0\uc0b0      \ub610\ud55c \uc2e0\ub77c\ub9d0 \ub3c4\uc758\uc120\uc0ac\uac00 \uc120\uc885\uc774\ub77c\ub294 \uc2e0 \uad50\uc124    \uc744 \ub4e4\uc5ec\uc624\uba74\uc11c \ubc14\uafbc \uc774\ub984\uc5d0 \ub2e4\ub984\uc544\ub2c8\uc9c0 \uc54a\uc740\uac00 "
