    "Description": "    \uc870\uc885\ud604 \uc9c4\uc0b0\uc774\ub358 \uacbd\uae30\uc758 \uae08\uac15        \uacbd\uae30 \uc545\uc758 \ud558\ub098\uc778 \uc6b4\uc545\uc0b0\uc740 \uc774\ub984\uc5d0 \ub4dc\ub7ec\ub098 \uc788\ub4ef \ubc14\uc704\uac00 \ub9ce\uc740 \uba85\uc0b0\uc774\ub2e4  \uc0b0\ubd09\uacfc \ub2a5\uc120\uc774 \uc815\uc0c1\uc73c\ub85c \uc218\ub834\ud558\ub294 \uc0b0\uc758 \uad6c\ub3c4\ub3c4 \uc88b\uace0 \ubc14\uc704\uc640 \uac00\uc744 \ub2e8\ud48d\uc774 \uc5b4\uc6b0\ub7ec\uc9c4 \ubaa8\uc591\ub3c4 \uc544\ub984\ub2f5\ub2e4  \uadf8\ub798\uc11c  \uacbd\uae30\uc758 \uae08\uac15 \uc73c\ub85c \ubd88\ub9b0\ub2e4  \ub3d9\ucabd \uae30\uc2ad\uc5d0\ub294 \ubcf4\uc870\uad6d\uc0ac \uc9c0\ub20c\uc758 \uc0ac\ub9ac\ud0d1\uc774 \uc788\ub294 \ud604\ub4f1\uc0ac\uac00 \uc790\ub9ac\ud588\ub2e4  \uc11c\ucabd\uc5d0\ub294 \uc218\uc9c1\uc758 \uc18c\uaf2c\ub9ac\ud3ed\ud3ec      \uae38\uc774\uc758 \ubb34\uc9c0\uac1c\ud3ed\ud3ec\uac00 \uc788\uc5b4 \ube59\ubcbd\ub4f1\ubc18\uc744 \uc990\uae30\ub294 \uc0b0\uc545\uc778\ub4e4\uc774 \uc990\uaca8 \ucc3e\ub294\ub2e4          \ud55c\ubd81\uc815\ub9e5\uc758 \ub9c8\uc9c0\ub9c9     \uae09\uc73c\ub85c \uc774 \uc11c\ub0a8\ucabd\uc73c\ub85c\ub294 \uae30\uaecf\ud574\uc57c     \uae09\uc758 \uc8fd\uc5fd\uc0b0  \uacc4\uba85\uc0b0\uc774 \uc788\uc744 \ubfd0\uc774\ub2e4 \uc0b0\uacbd\ud45c\uac00 \uc544\ub2c8\ub77c \ub300\ub3d9\uc5ec\uc9c0\ub3c4\ub97c \ub530\ub97c \uacbd\uc6b0\ub2e4   \uc544\ub798\ucabd \uacbd\uae30\ub3c4\uc5d0\ub3c4 \uc774\ub9cc\ud55c \uc0b0\uc774 \uc5c6\ub2e4  \uc218\uacc4    \ub294 \ub3d9\ucabd\uc774 \uccad\ud3c9 \uc548\uc804\uc720\uc6d0\uc9c0\ub97c \uc774\ub8e8\ub2e4 \ubd81\ud55c\uac15\uc73c\ub85c \ud758\ub7ec\ub4dc\ub294 \uc870\uc885\ucc9c  \uc11c\ucabd\uc740 \ud3ec\ucc9c\ucc9c\uc758 \uc9c0\ub958 \uba85\ub355\ucc9c\uc774\ub2e4  \ub530\ub77c\uc11c \uc870\uc885\ucc9c \uc720\uc5ed  \uc61b\uc774\ub984\uc774 \uc870\uc885\ud604     \uc774\uc5c8\ub358 \uc0c1\uba74\uacfc \ud558\uba74\uc774 \uc55e\ucabd\uc774 \ub418\ub2c8 \uc0b0\uc138 \ub610\ud55c \uccad\ud3c9\uc5d0\uc11c \ud604\ub9ac\ub85c \ub118\uc5b4\uac00\ub294 \uc11c\ub300\uace0\uac1c\uc5d0\uc11c \ubcf4\uc544\uc57c \ub9de\ub2e4  \uc6b4\uc545\uc0b0\uc740 \uc870\uc885\ud604\uc758 \uce58\uc18c    \uc600\ub358 \ud604\ub9ac\uc758 \uc9c4\uc0b0\uc774\uc5c8\ub358 \uac83\uc774\ub2e4 "
