    "Description": "          \uad00\uad11\uac1d\ub4e4\uc774\ub098 \uc2dc\ubbfc\ub4e4\uc774 \uc544\uce68 \uc77c\ucc0d \uc77c\ucd9c\uc744 \ubcf4\uba70 \uc0b0\ucc45\ub85c\ub85c \uc88b\uc544\ud558\ub294 \uacf3\uc774\ub2e4  \uc0bc\uc591 \uc77c\uc8fc\ub3c4\ub85c\uc5d0\uc11c \uc0bc\uc591 \ud654\ub825\ubc1c\uc804\uc18c\uae4c\uc9c0 \ubed7\uccd0 \uc788\uc73c\uba70  \uc88b\uc740 \uacf5\uae30\ub97c \ub9c8\uc2dc\uba70 \uac00\ubccd\uac8c \ub4f1\uc0b0 \ud560 \uc218 \uc788\ub294 \uacf3\uc774\ub2e4                    \uc6d0\ub2f9\ubd09\uc774\ub77c\ub294 \uc720\ub798\ub294 \uc6d0\ub098\ub77c \ub54c \uc774 \uc624\ub984 \uc911\ud131\uc5d0 \uc6d0\ub098\ub77c\uc758 \ub2f9\uc778 \uc6d0\ub2f9    \uc774 \uc788\uc5c8\uc74c\uc5d0 \uc6d0\ub2f9\ubd09 \uc624\ub984   \uc870\uc120\uc2dc\ub300\ub54c \uc6d0\ub2f9\ubd09\uc218\uac00 \uc138\uc6cc\uc9c4 \ub370\uc11c \ub9dd\uc624\ub984  \uc0bc\uc591\ub3d9\uc5d0 \uc704\uce58\ud558\uace0 \uc788\uc74c\uc5d0  \uc0bc\uc591\ubd09   \uac1c\uc758 \ub2a5\uc120\uc5d0  \uac1c\uc758 \ubd09\uc6b0\ub9ac\uac00 \uc774\uc5b4\uc838 \uc788\uc5b4 \uc6d0\ub2f9\uce60\ubd09 \uc77c\uba85 \uc0bc\ucca9\uce60\ubd09 \uc774\ub77c\uace0\ub3c4 \ubd88\ub824\uc9c0\uace0 \uc788\ub2e4 "
