    "Height": 168,
    "Place": "\uacbd\uae30\ub3c4 \ubd80\ucc9c\uc2dc",
    "Description": "          \ubd80\ucc9c\uc758 \uc8fc\uc0b0\uc778 \uc131\uc8fc\uc0b0\uacfc \ud568\uaed8 \ub9ce\uc740 \uc2dc\ubbfc\ub4e4\uc774 \ucc3e\uace0 \uc788\ub294 \uc6d0\ubbf8\uc0b0\uc740 \uba40\ubafc\ub85c \uc640 \uc218\uc8fc\ub85c \uc0ac\uc774\uc5d0 \uc790\ub9ac \uc7a1\uace0 \uc788\ub2e4  \uc811\uadfc\uc131\uc774 \uc88b\uc740 \uc6d0\ubbf8\uc0b0\uc740 \ud574\ubc1c     \uba74\uc801     \uc758 \uc0b0\uc73c\ub85c \uc2dc\ubbfc\ub4e4\uc758 \uc0b0\ucc45\ucf54\uc2a4\ub85c \ub9ce\uc774 \uc774\uc6a9\ub418\uace0 \uc788\ub2e4  \ud604\uc7ac \uc6d0\ubbf8\uc0b0 \ub300\ubd80\ubd84\uc740 \uadfc\ub9b0\uacf5\uc6d0\uc73c\ub85c \uc9c0\uc815\ub418\uc5b4 \uc788\uc73c\uba70 \uc6d0\ubbf8\uacf5\uc6d0  \uc9c4\ub2ec\ub798\ub3d9\uc0b0  \uccb4\uc721\uacf5\uc6d0 \uc0b0\ub9bc\uc695\uc7a5\uc73c\ub85c \uac1c\ubc1c\ud558\uc5ec \ub9ce\uc740 \uc2dc\ubbfc\ub4e4\uc758 \uc774\uc6a9\ud558\uace0 \uc788\ub2e4  \uc0b0\uc774 \ud5d8\ud558\uc9c0 \uc54a\uace0 \uc232\uae38\ub610\ud55c \ub300\ubd80\ubd84\uc774 \uc798 \uc815\ube44\ub418\uc5b4 \uc788\uc5b4 \ub204\uad6c\ub098 \uc27d\uac8c \uc774\uc6a9\ud560 \uc218 \uc788\ub2e4             \uc6d0\ubbf8\uc0b0\uc740 \uba40\ubafc  \ub454\ub300\uc0b0  \ucd98\ub355\uc0b0\uc73c\ub85c \ubd88\ub9ac\uc6b0\uace0 \uc788\ub294 \ubd80\ucc9c\uc758 \uc8fc\uc0b0\uc911\uc758 \ud558\ub098\uc774\ub2e4  \uc6d0\ubbf8\uc0b0\uc774\ub77c \ubd88\ub9ac\uac8c \ub41c \uac83\uc740 \uc61b \ubd80\ud3c9\ubd80 \uad00\uc544\uc758 \ub3d9\ud5cc\uc5d0\uc11c \uc774 \uc0b0\uc744 \ubc14\ub77c\ubcf4\uba74 \uc544\uce68 \ud574\ub3cb\uc774\ub54c\uc758 \uc0b0\uc138\ub294 \uadf8\uc9c0\uc5c6\uc774 \uc120\uc5f0\ud558\uace0 \uc544\ub984\ub2e4\uc6b0\uba70 \ud574\uc9c8\ub158 \ub178\uc744\uc5d0 \ubc18\uc0ac\ub41c \uadf8 \ud478\ub974\ub984\uc740 \ub2e8\uc544\ud558\uae30\uac00 \ube44\uae38\ub370\uac00 \uc5c6\uc5c8\ub2e4\uace0 \ud55c\ub2e4  \uc774\uc5d0 \ub3c4\ud638\ubd80\uc0ac\uac00 \uc0b0\uc758 \uc774\ub984\uc744 \ubb3c\uc5c8\uc73c\ub098 \uc544\ubb34\ub3c4 \ub300\ub2f5\ud558\ub294 \uc0ac\ub78c\uc774 \uc5c6\uc790 \uadf8 \uc989\uc2dc \uc6d0\ubbf8\uc0b0     \uc774\ub77c \uce6d\ud558\uc600\ub2e4 \ub610\ud55c     \ub144\uc5d0 \ub098\uc628        \uc870\uc120\uc9c0\uc9c0\uc790\ub8cc        \uc5d0\ub294 \uba40\ub9ac \ubcf4\uc774\ub294 \uc544\ub984\ub2e4\uc6b4 \uc0b0\uc774 \uc544\ub2c8\uace0  \uba40\ub9ac \ubcf4\uc774\ub294 \ub208\uc379 \uac19\uc740 \uc0b0\uc774\ub780 \ub73b\uc73c\ub85c \uc6d0\ubbf8\uc0b0     \uc774\ub77c \ud45c\uae30\ub418\uc5b4 \uc788\ub2e4  \uc6d0\ubbf8\uc0b0\ubcf4\ub2e4 \ub354 \uba3c\uc800 \uae30\ub85d\uc5d0 \ub098\uc624\ub294 \ub610\ub2e4\ub978 \uc774\ub984\uc740 \ub454\ub300\uc0b0     \uc73c\ub85c \uad70\uc0ac\uac00 \uc8fc\ub454\ud588\ub2e4\ub294 \ub73b\uc774\ub2e4  \uc8fd\uc0b0\ubc15\uc528 \ub300\ub3d9\ubcf4   \uc9c4\ubbf8\ub85d  \uc784\uc9c4\uc65c\ub780 \uc758\ubcd1\uc7a5 \ubc15\uc9c4    \uc740 \ub454\ub300\uc0b0\uc5d0 \uc9c4\uc744 \uce58\uace0 \uc65c\uad70\uacfc \ub9de\uc11c \uc2f8\uc6e0\ub2e4\uace0 \ud55c\ub2e4 "
