    "Height": 811,
    "Place": "\uc804\ub77c\ub0a8\ub3c4 \uc601\uc554\uad70 \uc601\uc554\uc74d\u318d\uad70\uc11c\uba74\u318d\ud559\uc0b0\uba74, \uac15\uc9c4\uad70 \uc131\uc804\uba74",
    "Description": "    \ub3cc\ubd88\uaf43\ucc98\ub7fc \uce58\uc19f\uc544\uc624\ub978 \ub0a8\ub3c4\uc758 \uc11d\ud654\uc131        \ud504\ub791\uc2a4\uc758 \uc138\uacc4\ubb38\ud654\uc720\uc0b0 \ubabd\uc329\ubbf8\uc258                    \uac19\uc740 \uc0b0\uc774\ub2e4  \uc815\uc0c1 \ucc9c\ud669\ubd09\ub9cc \ub5bc\uc5b4 \ubcf4\uba74 \ud53c\ub77c\ubc0b \uac19\uae30\ub3c4 \ud558\ub2e4  \ucc9c\ud669\uc0ac\ucabd \ud3c9\uade0\uacbd\uc0ac   \ub3c4  \uc774\ub545\uc5d0\uc11c \uc774\ubcf4\ub2e4 \uac00\ud30c\ub978 \uc0b0\uc740 \uc5c6\ub2e4         \ucc9c\ud669\ubd09\uc740 \ubb3c\ub860\uc774\uace0 \ud5a5\ub85c\ubd09  \uc591\uc790\ubd09  \uc2dc\ub8e8\ubd09  \ubb38\ud544\ubd09 \uc6d4\uac01\uc0b0  \ub4f1 \uc8fc\uc694 \ubd09\uc6b0\ub9ac\ub4e4\uc774 \ubaa8\ub450 \ub3cc\ub85c \ub418\uc5c8\uace0 \ubd88\uaf43\ucc98\ub7fc \ud558\ub298\ub85c \uce58\uc19f\uc544\uc624\ub974\uace0 \uc788\ub2e4  \ub098\ubb34\ub294 \ubcf4\uc774\uc9c0 \uc54a\uace0 \uc0b0\uc8fd\uc774\ub098 \ub364\ubd88\uc774 \uba3c\uc9c0\ucc98\ub7fc \uc5b9\ud600 \ud76c\ubbf8\ud55c \ud478\ub978\uae30\ub97c \ub760\uace0\uc788\uc744 \ubfd0\uc774\ub2e4  \ud48d\uc218\uc5d0\uc11c \ub9d0\ud558\ub294 \uc774\ub978\ubc14 \uc11d\ud654\uc131       \uc815\uc0c1\ubd80\uac00 \ub3cc\ub85c \ub41c \uac83\uc744 \ub118\uc5b4 \uc608\ub9ac\ud568\uc758 \uc0c1\uc9d5 \ud654\uc131\uae4c\uc9c0 \ub760\uc5c8\ub2e4          \ub098\ubb34\ubcf4\ub2e4 \ub9ce\uace0 \ubcc4\ubcf4\ub2e4\ub3c4 \ub9ce\uc740 \ubc14\uc704\ub294 \uc800\ub9c8\ub2e4 \ubb34\uc5b8\uac00\ub97c \ub2ee\uc558\ub2e4  \uc74c\uad74  \ub0a8\uadfc\ubc14\uc704  \ud1b5\ucc9c\ubb38 \ub4f1 \ub3d9\uc11c\ub85c \uae30\uc554\uc774 \ub298\uc5b4\uc11c \uc788\uc5b4 \ubc14\uc704 \uc804\uc2dc\uc7a5\uc744 \uc774\ub8ec\ub2e4  \ubbf8\uc655\uc7ac \ub4f1\uc131\uc774\uc5d0\ub294 \uc5b5\uc0c8\ubc2d\uc774 \uc774\ucc44\ub86d\uace0 \ubb34\uc704\uc0ac  \ub3c4\uac11\uc0ac  \uc6d4\ub0a8\uc0ac\uc9c0  \uad6c\ub9bc\ub9ac  \uc790\ub77d \uc0ac\ubc29\uc758 \uc990\ube44\ud55c \ubb38\ud654\uc720\uc801\uc740 \ub0a8\ub3c4\ub2f5\uc0ac  \ubc88\uc9c0\ub97c \uc774\ub8ec\ub2e4          \ub3cc\uc0b0 \uc704\uc758 \uc218\ub3c4\uc6d0 \ubabd\uc329\ubbf8\uc258\uc740 \ub178\ub974\ub9dd\ub514\uc640 \ube0c\ub808\ud0c0\ub274\ubc18\ub3c4 \uc0ac\uc774\uc5d0 \ub080 \ub9cc    \uc774\ub984\uc774\uae30\ub3c4 \ud558\ub2e4  \uadf8\ub798 \uc0ac\ub78c\ub4e4\uc740 \ubc00\ubb3c \ub54c\ub294 \ubc30\ub97c \ud0c0\uace0 \uc370\ubb3c\uc5d0\ub294 \uac78\uc5b4\uc11c \uc218\ub3c4\uc6d0\uc73c\ub85c \uac04\ub2e4  \ucc9c\ud669\uc0ac \uc55e \uac1c\uc2e0\ub9ac\ub098 \uc655\uc778\ubc15\uc0ac\uc758 \uace0\ud5a5 \uad6c\ub9bc\ub9ac \uc55e\ub4e4\ub3c4 \uc6d0\ub798\ub294 \uc774\ub7f0 \ubc14\ub2e4\uc600\ub2e4  \uc6d4\ucd9c\uc0b0\uc740  \uc720\ub124\uc2a4\ucf54\uc138\uacc4\ubb38\ud654\uc720\uc0b0\uae09 \uc0b0\uc774\ub2e4 "
