    "Description": "    \ub3d9\ud574\ub97c \ud5a5\ud574 \ube44\uc0c1\uc744 \uafc8\uafb8\ub294 \ub9e4\ubd09     \uac15\uc6d0\ub3c4 \uc0bc\ucc99\uacfc \uacbd\ubd81 \uc6b8\uc9c4\uc758 \uacbd\uacc4\uc5d0 \uc19f\uc740 \uc751\ubd09\uc0b0\uc740 \ube44\uc0c1\ud558\ub294 \ub9e4\uc758 \ud615\uc0c1\uc744 \ud558\uace0\uc788\ub294 \uc900\ubd09\uc774\ub2e4  \uac8c\ub2e4\uac00 \uc6b8\uc9c4\ucabd\uc758 \uc628\uc815\uace8\uacfc \uc0bc\ucc99\ucabd\uc758 \uc6a9\uc18c\uace8\uc774 \ub2e4 \ube44\ubc94\ud574 \ucc3e\ub294 \uc774\ub4e4\uc774 \ub04a\uc774\uc9c0 \uc54a\ub294\ub2e4  \uc628\uc815\uace8\uc740 \ub2ec\ud33d\uc774\uad00\ucc98\ub7fc \ud68c\ud68c\ub3cc\uba70 \ub5a8\uc5b4\uc9c0\ub294 \uc6a9\uc18c\ud3ed\ud3ec\uc640 \uadf8 \uc544\ub798\uc758 \uc6a9\uc18c  \ub355\uad6c\uc628\ucc9c\uc774 \uba85\uc18c\ub2e4  \ub355\uad6c\uc628\ucc9c\uc740 \uc6d0\ub798 \ub208 \ub36e\uc778 \uace8\uc9dc\uae30\uc5d0\uc11c \uc628\ucc9c\uc695\uc744 \ud560 \uc218 \uc788\ub294 \ub178\ucc9c\uc628\ucc9c\uc774\uc5c8\ub294\ub370 \ud64d\uc218\ub85c \uc720\uc2e4\ub41c \uc774\ud6c4 \uad00\uc815    \uc744 \ub6ab\uc5b4 \uc9c0\uae08\uc758 \uc628\ucc9c\ud0c0\uc6b4\uc73c\ub85c \uc7ac\uac1c\ubc1c\ub418\uc5c8\ub2e4      \uc5d0 \uc774\ub974\ub294 \uc6a9\uc18c\uace8 \uad6c\uc808\uc591\uc7a5\uc740 \ud759 \ud55c \uc90c \uc5c6\ub294 \uae34 \ud1b5\ubc14\uc704\uace8\uacfc \uae4a\uc774\ub97c \ud5e4\uc544\ub9b4 \uc218 \uc5c6\ub294 \uc18c  \ud06c\uace0 \uc791\uc740 \ud3ed\ud3ec\ub4e4\uc774 \uc7a5\uad00\uc744 \uc774\ub8ec\ub2e4  \uadf8\ub9cc\ud07c \uae38\uc774 \ud5d8\ud558\uace0 \uc704\ud5d8\ud574   \ub144\ub300\ub9cc \ud574\ub3c4 \uc77c\ubc18\uc778\ub4e4\uc740 \ub4e4\uc5b4\uac00\ubcfc \uc5c4\ub450\ub97c \ub0b4\uc9c0 \ubabb\ud558\ub358 \uacf3\uc774\uc5c8\ub2e4  \uc774\ud6c4 \uc8fc\ubbfc\ub4e4\uc5d0 \uc758\ud574 \uae38\uc774 \ub2e4\ub4ec\uc5b4\uc9c0\uace0 \uacf3\uacf3\uc5d0 \uc548\ub0b4\ud310\uc774 \uc124\uce58\ub418\uba74\uc11c \ub9ce\uc740 \uc0ac\ub78c\ub4e4\uc774 \ucc3e\uac8c \ub418\uc5c8\uc9c0\ub9cc \uc544\uc9c1\ub3c4 \ucd08\ubcf4\uc790\uc5d0\uac8c\ub294 \ubb34\ub9ac\ub2e4 "
