    "Place": "\uacbd\uc0c1\ub0a8\ub3c4 \ubc00\uc591\uc2dc \ub2e8\uc7a5\uba74\u318d\uc0b0\ub0b4\uba74, \uc6b8\uc0b0\uad11\uc5ed\uc2dc \uc6b8\uc8fc\uad70 \uc0c1\ubd81\uba74",
    "Description": "    \ud45c\ucda9\uc0ac \uc5d0\uc6cc\uc2fc \ud0c0\uc6d0\ud615\uc758 \uc5ec\ub35f \ubd09\ub9cc        \uc67c\uc190\uc73c\ub85c \uc4f4  \uc790 \ud615\uad6d \uc601\ub0a8\uc54c\ud504\uc2a4\uc758 \uc810\uc5d0 \ud574\ub2f9\ud558\ub294 \uc0b0\uc774\ub2e4  \uadf8\ub9cc\ud07c \uae4a\uc774 \uc228\uc5b4\uc788\ub294 \uc0b0\uc911 \uc18d\uc758 \uc0b0\uc73c\ub85c \ube59 \ub458\ub7ec \ud0c0\uc6d0\ud615 \ub2a5\uc120\uc774 \uae38\uc9c0\ub97c \ud488\uace0\uc788\ub2e4  \ud45c\ucda9\uc0ac  \uad6d\ubcf4   \ud638 \uccad\ub3d9\ud568\uc740\ud5a5\uc644      \uacfc \ubcf4\ubb3c    \ud638 \uc0bc\uce35\uc11d\ud0d1  \uc0ac\uba85\ub300\uc0ac \uc720\ubb3c    \uc5ec\uc810\uc744 \ubcf4\uad00\ud558\uace0\uc788\ub294 \uc808\uc774\ub2e4          \uc0b0\uc740 \ud761\uc0ac \uc774 \uae38\uc9c0\uc640 \uac70\uae30 \uc788\ub294 \ubcf4\ubb3c\uc744 \uc9c0\ud0a4\uae30 \uc704\ud574 \uc0dd\uaca8\ub09c \ub4ef\ud558\ub2e4  \ud544\ubd09  \uc0c1\ud22c\ubd09  \uc0c1\ubd09 \uc0ac\uc790\ubd09         \uc218\ubbf8\ubd09         \ucf54\ub07c\ub9ac\ubd09        \uc7ac\uc57d\ubd09          \ud5a5\ub85c\uc0b0          \uc30d\ubd09        \uc758 \uc5ec\ub35f \ubd09\ub9cc    \uc774 \uc54c \ud488\uc740 \uc0c8\uc6b0\uc758 \ubaa8\uc591\uc744 \ud558\uace0\uc788\ub294 \uac83\uc774\ub2e4     \ubbf8\ud130 \ub4f1\uace0\uc120\uc744 \uc774\uc5b4\ubcf4\uba74 \uc790\uad81 \uc18d\uc758 \uc544\uc774\ucc98\ub7fc \ubcf4\uc774\uae30\ub3c4 \ud55c\ub2e4  \uc778\uac04\uc744 \uac10\ub3d9\uc2dc\ud0a4\ub294  \uc808\ubb18\ud55c \uc790\uc5f0\uc758 \uc0dd\uae40\uc774\ub2e4             \ub9cc\ud3c9\uc758 \uc5b5\uc0c8\ucd08\uc6d0 \uc0ac\uc790\ud3c9\uc73c\ub85c \uc720\uba85\ud558\ub2e4  \uadf8\ub7ec\ub098 \uac70\uae30 \ubc2d\uc744 \uce58\uace0 \uc5fc\uc18c\ub97c \ud0a4\uc6e0\ub358 \ud0d3\uc5d0 \ub300\ucd08\uc6d0\uc758 \ud48d\ubaa8\ub294 \uc5c6\ub2e4  \uba85\ubd88\ud5c8\uc804        \uadf8\ub7fc\uc5d0\ub3c4 \uac00\uc744\uc774\uba74 \ubb47 \uc0ac\ub78c\ub4e4 \uadf8 \ud48d\uacbd\ub9cc \ubcf4\ub7ec \ubab0\ub824\ub4e0\ub2e4  \ubcd1\ub4e0 \uc2e0\ub77c \uc655\uc790\uac00 \uc774 \uc0b0 \uc57d\uc218\ub97c \ub9c8\uc2dc\uace0 \ubcd1\uc774 \ub098\uc558\ub2e4 \ud558\uc5ec \uc7ac\uc57d\uc0b0\uc774\ub77c\uace0 \ud588\ub2e4\ub294 \uc804\uc124\uc774\ub2e4  \uc6d0\ub798\ub294 \uadf8 \uc57d\uc218 \uc774\ub984\uc744 \ub534 \uc601\uc815\uc0ac     \uc758 \uc0b0\uc774\uc5c8\ub294\ub370 \uc784\uc9c4\uc65c\ub780\uc758 \uc601\uc6c5 \uc0ac\uba85\ub300\uc0ac \uc720\ubb3c\uc744 \uae38\uc9c0\ub85c \uc62e\uae30\uba74\uc11c \uc808 \uc774\ub984\uacfc\ub294 \uc601 \uc5b4\uc6b8\ub9ac\uc9c0 \uc54a\uc740 \ud45c\ucda9\uc0ac     \uac00 \uc8fc\uc778\uc774 \ub418\uc5c8\ub2e4 "
