    "Description": "\uc624\uc0c9\uc57d\uc218 \ud488\uc740 \uc124\uc545\uc0b0 \uc804\ub9dd\ub300        \uc810\ubd09\uc0b0\uc740 \uc624\uc0c9\uc628\ucc9c\uacfc \uc57d\uc218\ub97c \ub07c\uace0 \uc788\uae34 \ud558\uc9c0\ub9cc \uc124\uc545\uc758 \uadf8\ub298\uc5d0 \uac00\ub824 \uadf8 \uc704\ud48d\uc744 \ud3b4\uc9c0 \ubabb\ud588\uc5c8\ub2e4  \ud558\uc9c0\ub9cc \uac00\uc744\uc774\uba74 \uac00\uc57c\ub3d9\uc744 \ucd95\uc18c\uc2dc\ucf1c \ub193\uc740 \ub4ef\ud55c \uc8fc\uc804\uace8\uacfc \uc124\uc545\uc758 \ucc9c\ubd88\ub3d9\uc744 \uc62e\uaca8 \ub193\uc740 \ub4ef\ud55c \uae30\uc554\ub4e4\uc774 \uc5b4\uc6b8\ub824 \ub2e8\ud48d\uc0b0\ud589\uc9c0\ub85c \uac01\uad11\ubc1b\ub294 \uacf3\uc774\ub2e4          \uc810\ubd09\uc0b0\uc758 \uc61b \uc774\ub984\uc740 \ub364\ubd95\uc0b0\uc774\ub77c \ud55c\ub2e4  \ub54c\ubb38\uc5d0 \uacf0\ubc30\ub839\uc5d0\uc11c \uc810\ubd09\uc0b0\uc73c\ub85c \uc62c\ub77c\uc624\ub2e4 \ub9cc\ub098\ub294 \uc791\uc740 \uc810\ubd09\uc0b0\uc744 \uc791\uc740\ub364\ubd95\uc774\ub77c \ubd80\ub974\uae30\ub3c4 \ud55c\ub2e4  \uc810\ubd09\uc0b0\uc744 \uae30\uace0 \uc788\ub294 \uc624\uc0c9\uc57d\uc218\ub294 \ucca0\ubd84\uc774 \ub9ce\uc774 \ud568\uc720\ub41c \ud0c4\uc0b0\uc218\ub85c \uc704\uc7a5\ubcd1  \uc2e0\uacbd\ud1b5  \ube48\ud608 \ub4f1\uc5d0 \ud6a8\ud610\uc774 \ub192\ub2e4\uace0 \uc54c\ub824\uc838 \uc788\ub2e4  \uc810\ubd09\uc0b0 \uc0b0\ud589\uc740 \uc624\uc0c9  \ud55c\uacc4\ub839  \uadc0\ub454  \uc9c4\ub3d9\ub9ac \ub4f1\uc5d0\uc11c \uc2dc\uc791\ud560 \uc218 \uc788\uc9c0\ub9cc \ud604\uc7ac\ub294 \uc624\uc0c9\uc57d\uc218 \uad6c\uac04\ub9cc \uc774\uc6a9 \uac00\ub2a5\ud558\ub2e4  \uc810\ubd09\uc0b0\uc77c\uc6d0\uc740 \uc57c\uc0dd\uc2dd\ubb3c\uad70\ub77d\uc9c0\uac00 \uc788\ub294 \ud2b9\ubcc4\ubcf4\ud638\uad6c\ub85c \uc9c0\uc815\ub418\uc5b4     \ub144\uae4c\uc9c0 \ucd9c\uc785\ud560 \uc218 \uc5c6\ub2e4 "
