    "Description": "          \uc8fc\uc0b0\uc740 \uc9c0\ub9ac\uc0b0\uc758 \uc704\uc131\ubd09\uc73c\ub85c \uc0bc\uc2e0\ubd09 \uc904\uae30\uac00 \ub0a8\ud558 \ud558\ub2e4\uac00 \uc11c\uc11c\ud788 \ub3d9\ucabd\uc73c\ub85c \ubc29\ud5a5\uc744 \ud2c0\uba70\uc11c \uc2dc\ucc9c\uba74 \ub0b4\uacf5\ub9ac\uc5d0\uc11c \ub2e4\uc2dc \ud55c\ubc88 \uc19f\uad6c\uccd0 \uc624\ub978 \ubd09\uc6b0\ub9ac\uac00 \ubc14\ub85c \uc8fc\uc0b0\uc774\ub2e4  \uc9c0\ub9ac\uc0b0 \ucc9c\uc655\ubd09\uc774 \uba38\ub9ac\uc774\uace0 \ubab8\ud1b5\uc774\ub77c\uba74 \uc8fc\uc0b0\uae4c\uc9c0 \ub0b4\ub824\uc628 \uc904\uae30\ub294 \ub9c8\uce58 \uae34 \uc624\ub978\ud314\ub85c \uad6c\uace1\uc0b0\uc744 \uc548\uc740 \ud615\uc0c1\uc744 \ud558\uace0 \uc788\ub2e4  \uc8fc\uc0b0\uc758 \ub2a5\uc120\uc904\uae30\ub098 \uc870\ub9dd\uc810\uc5d0\uc11c\ub294 \uc9c0\ub9ac\uc0b0\uc758 \ucc9c\uc655\ubd09\uacfc \uc774\ud558 \uc218\ub9ce\uc740 \ubd09\uc6b0\ub9ac\ub97c \uba3c \ubc1c\uce58\uc5d0\uc11c \ud55c\ub208\uc5d0 \ubc14\ub77c\ubcfc \uc218 \uc788\uc5b4 \uacbd\uad00\uc774 \uc6b0\uc218\ud558\ub2e4  \uc8fc\uc0b0 \uc790\uc2e0\uc758 \uc0b0\uc138\ubcf4\ub2e4\ub294 \uc9c0\ub9ac\uc0b0\uacfc \uc8fc\ubcc0\uc0b0\uc138\ub97c \uc870\ub9dd\ucf00 \ud574\uc8fc\ub294 \uc0b0\uc73c\ub85c \uc790\uc2e0\uc758 \uc704\uc6a9\ubcf4\ub2e4\ub294 \ub0a8\uc758 \uc218\ub824\ud568\uc744 \uc54c\ub824\uc8fc\ub294 \uc544\uc8fc \uacb8\uc190\ud55c \uc0b0\uc774\ub2e4  \uc8fc\uc0b0\uc758 \ub2a5\uc120\uacfc \uace8\uc9dc\uae30 \uc18d\uc18d\ub9c8\ub2e4 \uc0b0\uc8fd\uc73c\ub85c \uc790\uc2e0\uc744 \uac10\ucd94\uace0 \uc788\uc5b4 \ub9c8\uc74c\ub193\uace0 \uc774\uacf3 \uc800\uacf3\uc744 \uc0b4\ud53c\uae30 \uc5b4\ub835\ub2e4  \ub530\ub77c\uc11c \uc0b0\uc9d0\uc2b9\ub4e4\uc5d0\uac8c\ub294 \uc88b\uc740 \uc548\uc2dd\ucc98\uac00 \ub418\ub294 \uc0b0\uc774\ub2e4             \uc8fc\uc0b0\uc5d0 \ub300\ud55c \ud2b9\ubcc4\ud55c \uc720\ub798\ub098 \uc804\uc124\uc740 \uc5c6\ub2e4  \ub2e8\uc9c0 \uc8fc   \uc790\uac00  \uc784\uae08 \uc8fc \uc778\uac83\uc73c\ub85c \ubcf4\uc544 \uc61b\ub0a0 \uc655\uacfc \uc5f0\uad00\ub41c \uc774\uc57c\uae30\uac00 \uc788\uc9c0 \uc54a\ub098 \ucd94\ucd95\ud560 \ub530\ub984\uc774\ub2e4      \uc774\ub77c\ub294 \uba85\uce6d\ub3c4 \uc8fc\ubcc0\uc5d0 \uc788\ub294 \uac83\uc73c\ub85c \ubcf4\uc544 \uc9c0\ub9ac\uc0b0\uc744 \uad00\ub9dd\ud558\uac70\ub098 \uc8fc\ubcc0\uc744 \uc0b4\ud544 \uc218 \uc788\ub294 \uc0b0\ub9c8\ub8e8\uac00 \uc9c0\ub9ac\uc0b0\uc5d0 \uc5ec\ub7ec\uacf3\uc774 \uc788\ub294\ub370 \uc8fc\uc0b0\uc778 \uc774\uacf3\uc774 \uadf8\uc911 \ub2e4\uc12f\ubc88\uc9f8 \uc88b\uc740 \uacf3\uc774\ub77c \ud558\uc5ec \uc624\ub300\uc8fc\uc0b0\uc774\ub77c \ud558\uc9c0 \uc54a\uc558\ub098 \ucd94\uce21\ud560 \ub530\ub984\uc774\uba70  \uc8fc\uc0b0\uc774\ub77c\ud568\uc740 \uc9c0\ub9ac\uc0b0 \uc804\uccb4 \uc870\ub9dd\uc774 \uc6b0\uc218\ud558\uc5ec \uc8fc\uc0b0\uc774\ub77c \ud558\uc9c0 \uc54a\uc558\ub098 \uc5ec\uaca8\uc9c8 \ubfd0\uc774\ub2e4 "
