    "Description": "    \uc9c0\uae08\uc740 \uc804\uc124\ub85c\ub9cc \ub0a8\uc740 \ubb34\ud611\uc18c\uc124\uc758 \ub3d9\ucc9c        \ud558\ub298\uc744 \ub098\ub294 \uc7ac\uc8fc \uc5c6\uc774\ub294 \ub4e4\uc5b4\uac08 \uc218 \uc5c6\ub294 \ub3d9\ucc9c      \ud611\uace1\uc758 \uc785\uad6c\ub85c\ub294 \uae09\ub958\uac00 \uc3df\uc544\ub098\uc624\uace0 \uae4e\uc544\uc9c0\ub978 \uc591\ucabd \uc808\ubcbd\uc740 \ub192\uc774\ub97c \uac00\ub2a0\ud560 \uc218 \uc5c6\ub2e4  \ubb34\ud611\uc18c\uc124\uc5d0\ub098 \ub4f1\uc7a5\ud568\uc9c1\ud55c \ud48d\uacbd  \uadf8\ub807\uc9c0\ub9cc \uc774\ub545\uc5d0\ub3c4 \uadf8\ub7f0 \uc0b0\uc774 \uc788\uc5c8\ub2e4            \ub144\ub300\uc758 \uc5b4\ub9ac\uc11d\uc740 \uc0ac\ub78c\ub4e4\uc774 \uc81c \ud3ed\ud3ec \uc55e\ub4a4 \uc808\ubcbd\uc744 \ud30c \uae38\uc744 \ub0b4\uc9c0 \uc54a\uc558\ub354\ub77c\uba74 \uc8fc\uc655\ub3d9\ucc9c\uc740 \uc544\uc9c1\uaecf \ub4e4\uc5b4\uac00\ubcf8 \uc0ac\ub78c\uc774 \uc5c6\uc5c8\uc73c\ub9ac\ub77c  \uae08\uc740\uad11\uc774\ub098 \uac00\uba54\ubd09 \uc606 \uc798\ub8e8\ubaa9\uc744 \ub118\uc5b4\uac08 \uc218\ub294 \uc788\uc5c8\uc5b4\ub3c4 \uc815\uba74 \ub3d9\uad6c\ub85c \ub4e4\uc5b4\uac04 \uc774\ub294 \uc804\ubb34\ud588\uc744 \uac83\uc774\ub2e4  \uc5c4\uccad\ub09c \uac00\ubb44\uc73c\ub85c \uc8fc\uc655\uacc4\uace1 \ubb3c\uc774 \ubaa8\ub450 \ub9d0\ub77c\ubd99\uae30 \uc804\uc5d0\ub294          \uadf8\ub798\uc11c \uc804\uc124 \uc5b4\ub9b0 \uba85\uc18c\ub4e4\uc740 \ubaa8\ub450 \ub3d9\uad6c \uc544\ub798 \ubaa8\uc5ec\uc788\ub2e4  \uc804\uc124\uc758 \uc2dc\ub300\uac00 \ub05d\ub09c \ub4a4\uc5d0 \ubc1c\uacac\ub41c \ud130\ub77c \ud3ed\ud3ec \uc774\ub984 \ub610\ud55c \uadf8\ub0e5 \uc81c  \uc81c  \uc81c \ud3ed\ud3ec\ub2e4  \ub098\uc544\uac00 \uacc4\uace1 \ub05d\uc758    \ubd09\uc744 \ubb34\uc2dc\ud558\uace0 \uc544\uc9c1\uaecf    \ubd09\uc5d0 \ub300\ud45c\uc131\uc744 \ubd80\uc5ec\ud558\uace0 \uc788\ub2e4  \ub3d9\ucc9c\uc73c\ub85c \ub4e4\uc5b4\uac00\uc9c0 \ubabb\ud55c \uc774\ub4e4\uc774 \uc62c\ub77c\uac08 \uc218 \uc788\ub294 \uac00\uc7a5 \ub192\uc740 \ubd09\uc6b0\ub9ac\uc600\uc73c\ub2c8\uae4c          \uc8fc\ub098\ub77c \uc655\uc744 \uac16\ub2e4\ubd99\uc778 \uc804\uc124\ub3c4 \uadf8\ub807\ub2e4  \uc2e0\ub77c \uc5ed\uc0ac\uc5d0\ub294  \uc655\uc704 \uacc4\uc2b9  \uc21c\uc704\uc600\uc73c\ub098 \ub73b\uc744 \uc774\ub8e8\uc9c0 \ubabb\ud55c \uc8fc\uc6d0\uc655 \uae40\uc8fc\uc6d0\uc774 \uc788\uc5c8\uace0 \uc774\uc5d0 \ubd88\ub9cc\uc744 \ud488\uc740 \uc544\ub4e4 \ud5cc\ucc3d\uc758 \ubc18\ub780\uc774 \ub098\ub77c\ub97c \uac70\ub35c\ub0b8 \uc0ac\uc2e4\uc774 \ubd84\uba85\ud55c\ub370 \uc5c9\ub6b1\ud558\uac8c\ub3c4 \ucc9c\uc5ec\ub144 \uc804\uc5d0 \ub9dd\ud55c \uba3c \ub098\ub77c \ud6c4\uc8fc \uc774\uc57c\uae30\ub85c \ub3c4\ubc30\ub97c \ud588\ub2e4 "
