    "Description": "          \uc9d1\ud604\uc0b0\uc740 \uc0b0\uccad\uad70 \uc0dd\ube44\ub7c9\uba74 \uc9c4\uc8fc\uc2dc \uc9d1\ud604\uba74\uacfc\uc758 \uacbd\uacc4\uc5d0 \uac78\uccd0\uc788\ub294 \uc0b0\uc73c\ub85c \uc5ec\uae30\uc11c\ub294 \uc0dd\ube44\ub7c9\uba74\uae30\uc900\uc73c\ub85c \ub4f1\uc0b0\ub85c\ub97c \uc870\uc0ac\ud558\uc600\ub2e4 \uc0b0\uc758 \ud615\ud0dc\ub294 \ub9d0\uad7d\ud615 \ud615\ud0dc\ub97c \ud558\uace0 \uc788\uc73c\uba70 \ub2a5\uc120 \ub4f1\uc0b0\ub85c \uac70\ub9ac\ub294        \uc774\ub2e4 \ub9d0\uad7d\ud615\uc18d\uc5d0 \ud604\ub3d9\ub9c8\uc744\uc774 \uc790\ub9ac\uc7a1\uace0\uc788\uc73c\uba70 \uc9d1\ud604\uc0b0\uc774 \ub9c8\uc744\uc744 \uc591\uc190\uc73c\ub85c \uac10\uc2f8\uace0 \uc788\ub294 \ud615\uc138\ub97c \ud558\uace0\uc788\ub2e4 \ubb34\ub108\ubbf8\uc7ac\ubc29\ud5a5\uc740 \uc644\ub9cc\ud55c \uacbd\uc0ac\ub97c \uc774\ub8e8\uace0 \uc788\uc73c\ub098 \uadf8\uc678\ub294 \uacbd\uc0ac\uac00 \uc870\uae08\uc788\uc5b4 \ubcc4\ub2e4\ub978 \ub4f1\uc0b0 \ub178\uc120\uc774 \uc5c6\ub2e4 \uc815\uc0c1\uc5d0\uc11c\ub294 \ub9de\uc740\ud3b8 \ub2a5\uc120\uc758 \ubd80\ubd09  \uc7a5\uad70\ubd09  \uae4c\uce58\ubd09\uc744 \ubc14\ub77c\ubcfc\uc218 \uc788\uc73c\uba70  \ud574\ub3cb\uc774\ud558\uae30\uc5d0\ub3c4 \uc88b\uc740 \uacf3\uc774\ub2e4 \ubd80\ubd09\uc5d0\uc11c\ub294 \uc9c4\uc8fc\uc2dc\uc640 \uc9c4\uc591\ud638 \ubc0f \uc0b0\uccad\uad70 \uc6d0\uc9c0  \uc6c5\uc11d\ubd09  \uc9c0\ub9ac\uc0b0\ub4f1\uc774 \uc798\ubcf4\uc774\uba70 \uc8fc\ubcc0\uc5d0 \ub192\uc740\uc0b0\uc774 \uc5c6\uc5b4 \ud574\ub3cb\uc774\uc640 \uc870\ub9dd\uc774 \uc544\uc8fc \uc88b\ub2e4              \uc5ed\uc0ac\uc801\uc73c\ub85c \ub3d9\ud559\ud601\uba85\uacfc \uc784\uc9c4\uc65c\ub780\uc758 \uc544\ud514\uc744 \ub9ce\uc774 \uac04\uc9c1\ud55c \uc0b0\uc774\uae30\ub3c4 \ud558\ub2e4 \uc9d1\ud604\uc0b0 \uc790\ub77d \uccad\uace0\uac1c\uc758 \uc784\uc9c4\uc65c\ub780 \uc0c1\ud669\uc744 \ubcf4\uba74 \uc784\uc9c4\ub144   \uc6d4  \uc77c \uae40\uc900\ubbfc\uc7a5\uad70\uc774 \uc774\ub044\ub294    \uc5ec \uad70\uc0ac\uac00 \uc9c4\uc8fc\uc131\uc744 \uad6c\uc6d0\ud558\uae30 \uc704\ud558\uc5ec \uc9c4\uad70\ud558\ub294 \uae38\uc5d0 \uc774\uacf3\uc5d0 \uc774\ub974\ub800\ub2e4  \uc7a5\uc0ac\uc9c4\uc744 \uc774\ub8ec \uad70\uc0ac\uac00 \uc774\ub3d9\ud558\ub2e4\ubcf4\ub2c8 \ub73b\ubc16\uc5d0 \uccad\ud604  \uc624\ub3d9  \uc815\ud0dc  \ub2e8\uc131 \uc77c\ub300\uc5d0 \uc65c\uc801\uc774 \ucad9 \uae54\ub824\uc11c \ub9c8\uc744\ub9c8\ub2e4 \ubd84\ud0d5\uc9c8\uc744 \ud558\ub294\ub370 \ubd88\uc744 \uc9c8\ub7ec\uc11c \uc5f0\uae30\uac00 \ud558\ub298\uc5d0 \ub2ff\uc744 \uc815\ub3c4\uc600\ub2e4  \uc774\uc5d0 \uae40\uc900\ubbfc \uc7a5\uad70\uc774 \uc55e\uc7a5\uc11c \uc8fd\ub9bc \ubc16\uc73c\ub85c \ub6f0\uc5b4\ub098\uac00 \uc544\ub798\uc704\ub85c \uc801\uc744 \ud729\uc4f8\uc5c8\ub2e4  \ub610\ud55c \uad70\uad00 \uc724\uacbd\ub0a8 \ub4f1\uc774 \uc7a5\uc218\uac00 \uc801\uc911\uc5d0\uc11c \uace0\uad70\ubd84\ud22c\ud558\uace0 \uc788\uc74c\uc744 \uc678\uce58\uba74\uc11c \ub6f0\uc5b4\ub4dc\ub2c8    \uc5ec\uad70\uc0ac\uac00 \uc77c\uc2dc\uc5d0 \ud568\uc131\uc744 \uc9c0\ub974\uace0 \ub0b4\ub2ec\uc544 \ub3cc\uc9c4\ud558\uc600\ub2e4  \uc801\uc774 \ud5c8\ubb3c\uc5b4\uc838 \uc8fd\ub9bc \uc18d\uc744 \ube60\uc838 \ub2ec\uc544\ub098\ub2e4\uac00 \uac15\uc744 \uac74\ub108\uc11c \ub300\ud56d\ud558\uae30\uc5d0 \uc774\ub974\ub800\ub294\ub370 \uc6b0\ub9ac \uad70\uc0ac\uc640 \uac15\uc744 \uc0ac\uc774\uc5d0 \ub450\uace0 \uaca9\uc804\uc744 \ubc8c\uc774\ub2c8 \ud654\uc0b4\uc774 \ube44\uc624\ub4ef \ub098\ub974\uace0 \ud3ec\uc131\uc774 \uc9c4\ub3d9\ud558\uc600\ub2e4  \ub54c\ub9c8\uce68 \uc2b9\uad70 \uc758\ubcd1\uc7a5 \uc2e0\uc5f4\uc774 \uad70\uc0ac\ub97c \uc774\ub04c\uace0 \ub2ec\ub824\uc640 \ud569\uc138\ud558\uc790 \uad70\uc138\uac00 \ub5a8\uce58\uace0 \uc0ac\uae30\uac00 \ucda9\ucc9c\ud558\uc600\ub2e4  \ub9f9\ub82c\ud788 \uacf5\uaca9\ud558\uc790 \uc801\uc774 \ud1f4\uac01\ud558\uc5ec \uccad\uace0\uac1c\ub97c \ub118\uc5b4\uc11c \ub2ec\uc544\ub098\uace0 \ub9ce\uc740 \uc0ac\uc0c1\uc790\ub97c \ub0b4\uc5c8\ub2e4  \uc774\uc5b4\uc11c \uae40\uc900\ubbfc\uc7a5\uad70\uc740 \ub2e8\uc131 \ucabd\uc73c\ub85c \ud589\ud558\uc5ec \uac70\uae30\uc11c \ubd84\ud0d5\uc9c8\ud558\ub294 \uc801\uc744 \ucad3\uace0 \ucc3d\uace0\uc5d0\uc11c \ubd88\ud0c0\uace0 \uc788\ub294 \uace1\uc2dd\uc744 \uad6c\ud558\uc600\ub294\ub370    \uc5ec \uc11d\uc774\uc5c8\ub2e4  \uc801\uc9c0\uace8\uc774\ub780 \uc774\ub984\uc5d0\uc11c\ub3c4 \uadf8\ub54c\uac00 \uc5f0\uc0c1\ub418\ub294 \ubc14 \uc788\ub2e4  \uc9c0\uae08\uc740 \uc774 \uad11\ud65c\ud55c \uace8\uc548\uc5d0 \uacbd\uc0c1\ub0a8\ub3c4 \ucca8\ub2e8\uc591\ub3c8\uc5f0\uad6c\uc18c\uac00      \ub113\uc774\uc758 \uba74\uc801\uc5d0 \uac1c\uc124\ub418\uc5b4 \uc774 \uc9c0\uc5ed \uc591\ucd95\ub18d\uac00\uc758 \ube44\uc804\uc744 \uc81c\uc2dc\ud558\uace0 \uc788\ub2e4 \uccad\ud604\ub9c8\uc744\uc5d0\ub294 \uccad\uace1\uc11c\uc6d0\uc774 \uc788\uc5b4 \uc77c\uc2e0\ub2f9 \uc774\ucc9c\uacbd\uc744 \ud5a5\ub840\ud558\uace0 \uc788\uace0 \uc720\ud615\ubb38\ud654\uc7ac \uc81c   \ud638 \uc77c\uc2e0\ub2f9\ubb38\uc9d1 \ubc0f \ud544\ucca9\ucc45\ud310\uc774 \ubcf4\uc874\ub418\uc5b4 \uc788\ub2e4  \uadfc\ub144\uc5d0 \uc790\ud3ec\uc815\uc0ac\ub97c \uc9c0\uc5b4\uc11c \uc790\ud3ec \uc774\uc601\uc744 \ucc44\ub840\ud55c\ub2e4  \ub9c8\uc744 \uc704\ucabd\uc758 \uace0\ubaa9 \uc544\ub798\uc5d0 \uc11d\ub2e8\uc774 \uc788\uace0  \uccad\uace0\uac1c\uc5d0\ub294 \ub204\uc11d\ub2e8\uc774 \uc788\uc5b4\uc11c \uace0\ud48d\uc744 \uc9c0\ub2cc \ub9c8\uc744\uc784\uc744 \uc54c \uc218 \uc788\ub2e4 "
