    "Description": "    \ub2ed\uc758 \uc7a5\ud0dc \ubaa8\uc591\uc758 \ud558\ub2ac\ubc14\ub78c\uc0b0        \ube44\uc0ac\ub9bf\ub300\ub85c \ub9cc\ub4e0 \ub2ed\uc758\uc7a5\ud0dc \ubaa8\uc591\uc758 \uc0b0\uc774\ub2e4     \ubbf8\ud130 \ub4f1\uace0\uc120\uc744 \uae30\uc900\uc73c\ub85c \ud558\uc5ec \uc0b0\uc758 \uc5bc\uac1c\ub97c \ud30c\uc545\ud574\ubcf4\uba74 \uadf8 \ube44\uc0ac\ub9bf\ub300  \ub2a5\uc120\uc774 \uc2a4\ubb34 \uac1c\ub098 \ub41c\ub2e4  \ud558\uc5ec \uc804\uccb4\uc801\uc73c\ub85c \uac70\ub300\ud55c \ub3d4\uc744 \uc774\ub8e8\uc5b4 \ubcf4\ub294 \uc774\ub97c \uc555\ub3c4\ud55c\ub2e4          \uc2dc\uc6d4 \uccab\uc9f8\uc8fc\ub9d0\uc5d0 \uc5b5\uc0c8\uc81c\ub97c \uc5f4 \ub9cc\ud07c \uc5b5\uc0c8\ub97c \uc790\ub791\ud55c\ub2e4  \ubc14\ub2f7\ubc14\ub78c \ub54c\ubb38\uc5d0 \ub098\ubb34\uac00 \uc790\ub77c\uc9c0 \ubabb\ud558\uae30 \ub54c\ubb38\uc774\ub9ac\ub77c  \uc0c1\ubd09 \uc5f0\ub300\ubd09\uc5d0\uc11c \ud658\ud76c\ub300 \uc0ac\uc774\uc758 \uc8fc\ub989 \ub4f1\uc11c\ub9ac\uc5d0\ub9cc \uc788\uc744 \ubfd0\uc778\ub370\ub3c4 \uc804\uad6d\uc758 \uc778\ud30c\uac00 \ubab0\ub824\ub4e0\ub2e4          \uc721\uc9c0\uc5d0\uc11c \ucc3e\uc544\uac08 \ub54c\ub294 \uad00\uc0b0\uc74d\uc774 \ub4e4\uba38\ub9ac\uac00 \ub418\ub294 \uae4c\ub2ed\uc5d0 \uad00\uc0b0\uc758 \uc0b0\uc73c\ub85c \uc54c\ub824\uc838\uc788\uc9c0\ub9cc \uc560\ucd08\uc5d0\ub294 \ub300\ub355\uc74d \ud68c\uc9c4    \uacfc\uc758 \uc778\uc5f0\uc774 \ub354 \uae4a\uc5c8\uc744 \ub4ef\ud558\ub2e4  \ud558\ub2ac\ubc14\ub78c\uc0b0\uc774\ub77c\ub294 \ub73b\uc758 \ucc9c\ud48d\uc0b0     \uc73c\ub85c\ub3c4 \ubd88\ub838\uae30 \ub54c\ubb38\uc774\ub2e4          \uc7a5\ud765\ubc18\ub3c4 \ub05d\uba38\ub9ac\uc758 \uc774 \ud3ec\uad6c\ub294 \uc544\uc8fc \uc624\ub79c \uc61b\ub0a0\ubd80\ud130 \ub0a8\ud574\ud56d\ub85c\uc758 \uc911\uc694 \uac70\uc810\uc774\uc5c8\ub2e4  \uadf8\ub798 \ubc31\uc81c \uadfc\ucd08\uace0\uc655\uc774 \uc784\ub098\uad70\uacfc \ud569\ub3d9\uc73c\ub85c \uc804\ub77c\ub0a8\ub3c4 \uc9c0\uc5ed\uc744 \uc810\ub839\ud560 \ub54c \uc5ec\uae30\uc11c \ub9cc\ub098 \uc6d0\uc815\uc744 \ub9c8\ubb34\ub9ac\uc9c0\uc5b4  \ubaa8\uc77c \ud68c \uc790\ub97c \uc4f4 \uac83\uc73c\ub85c \ubcf4\uc778\ub2e4  \uadf8\ub7f0\ub370 \ud6c4\uc77c \uad00\uc0b0\uc774 \ucee4\uc9c0\uc790 \uc815\uc0c1\ub2a5\uc120\uc758 \uc5b4\ub5a4 \ubc14\uc704\uac00 \uac13 \ubaa8\uc591\uc73c\ub85c \uc0dd\uacbc\ub290\ub2c8 \uc5b4\uca4c\ub2c8 \ud558\uba74\uc11c \ucc9c\uad00\uc0b0\uc73c\ub85c \ubc14\uafb8\uc9c0 \uc54a\uc558\uc744\uae4c "
