    "Description": "    \ubd09\ub9cc \uacc4\ub958\ubbf8\uc5d0 \uace0\uce35\uc2b5\uc6d0\uae4c\uc9c0 \uc788\ub294 \uac16\ucda4\uaf34          \uac00\ud30c\ub978 \uc5f0\ubd09\ub4e4 \ucca9\ucca9\uc774\uc694 \uae4a\uace0 \uae4a\uc740 \uace8\uc9dc\uae30 \uad74 \uac19\ub2e4             \ub294 \uc0b0\uc774\ub2e4  \uc6c5\uc0c1\ucabd\uc5d0\uc11c \ubcf4\uba74 \uae4e\uc544\uc9c0\ub978 \ub4ef\ud55c \uc0b0\uc138\uac00 \ub2e8\uc21c \uc6c5\uc7a5\ud55c \ud651\uc0b0\uc778\ub370 \uc591\uc0b0\ucabd\uc73c\ub85c\ub294 \ud798\ucc2c \uc0b0\uc904\uae30\ub97c \uc5ec\ub7ff \ubed7\uc5b4\ub0b4\ub9ac\uba74\uc11c \uadf8 \uc704\uc5d0 \uc218\ub9ce\uc740 \uc554\ubd09\uc744 \uc62c\ub824\ub193\uc558\ub2e4  \ub2a5\uc120\ub4e4 \uc0ac\uc774 \uace8\uc9dc\uae30\ub4e4\uc740 \uc554\ubc18\uacc4\ub958 \ub2f4\uc18c    \uac00 \uc990\ube44\ud558\ub2e4      \uc2e0\uc99d\ub3d9\uad6d\uc5ec\uc9c0\uc2b9\ub78c    \uc758 \uc800 \ud45c\ud604\uc774 \ud558\ub098\ub3c4 \uc5b4\uae0b\ub0a8 \uc5c6\ub294  \ubd09\ub9cc\ubbf8\uc640 \uacc4\ub958\ubbf8\uac00 \ub2e4 \uac19\uc774 \ub6f0\uc5b4\ub09c \uba85\uc0b0\uc778 \uac83\uc774\ub2e4          \uc608\uc804 \uc9c0\ub3c4\uc5d0   \ucc9c\uc131\uc0b0  \uc774 \ubd99\uc5b4\uc788\uc5c8\ub358 \ubd81\ubd09 \uc57d       \uc77c\ub300\ub294 \ub610 \uc5b5\uc0c8\uc758 \ucc9c\uad6d\uc774\ub2e4  \uadf8 \ucc9c\uad6d \uc5ec\uae30\uc800\uae30 \ubc8c\uc5ec\uc788\ub294 \uace0\uce35\uc2b5\uc6d0\uc5d0\ub294 \ub098\ub77c\ub97c \ub5a0\ub4e4\uc369\ud558\uac8c \ud588\ub358 \uaf2c\ub9ac\uce58\ub808\ub3c4\ub871\ub1fd\uacfc \ub048\ub048\uc774\uc8fc\uac71 \uac19\uc740 \ud76c\uadc0 \ub3d9\uc2dd\ubb3c\uc774 \uc0b0\ub2e4   \uc790 \ubaa8\uc591\uc73c\ub85c \ud750\ub974\ub294 \ud2b9\uc774\uc9c0\ud615 \ubc95\uc218\uacc4\uace1 \uc0c1\ub958\uc758 \uc774\uc0c9\uc9c0\ub300\ub2e4          \uc774\ub545\uc5d0\uc11c \uc77c\ucd9c\uc744 \uac00\uc7a5 \uba3c\uc800 \ubcfc \uc218 \uc788\ub294 \uacf3\uc73c\ub85c\ub3c4 \uc774\ub984\ub098 \uc788\ub2e4  \uadf8\ub7f0 \ub9cc\ud07c \uc870\ub9dd\uc774 \ub6f0\uc5b4\ub098 \uc601\ub0a8\uc54c\ud504\uc2a4 \uc544\ud649 \uc900\ubd09\uc774 \ud558\ub098\ud558\ub098 \ub610\ub837\ub610\ub837 \ubcf4\uc774\uace0 \ub0a8\uc73c\ub85c \ubd80\uc0b0 \uae08\uc815\uc0b0\uc740 \ubb3c\ub860\uc774\ub824\ub2c8\uc640 \uba40\ub9ac \uae40\ud574 \uc2e0\uc5b4\uc0b0  \ub9c8\uc0b0 \ubb34\ud559\uc0b0\uae4c\uc9c0 \ub450\ub8e8\ub450\ub8e8 \uac00\ub2a0\ud560 \uc218 \uc788\ub2e4          \ucc9c\uc131\uc0b0\uc774\ub77c\uace0 \ubd88\ub9ac\uac8c\ub41c \uc778\uc5f0\uc740 \uc6d0\ud6a8\ub300\uc0ac\uac00 \uc774 \uc0b0\uc73c\ub85c \ucc9c \uba85\uc758 \uc911\uc0dd\uc744 \uc785\uc0b0\uc2dc\ucf1c \ubaa8\ub450 \uc131\uc778\uc774 \ub418\uac8c\ud588\ub2e4\ub294 \ub370\uc11c \ube44\ub86f\ub410\ub2e4  \ud55c\ud3b8\uc73c\ub85c\ub294 \uadf8\ub4e4\uc774  \ubc25\uc0c1\uc744 \ub358\uc838 \ubaa9\uc228\uc744 \uad6c\ud574\uc900 \uc740\ud61c\ub97c \uc78a\uc9c0 \ubabb\ud574 \ucc3e\uc544\uc628 \ub2f9\ub098\ub77c \uc2b9\ub824\ub4e4\uc774\ub77c\ub294 \uc124\ub3c4 \uc788\ub294\ub370 \ub2f9\ub098\ub77c\ub97c \uac00\uc9c0\ub3c4 \uc54a\uc740 \uc6d0\ud6a8\ub300\uc0ac\ub97c \uac00\uc9c0\uace0 \ub108\ubb34 \uc7a5\ub09c\uc744 \uce5c \ub4ef\ud558\ub2e4  \uc0c1\ubd09\uc740 \ucd5c\uadfc\uae4c\uc9c0 \uc6d0\ud6a8\uc0b0\uc774\ub77c\uace0 \ud588\ub2e4 "
