    "Description": "    \uc7a5\ubcbd\ucc98\ub7fc \uc19f\uc740  \ucc99 \ubd10\uc11c \uba85\uc0b0        \uba85\uc0b0\uc740 \uac00\uae4c\uc774 \uac00\ubcf4\uba74 \uc548\ub2e4  \uc601\ub3d9\uace0\uc18d\uad6d\ub3c4 \uc6d0\uc8fc\ub97c \uc9c0\ub0a0 \ubb34\ub835 \ubb47 \uc0b0\uc744 \uc81c\uc555\ud558\ub294 \ud6e4\uce60\ud55c \uc0b0\uc774 \ubcf4\uc778\ub2e4\uba74 \ubb3c\uc5b4\ubcfc \uac83\ub3c4 \uc5c6\uc774 \uce58\uc545\uc0b0\uc778 \uac83\uc774\ub2e4          \ub4e4\uace0\uc744 \uc6d0\uc8fc    \uc5d0\uc11c \ubcf4\uba74 \uadf8\uac74 \uac70\ub300\ud55c \uc7a5\ubcbd\uc774\ub2e4    \ud0ac\ub85c\ubbf8\ud130\uc758 \uc7a5\ub300\ud55c \uc8fc\ub989\uc774 \uadf8\ub300\ub85c \ucc9c\uc5ec\ubbf8\ud130\ub97c \uc19f\uc544\uc62c\ub790\ub2e4  \uc774\ub7f0 \uc555\ub3c4\uc801 \uc0b0\uc138\uc758 \ub4a4\ud3b8\uc73c\ub85c\ub294 \ub610 \ub9e4\ud654\uc0b0         \uacfc \ub9e4\ubd09\uc0b0        \uc904\uae30\ub97c \uc2e4\ud30d\ud558\uac8c \ubed7\uccd0 \uc0b0\ubb3c\uacb0 \ucca9\ucca9\uc758 \uacb9\uc0b0\uc744 \ub9cc\ub4e4\uace0\uc788\ub2e4  \ud558\uc5ec \uc0ac\uc774\uc0ac\uc774 \uad6c\ub8e1\uc0ac \ud070\uace8  \ubd80\uace1\ubd84\uc9c0  \uc0c1\uc6d0\uace8\uc758 \uae4a\uc740 \uad6c\ub801\uc744 \ud615\uc131\ud55c\ub2e4  \ud55c\ucabd\uc740 \uac1c\ud65c\uc9c0 \ub05d\uc758  \uc790\ud615 \uc0b0\uc904\uae30\ub85c \ubc14\uae65 \uc138\uc0c1\uc5d0 \uc120\uc744 \ubcf4\uc774\uace0 \ubc18\ub300\ud3b8\uc740 \uacb9\uc0b0 \ucca9\ucca9  \uc6c5\uc22d\uae4a\uc740 \ub9db\uc744 \ub4e4\uc600\ub2e4  \ub4dc\ub7ec\ub0c4\uacfc \uac10\ucda4\uc774 \ubc18\ubc18\uc529\uc778 \uc774\uc0c1\uc801\uc778 \uc0b0\uc138\uc778 \uac83\uc774\ub2e4          \uad6c\ub8e1\uc0ac \ud070\uace8\uc758 \uac10\ucda4\uc740 \uc18c\ub098\ubb34\uc758 \uc655 \ud669\uc7a5\ubaa9\uc774\ub2e4  \uc99d\uac70\ucc98\ub7fc \uc808 \uc785\uad6c\uc5d0\ub294 \ud669\uc7a5\uae08\ud45c\uac00 \uc11c\uc788\ub2e4  \uc0c1\uc6d0\uace8\uc5d0\ub294   \ub099\uc5fd\ud65c\uc5fd\uc218\uc758 \ubc15\ubb3c\uad00  \uc774\ub77c\ub294 \ucc9c\uc5f0\uae30\ub150\ubb3c   \ud638  \uc232\uc774 \uc788\ub2e4  \ubd80\uace1\ubd84\uc9c0\ub85c\ub294 \uace0\ub824 \uc120\ube44 \uc6d0\ucc9c\uc11d\uc744 \uc228\uaca8 \uce7c\ub85c \ub098\ub77c\ub97c \uc138\uc6b4 \uc870\uc120 \ud0dc\uc885\uc744 \ud5c8\ud0d5\uce58\uace0 \ub3cc\uc544\uac00\uac8c \ud588\ub2e4  \uba85\uc0b0 \uce58\uc545\uc774 \uac00\uc9c4 \ub355\uc774\ub2e4 "
