    "Description": "          \uce60\ubd09\uc0b0\uc740 \uac15\ub989\uc2dc \uad6c\uc815\uba74 \uc81c\ube44\ub9ac\uc640 \uc131\uc0b0\uba74 \uc0b0\ubd81\ub9ac\uc758 \uacbd\uacc4\ub97c \uc774\ub8e8\ub294 \uc0b0\uc73c\ub85c \ud574\ubc1c     \uc774\ub2e4  \uc81c\ube44 \ub9ac \ub9c8\uc744\ud68c\uad00\uc5d0\uc11c \ub9c8\uc744\uc548\uae38\ub85c \ub4e4\uc5b4\uac00\uba74 \uace0\uc18d\ub3c4\ub85c \ub2e4\ub9ac \ubc11\uc744 \uc9c0\ub098 \uad6c\uc815\ud734\uac8c\uc18c \uc606\uc744 \uc9c0\ub098   \ubd84 \uc815\ub3c4 \uc624\ub974\uba74 \uce60\ubd09\uc0b0\uc131\ube44\uac00 \uc788\uace0 \uccab\ubc88\uc9f8\ubd09\uc5d0 \uc624\ub974\uba74 \ub3d9\ucabd\uc73c\ub85c \ub3d9\ud574\ubc14\ub2e4\uc640 \uac15\ub989\uc2dc\uac00\uc9c0\uac00 \uc11c\ucabd\uc73c\ub85c\ub294 \ub2a5\uacbd\ubd09\uc744 \uc704\uc2dc\ud558\uc5ec \ubc31\ub450\ub300\uac04 \ub9c8\ub8e8\uae08\uc744 \ubcfc \uc218 \uc788\ub294 \uc804\ub9dd\uc774 \uc88b\uc740 \uacf3\uc774\uba70 \uc774\uacf3\uc5d0\ub294 \ub9c8\uadc0\ud560\uba48 \uc131\uc774\ub77c\uace0\ub3c4 \ubd88\ub9ac\ub294 \uce60\ubd09\uc0b0\uc131\ud130\ub3c4 \ubcfc \uc218 \uc788\ub2e4  \ub4f1\uc0b0\ub85c\ub294 \uc81c\ube44\ub9ac\uc5d0\uc11c \uc624\ub974\ub294  \ucf54\uc2a4\uc640 \ub3d9\ud574\uace0\uc18d\ub3c4\ub85c \uad6c\uc815\ud734\uacc4\uc18c\uc5d0\uc11c\uc624\ub974\ub294 \ucf54\uc2a4\uc640 \uc131\uc0b0\uba74 \uc0b0\ubd81 \ub9ac \ub9c8\uc744\ud68c\uad00 \uc88c\uce21\uc73c\ub85c \uc624\ub974\ub294 \ucf54\uc2a4\ub85c \ubaa8\ub450  \ucf54\uc2a4\uac00 \uc788\ub2e4  \uce60\ubd09\uc0b0\uc740 \uc18c\ub098\ubb34\uc640 \ucc38\ub098\ubb34\uac00 \uc8fc\uc885\uc744 \uc774\ub8e8\uace0 \uc0b0\uc138\uac00 \uc644\ub9cc\ud558\uba70 \uc2dc\ub0b4\uc5d0\uc11c \uc790\uac00\uc6a9\uc73c\ub85c   \ubd84 \uc815\ub3c4\uba74 \uac08 \uc218 \uc788\ub294 \uc811\uadfc\uc774 \uc6a9\uc774\ud55c \ub4f1\uc0b0\ub85c\uc774\ub2e4                     \uce60\ubd09\uc0b0\uc740 \ubd09\uc6b0\ub9ac\uac00  \uac1c\ub85c \uc774\ub8e8\uc5b4\uc9c4 \uc0b0\uc774\ub77c \ubd99\uc5ec\uc9c4 \uc774\ub984\uc774\ub2e4  \ub610 \uc774 \uc0b0\uc740 \ub098\uc5f4\ub41c \ubd09\uc6b0\ub9ac\ub4e4\uc774 \ubcd1\ud48d\ucc98\ub7fc \ubcf4\uc778\ub2e4\ud558\uc5ec \ubcd1\ud48d\uc0b0\uc774\ub77c \ubd88\ub9ac\uc6b0\uae30\ub3c4 \ud558\uc600\ub2e4  \uad6c\uc815\uba74  \uc131\uc0b0\uba74  \uc655\uc0b0\uba74\uc5d0 \uac78\uccd0\uc838 \uc788\ub294 \uce60\ubd09\uc0b0 \ub2a5\uc120\uc5d0\ub294 \uc57d    \uc5d0 \uc774\ub974\ub294 \uc61b \uc0b0\uc131\uc9c0\uac00 \ub0a8\uc544 \uc788\ub2e4  \uc5b4\ub290 \uc2dc\ub300\uc5d0 \ub204\uac00 \ucd95\uc870 \ud588\ub294\uc9c0 \uc0b0\uc131\uc758 \ub0b4\ub825\uc740 \uc54c\uc218 \uc5c6\uace0 \uc778\uadfc\uc8fc\ubbfc\uc740 \ub9c8\uadc0\ud560\uba48\uc131\uc774\ub77c\uace0 \ubd80\ub974\uace0 \uc788\ub2e4  \ucd95\uc131 \ud615\uc2dd\uc73c\ub85c \ubcf4\uc544 \uc0bc\uad6d\uc2dc\ub300 \uc774\uc804\uc758 \uc0b0\uc131\uc73c\ub85c \ucd94\uc815\ud558\uace0 \uc788\uc73c\uba70 \uc138\uc6d4\uc774 \ud758\ub7ec \uc0b0\uc131\uc740 \ubb34\ub108\uc838 \uadf8 \uc790\ucde8\ub9cc\uc744 \ub0a8\uae30\uace0 \uc788\ub2e4  \uc9c0\uae08\uc740 \uac00\ub054\uc529 \ub0a8\uc740 \uc0b0\uc131\uc758 \uc794\ud574\ub4e4\uacfc \ub3cc\ud0d1\ub4e4 \uadf8\ub9ac\uace0 \ud6c4\ub300\uc5d0 \uc138\uc6cc\uc9c4 \uce60\ubd09\uc0b0\uc131\ube44\uac00 \uaca8\uc6b0 \uc0b0\uc131\uc758 \ub0b4\ub825\uc744 \ubcf4\uc874\ud558\uace0 \uc788\ub2e4 "
