    "Description": "    \ub0a8\ud55c\uac15 \ud718\uac10\uc544 \ub3c4\ub294 \uc5b5\uc0c8\uc758 \uc0b0        \uac15\uc6d0\ub3c4\uc640 \ucda9\ubd81\uc758 \uacbd\uacc4\ub97c \uc774\ub8e8\ub294 \ud0dc\ud654\uc0b0\uc740 \uc774\ub984\uc5d0 \uac78\ub9de\ub294 \ud06c\uace0 \uc544\ub984\ub2e4\uc6b4 \uc0b0\uc774\ub2e4  \uc544\uc6b8\ub7ec \uc544\ub2f4\ud55c \uc5b5\uc0c8\ubc2d\uc744 \uac00\uc9c0\uace0 \uc788\uc5b4 \uac00\uc744\uc0b0\ud589\uc9c0\ub85c \uc54c\ub9de\ub2e4  \uadf8\ub807\uc9c0\ub9cc \uc8fc\uc704\uc5d0 \uc788\ub294 \uc6d0\uc8fc\uc758 \uce58\uc545\uc0b0\uacfc \ub2e8\uc591\uc758 \uc18c\ubc31\uc0b0  \uc6d4\uc545\uc0b0\uad6d\ub9bd\uacf5\uc6d0\uc758 \uadf8\ub298\uc5d0 \uac00\ub824 \ub9ce\uc774 \uc54c\ub824\uc9c0\uc9c0\ub294 \ubabb\ud55c \uc0b0\uc774\ub2e4  \uc774\ub7f0 \uc5f0\uc720\ub85c \ud0dc\ud654\uc0b0\uc5d0\uc11c\ub294 \uc544\uc9c1\ub3c4 \uc0ac\ub78c\uc758 \ubc1c\uae38\uc774 \ub2ff\uc9c0 \uc54a\uc740 \ud0dc\uace0\uc758 \uc790\uc5f0\ubbf8\ub97c \ubcfc \uc218\uac00 \uc788\ub2e4  \uac8c\ub2e4\uac00 \ub0a8\ud55c\uac15\uc774 \uc0b0\uc790\ub77d\uc744 \ud718\uac10\uc544 \ud750\ub974\uace0  \uc5b5\ub144\uc758 \uc2e0\ube44\ub97c \uac04\uc9c1\ud55c \uace0\uc528\ub3d9\uad74\ub97c \ud488\uc5d0 \uc548\uace0 \uc788\uc5b4 \uc0b0\ud589\uc758 \ubb18\ubbf8\ub97c \ub354\ud55c\ub2e4          \uc0ac\uacc4\uc808 \ubcc0\ud654\ubb34\uc30d\ud55c \ubd80\ub4dc\ub7ec\uc6b4 \ub2a5\uc120\uae38\uc740 \uc544\ub984\ub2e4\uc6b4 \ube44\uacbd\uc744 \ubcf4\uc5ec\uc8fc\uace0 \uac00\uc871\ub2e8\uc704 \uc0b0\ud589\uc9c0\ub85c \uc801\uaca9\uc778 \uc0b0\uc774\ub2e4  \ud0dc\ud654\uc0b0 \uc0b0\ud589\uc758 \ub4e4\uba38\ub9ac\ub294 \uc8fc\ub85c \uc601\ucd98  \ud314\uad34\ub9ac  \uace0\uc528\ub3d9\uad74 \ub4f1  \uad70\ub370\uc774\uc9c0\ub9cc \uace0\uc528\ub3d9\uad74 \ucabd\uc740 \uac00\ud314\ub77c \uc8fc\ub85c \uc601\ucd98\uc774\ub098 \ud314\uad34\ub9ac\ub97c \ub4e4\uba38\ub9ac\ub85c \ub9ce\uc774 \uc7a1\ub294\ub2e4"
