    "Description": "          \ud669\uc0c8\ubd09\uc740 \ub0a8\ucabd\uc73c\ub85c\ub294 \uc8fc\ucd0c\uba74\uc5d0\uc11c \ubd81\ucabd\uc73c\ub85c\ub294 \uc9c4\uc601\uc74d \uace0\ubaa8\ub9ac\uae4c\uc9c0    \uac00 \ub118\uac8c \ubed7\uc5b4\uc788\uc73c\uba70 \uc11c\ucabd\uc73c\ub85c \uc9c4\ub840\uba74\uc744 \uc548\uace0\uc788\ub294 \ud574\ubc1c      \uc548\ud30e\uc758 \ub3c4\uc2dc \uadfc\uad50 \uc0b0\uc73c\ub85c \ub099\ub0a8\uc815\ub9e5\uc758 \ud55c \uad6c\uac04\uc774\uae30\ub3c4 \ud55c\ub2e4  \uc778\uadfc\uc5d0 \ud070 \uc8fc\uac70\ub2e8\uc9c0\uac00 \uc5c6\uc5b4\uc11c \ube44\uad50\uc801 \ub4f1\uc0b0\ub85c\uac00 \uc591\ud638\ud55c \ud3b8\uc774\uace0 \ubb3c\uc774 \ud48d\ubd80\ud558\uc5ec \uc2dd\uc0dd\ub3c4 \uc88b\uc740 \ud3b8\uc774\ub2e4  \ud558\uc9c0\ub9cc \uc6a9\uc9c0\ubd09\ucabd\uc73c\ub85c \uc774\uc5b4\uc9c0\ub294 \ub099\ub0a8\uc815\ub9e5\uad6c\uac04\uc774 \uace0\uc18d\ub3c4\ub85c\ub85c \uc778\ud574 \ub04a\uc5b4\uc9c4 \uc0c1\ud0dc\uc774\uace0 \ud604\uc7ac \uace8\ud504\uc7a5\uc774 \uac74\uc124\ub418\uace0 \uc788\uc5b4 \ub4f1\ub85c\uc758 \uc190\uc2e4\uc774 \ub354\uc6b1 \ud074 \uac83\uc73c\ub85c \uc608\uc0c1\ub41c\ub2e4             \uc9c4\ub840\uba74 \uc0c1\uc6b0\ub4b7\uc0b0\uc73c\ub85c \ub192\uc774\ub294     \uc774\ub2e4 \uc5e3\ub0a0 \uc9c4\ub840 \ucc9c\uc9c0\uac00 \uc628\ud1b5 \ubb3c\uc5d0 \uc7a0\uacbc\uc744 \ub54c \ud669\uc0c8 \ud55c \ub9c8\ub9ac\uac00 \uc549\uc744 \uacf3\uc744 \ucc3e\uc544 \ud5e4\ub9e4\ub2e4\uac00 \uc549\uc740 \uacf3\uc774 \ud669\uc0c8\ubd09 \uc815\uc0c1\uc73c\ub85c \uadf8 \ud6c4\ub85c \uc0b0 \uc774\ub984\uc774 \ud669\uc0c8\ubd09\uc73c\ub85c \ubd88\ub9ac\uc6b4\ub2e4 "
